(64784, 'itIT', '9.0 Rated PvP Incentive - Shadowlands Season 2 Exclusive Mount', '', '', '', '', '', '', '', '', 39653),
(64651, 'itIT', 'Anima di Cobra', 'Porta l\'Anima di Cobra a Dama Muunn nel Cuore della Foresta.', '<L\'Anima di Cobra è avida e protettiva. La forma di cobra sarà tua da invocare.>', '', '', '', '', '', 'Porta l\'Anima di Cobra a Dama Muunn nel Cuore della Foresta.', 39653),
(64650, 'itIT', 'Anima di Iena', 'Porta l\'Anima di Iena a Dama Muunn nel Cuore della Foresta.', '<L\'Anima di Iena è impetuosa ed energica. La forma di iena sarà tua da invocare.>', '', '', '', '', '', 'Porta l\'Anima di Iena a Dama Muunn nel Cuore della Foresta.', 39653),
(64640, 'itIT', 'AubriesTestQuestForJeff', '', '', '', '', '', '', '', '', 39653),
(64607, 'itIT', 'Tazavesh: Un grande affare', 'Cerca il socio d\'affari di Au\'manal e offrigli il tuo aiuto.', 'Ah, il mio lavoro è meraviglioso addosso a te. Sei la quintessenza delle legittimità!\n\nE ora che ti ho aiutato coi miei talenti, tu mi aiuterai coi tuoi. Cerca il mio socio in affari, Fe\'tajid, all\'Approdo Dorato, e offrigli il tuo aiuto.\n\nNon vedo l\'ora di sapere del tuo successo.', '', '', '', '', '', '', 39653),
(64599, 'itIT', 'Sanctum del Dominio - Guai se non lo fai', 'Raccogli 4 Frammenti del Filatterio da Kel\'Thuzad al Sanctum del Dominio in modalità Mitica.', 'Sento la presenza di Kel\'thuzad in queste sale. Recupera frammenti dal suo filatterio e potrò aprire una nuova via per le sue stanze.\n\nQuattro frammenti dovrebbero bastare. Non vogliamo che torni di nuovo, vero?', '', '', '', '', '', '', 39653),
(64598, 'itIT', 'Sanctum del Dominio - Guai se non lo fai', 'Ottieni 4 Frammenti di Filatterio da Kel\'Thuzad nel Sanctum del Dominio in modalità Eroica.', 'Sento la presenza di Kel\'thuzad in queste sale. Recupera frammenti dal suo filatterio e potrò aprire una nuova via per le sue stanze.\n\nQuattro frammenti dovrebbero bastare. Non vogliamo che torni di nuovo, vero?', '', '', '', '', '', '', 39653),
(64597, 'itIT', 'Sanctum del Dominio - Guai se non lo fai', 'Recupera 4 Frammenti di Filatterio da Kel\'Thuzad al Sanctum del Dominio in modalità Normale.', 'Sento la presenza di Kel\'thuzad in queste sale. Recupera frammenti dal suo filatterio e potrò aprire una nuova via per le sue stanze.\n\nQuattro frammenti dovrebbero bastare. Non vogliamo che torni di nuovo, vero?', '', '', '', '', '', '', 39653),
(64571, 'itIT', 'Tazavesh: Cercare e non distruggere', '', '', '', '', '', '', '', '', 39653),
(64567, 'itIT', 'Lo studioso scomparso', 'Trova lo Studioso Roh-Suir a Korthia.', 'Ah, Calcafauce. Ritorni al momento del bisogno, il che ci dona rinnovato ottimismo.\n\nMolti studiosi risultano ancora dispersi. Crediamo che l\'ultima volta siano stati visti mentre studiavano nella grande corte. Temiamo che possano essersi persi, o peggio, che siano stati rapiti da coloro che vogliono rovinare il nostro modo di vivere.\n\nTorna da me quando avrai delle risposte.\n\nChe il sentiero ti guidi.', '', '', '', '', '', '', 39653),
(64562, 'itIT', 'Ci serve un guaritore. Tu!', 'Cura $1oa Alleati della Congrega Feriti al Quorum del Cercatore.', 'Ci sono troppi feriti sul campo di battaglia!\n\nNon tutti possono \"farsi forza e tirare avanti\". Ci servono più guaritori.\n\nTu, prendi il mio dispositivo e rimetti in piedi i nostri feriti!', '', '', '', '', '', '', 39653),
(64561, 'itIT', 'Registri osservazionali', 'Raccogli $1oa Registri Osservazionali dal Nido Ventoso e dall\'Estuario del Risveglio a Korthia.', 'Salute, Calcafauce, hai un momento?\n\nCome sicuramente saprai, il mio cartello ha sparso dispositivi di osservazione per tutta Korthia. Ma quei dati non ci sono di nessun aiuto se non li recuperiamo. Ed è qui che entri in gioco tu.\n\nI dati del Nido Ventoso e dell\'Estuario del Risveglio dovrebbero essere pronti per la raccolta. Non vedrai i dispositivi, ma i loro dati ti appariranno come una sfera luminosa.\n\nE non dimenticare di cercare sottoterra!\n\nPortami quei dati e ti ricompenserò adeguatamente.', '', '', '', '', '', '', 39653),
(64560, 'itIT', 'Requisizione dell\'Animum', 'Recupera $1oa Animum Divorato dai divoratori al Sacrario della Guida.', 'I nostri sforzi hanno bisogno di una costante fornitura di truppe, rifornimenti e Animum. L\'ultimo è il più raro, per ovvie ragioni. Ma ho imparato a essere intraprendente.\n\nQua vicino c\'è una fonte di Animum abbondante: i divoratori che attualmente infestano il Sacrario della Guida. Non è facile estrarne da un\'anima, ma è ugualmente efficace, se sei abbastanza forte. Lo sei?', '', '', '', '', '', '', 39653),
(64557, 'itIT', 'Trovato nell\'oscurità', 'Trova Ve\'lato a Torgast, Torre dei Dannati', 'Il Cartello Ve è noto per aggirarsi in luoghi pericolosi in cerca di tesori. Se avessero un po\' di buon senso, lascerebbero l\'acquisizione e la vendita di merci al Cartello Xy. E invece.\n\nUn membro del Cartello Ve è scomparso a Torgast con una scatola piena di potenti oggetti che riteneva lo avrebbero aiutato a esplorare in sicurezza. Che stolto!', '', '', '', '', '', '', 39653),
(64556, 'itIT', 'In cerca d\'aiuto', 'Completa 3 missioni giornaliere di Mikanikos, Ta\'nasi e Kael\'thas a Korthia.', 'Gli abitanti di Korthia hanno sofferto molto. Se non fosse stato per il nostro arrivo, le forze del Carceriere si sarebbero riversate nel resto della Città dei Segreti, lasciandosi alle spalle solo distruzione.\n\nPer continuare con i nostri sforzi, dobbiamo aiutare chi ha più bisogno.\n\nRispondi alla chiamata dei nostri alleati, Calcafauce. Assicurati che nessun servo del Carceriere sopravviva.', '', '', '', '', '', '', 39653),
(64555, 'itIT', 'A caccia di segreti', 'Parla con gli esploratori a Korthia.', 'Ognuna delle Congreghe ha messo a disposizione i propri specialisti in ognuna delle loro aree di competenza. Alcuni di loro si sono fatti avanti per esplorare questa terra sconosciuta.\n\nParla con loro. Dovrebbero avere tutti un rapporto sulla loro esplorazione. Riportali a me.', '', '', '', '', '', '', 39653),
(64554, 'itIT', 'Assalto dei Venthyr', 'Completa $1oa Missioni nel Forte della Perdizione e il Volto dell\'Oblio.', 'Le forze del Carceriere sono state colte di sorpresa dal nostro attacco. Invaderemo il Forte della Perdizione e sconfiggeremo i suoi campioni all\'Altare del Dominio!\n\nServe il tuo aiuto, Calcafauce. Aiuta le nostre forze sul campo!', '', '', '', '', '', '', 39653),
(64553, 'itIT', 'Leggenda del Grandanimum', 'Consegna la Leggenda del Grandanimum alla Stratega Sakaa a Oblio del Peccato.', '<Sembra essere una serie incompleta di annotazioni di un archivista sulla sua ricerca di una fonte d\'Animum mitologica nascosta da qualche parte nelle profondità di Korthia.\n\nLa Stratega Sakaa a Oblio del Peccato potrebbe aiutarti a mettere insieme una squadra per cercarla.>', '', '', '', '', '', 'Consegna la Leggenda del Grandanimum alla Stratega Sakaa a Oblio del Peccato.', 39653),
(64552, 'itIT', 'Leggenda del Grandanimum', 'Consegna la Leggenda del Grandanimum a Koros nel Forte Elisio.', '<Sembra essere una serie incompleta di annotazioni di un archivista sulla sua ricerca di una fonte d\'Animum mitologica nascosta da qualche parte nelle profondità di Korthia.\n\nKoros nel Forte Elisio potrebbe aiutarti a mettere insieme una squadra per cercarla.>', '', '', '', '', '', 'Consegna la Leggenda del Grandanimum a Koros nel Forte Elisio.', 39653),
(64551, 'itIT', 'Leggenda del Grandanimum', 'Consegna la Leggenda del Grandanimum a Merick Sfregiaterra nel Seggio del Primus.', '<Sembra essere una serie incompleta di annotazioni di un archivista sulla sua ricerca di una fonte d\'Animum mitologica nascosta da qualche parte nelle profondità di Korthia.\n\nMerick Sfregiaterra nel Seggio del Primus potrebbe aiutarti a mettere insieme una squadra per cercarla.>', '', '', '', '', '', 'Consegna la Leggenda del Grandanimum a Merick Sfregiaterra nel Seggio del Primus.', 39653),
(64549, 'itIT', 'Leggenda del Grandanimum', 'Consegna la Leggenda del Grandanimum alla Guardiana Sbocciavespro nel Cuore della Foresta.', '<Sembra essere una serie incompleta di annotazioni di un archivista sulla sua ricerca di una fonte d\'Animum mitologica nascosta da qualche parte nelle profondità di Korthia.\n\nLa Guardiana Sbocciavespro nel Cuore della Foresta potrebbe aiutarti a mettere insieme una squadra per cercarla.>', '', '', '', '', '', 'Consegna la Leggenda del Grandanimum alla Guardiana Sbocciavespro nel Cuore della Foresta.', 39653),
(64541, 'itIT', 'Il costo della Morte', '', '', '', '', '', '', '', '', 39653),
(64532, 'itIT', 'Le reliquie finali', 'Esamina le reliquie mancanti nel Reliquiario della Rimembranza e acquista il Rapporto di Ricerca: Santuari Antichi.', 'Ho buone notizie, $n. Ho scoperto l\'ultima reliquia mancante! \n\nPotrebbe essere difficile trovarla, ma ho sviluppato la giusta ricerca per aiutarti.\n\nEsamina l\'ultima reliquia mancante. Siamo così vicini a trovarle tutte!', '', '', '', '', '', '', 39653),
(64531, 'itIT', 'Mor\'geth', '', '', '', '', '', '', '', '', 39653),
(64530, 'itIT', 'Cristallo di Alagreve', 'Consegna il Cristallo di Alagreve alla Madrepietra nel Riposo del Custode.', '<Questo grosso frammento di cristallo si è staccato dall\'enorme corpo del costrutto. All\'interno vedi delle scariche di energia.\n\nLa Madrepietra al Riposo del Custode potrebbe usare questo cristallo per attivare un\'Alagreve per te.>', '', '', '', '', '', 'Consegna il Cristallo di Alagreve alla Madrepietra nel Riposo del Custode.', 39653),
(64529, 'itIT', 'Nucleo di Aquilon Intatto', 'Consegna il Nucleo di Aquilon Intatto a Deos nel Riposo del Custode.', '<L\'enorme divoratore teneva stretto nel suo pugno questo Nucleo di Aquilon quando è morto, sicuramente l\'avrà strappato a uno degli Aquilon nelle vicinanze. Il nucleo energetico sembra essere praticamente intatto.\n\nDeos al Riposo del Custode può aiutarti a trovare un Aquilon nel quale installare il nucleo.>', '', '', '', '', '', 'Consegna il Nucleo di Aquilon Intatto a Deos nel Riposo del Custode.', 39653),
(64528, 'itIT', 'Sella del Selvante', 'Consegna la Sella del Selvante a Reldorn al Riposo del Custode.', '<Mentre scendevi dal dorso del Selvante Fuggito, questo si è districato dalla sua sella e l\'ha fatta cadere ai tuoi piedi. Sembrava riluttante quando i Silfi della Notte l\'hanno portato via verso il Riposo del Custode.\n\nReldorn al Riposo del Custode potrebbe sapere il significato di questo gesto. >', '', '', '', '', '', 'Consegna la Sella del Selvante a Reldorn al Riposo del Custode.', 39653),
(64527, 'itIT', 'Osservare l\'inseguimento', 'Attiva la modalità Guerra e uccidi $1oa personaggio nel mondo.', 'Nelle nostre osservazioni dei conflitti della vostra razza, abbiamo notato un\'alta probabilità di fuga tra le prede.\n\nQuesto non va a vantaggio dei nostri sforzi di osservazione.\n\nL\'Osservatore ha ottenuto uno strumento che riteniamo migliorerà la tua abilità di forzare il conflitto.\n\nPrima di consegnarlo a te, ti chiediamo di dimostrare la tua volontà di partecipare a tali conflitti, così che potremo ottenere un degno ritorno su questo investimento.', '', '', '', '', '', '', 39653),
(64526, 'itIT', 'Fenditure misteriose', 'Esamina le reliquie mancanti nel Reliquiario della Rimembranza e acquista una Chiave della Fenditura Riparata da Roh-Suir.', 'Grazie infinite per il tuo aiuto, $n. Grazie al codice, ho scoperto altre reliquie intatte.\n\nLa chiave per trovare queste reliquie è nelle strane fenditure a Korthia.\n\nDovrei riuscire a creare un modo per farti entrare in queste fenditure e trovare altre reliquie mancanti.\n\nCome sempre, ti ho fornito dei campioni di queste reliquie. Ricordati di esaminarle prima di partire.', '', '', '', '', '', '', 39653),
(64522, 'itIT', 'Scorte di Korthia Rubate', 'Consegna le Scorte di Korthia alla Duchessa Mynx nel Riposo del Custode.', '<Queste scorte sono segnate col sigillo della Marcia della Morte, rubate dalla Fenditura senza che nessuno se ne accorgesse.\n\nLa Duchessa Mynx al Riposo del Custode ti sarebbe grata se gliele restituissi.>', '', '', '', '', '', 'Consegna le Scorte di Korthia alla Duchessa Mynx nel Riposo del Custode.', 39653),
(64521, 'itIT', 'I piani di battaglia degli Helsvorn', 'Consegna i Piani di Battaglia degli Helsvorn alla Duchessa Mynx nel Riposo del Custode.', '<Questi piani di battaglia contengono tutti i dettagli sui possibili spostamenti attraverso Korthia, e includono informazioni dettagliate sulle difese della Marcia della Morte nella regione.\n\nLa Duchessa Mynx al Riposo del Custode potrebbe diffondere rapidamente queste informazioni a coloro che ne hanno bisogno.>', '', '', '', '', '', 'Consegna i Piani di Battaglia degli Helsvorn alla Duchessa Mynx nel Riposo del Custode.', 39653),
(64519, 'itIT', 'Archivi perduti', 'Esamina le reliquie mancanti nel Reliquiario della Rimembranza.', 'Ho finito le mie ricerche su altre reliquie che potrebbero ancora esistere a Korthia. Credo siano ancora nei nostri archivi più piccoli.\n\nCon il tuo aiuto, posso ricreare i dispositivi per riparare le entrate di questi archivi.\n\nHo posizionato delle repliche delle reliquie ancora mancanti. Guardale per sapere cosa cercare.', '', '', '', '', '', '', 39653),
(64513, 'itIT', 'Testa di Ve\'rayn', 'Porta la Testa di Ve\'rayn a Ve\'nari al Rifugio di Ve\'nari.', '<Ve\'rayn ha dato la caccia a Ve\'nari per un bel po\'. A Ve\'nari piacerebbe molto avere una prova del fatto che Ve\'rayn non rappresenti più un problema.>', '', '', '', '', '', 'Porta la Testa di Ve\'rayn a Ve\'nari al Rifugio di Ve\'nari.', 39653),
(64511, 'itIT', 'Reliquie mancanti', 'Esamina le reliquie mancanti nel Reliquiario della Rimembranza.', 'Grazie al tuo aiuto, sono riuscito a recuperare altre ricerche sulle reliquie perdute degli archivi.\n\nHo riesaminato il codice e credo ci siano altre reliquie a Korthia che possono essere recuperate.\n\nSono state sigillate in forzieri che credo siano stati sparsi per tutta Korthia durante l\'attacco iniziale.\n\nHo allestito le reliquie mancanti qui dentro. Ricordale. Devono essere recuperate.', '', '', '', '', '', '', 39653),
(64509, 'itIT', 'Copricapo stiloso', '', '', '', '', '', '', '', '', 39653),
(64508, 'itIT', '[DNT] Conduit Energy', '', '', '', '', '', '', '', '', 39653),
(64506, 'itIT', 'Ciò che va trovato', 'Scopri quali reliquie mancano al Reliquiario della Rimembranza.', 'Molte cose sono dettagliate nel codice. Oggetti perduti per sempre, e altri che esistono ancora.\n\nPotrebbero esserci ancora altre potenti reliquie nascoste da qualche parte dentro Korthia. \n\nVai al reliquiario. Potrai vedere alcuni dei manufatti ancora intatti di Korthia.\n\nMemorizzali. Devi trovarli e riportarli da me.', '', '', '', '', '', '', 39653),
(64469, 'itIT', 'Avventuriero: Lucia', '', '', '', '', '', '', '', '', 39653),
(64468, 'itIT', 'Avventuriero: Dama Iza', '', '', '', '', '', '', '', '', 39653),
