(64458, 'itIT', 'Avventuriera: Sulana', '', '', '', '', '', '', '', '', 39653),
(64441, 'itIT', 'Una questione da sistemare', 'Raccogli il libro per riportarlo indietro.', '<Un libro che sembra provenire dall\'accampamento Venthyr nelle vicinanze.\n\nProbabilmente i Venthyr apprezzerebbero se glielo riportassi prima che i gromit lo usino come materiale per il nido. >', '', '', '', '', '', '', 39653),
(64438, 'itIT', 'Potenziare l\'equipaggiamento', 'Parla con l\'Assistente Studioso Kah-Vez per potenziare un pezzo di equipaggiamento di Korthia.', 'Le ricerche che trovi possono sbloccare molte possibilità.\n\nUna tra queste è un modo per migliorare l\'equipaggiamento che potresti trovare a Korthia.\n\nParla con il mio assistente nelle vicinanze. Può usare le nostre ricerche per ripristinare questo equipaggiamento al suo antico potere.', '', '', '', '', '', '', 39653),
(64437, 'itIT', 'Informare il Primus', 'Torna dal Primus a Korthia.', '$n, torna a Korthia e di\' al Primus che il Sigillo della Regina dell\'Inverno è stato ripristinato.', '', '', '', '', '', '', 39653),
(64432, 'itIT', 'Dalla forza alla debolezza', 'Potenzia il Parafulmine, poi uccidi i Giurafauce.', '$p, i pezzi di metallo che abbiamo recuperato hanno delle proprietà interessanti. Sono portato a credere che i Giurafauce stiano infondendo la loro armatura per aumentarne la resistenza.\n\nPrendi questo Parafulmine. Per cominciare, dovrai farti colpire da un fulmine. Non fare quella faccia. Non ti succederà niente. Però devi restare su un pezzo di metallo Giurafauce. Le grandi catene di Korthia, quelle vicino al Nido Ventoso, dovrebbero fare al caso nostro.\n\nUna volta che... eh... sentirai l\'energia, invierò un tauralus, Borheas, per portarti in battaglia.', '', '', '', '', '', '', 39653),
(64376, 'itIT', 'Tracking Quest', '', '', '', '', '', '', '', '', 39653),
(64368, 'itIT', 'Efficienza delle reliquie', '', '', '', '', '', '', '', '', 39653),
(64325, 'itIT', 'Veterano di Oblio del Peccato', 'Incontra Zo\'sorg nell\'Enclave a Oribos.', 'Oblio del Peccato prospera grazie alle tue vittorie, $n!\n\nI tuoi successi non sono passati inosservati, anche oltre i confini di Revendreth.\n\nI racconti delle tue vittorie riecheggiano nelle sale di Oribos. Zo\'sorg, il Maestro del Conflitto, ha richiesto un incontro con te nell\'Enclave.\n\nHa un forte interesse per l\'arte della guerra, ti consiglio di non farlo aspettare.', '', '', '', '', '', '', 39653),
(64324, 'itIT', 'Veterano dei Necrosignori', 'Incontra Zo\'sorg nell\'Enclave a Oribos.', 'La potenza dei Necrosignori cresce grazie a te, $n.\n\nI tuoi successi non sono passati inosservati, anche oltre i confini di Maldraxxus.\n\nI racconti delle tue vittorie hanno risuonato nelle sale di Oribos. Zo\'sorg, il Maestro del Conflitto, ha richiesto un incontro con te nell\'Enclave.\n\nHa un forte interesse per l\'arte della guerra, ti consiglio di non farlo aspettare.', '', '', '', '', '', '', 39653),
(64323, 'itIT', 'Veterano dei Kyrian', 'Incontra Zo\'sorg nell\'Enclave a Oribos.', 'Il Bastione si sta riprendendo grazie a te, $n. La via è chiara.\n\nI tuoi successi non sono passati inosservati, anche oltre i confini del Bastione.\n\nI racconti delle tue vittorie hanno risuonato nelle sale di Oribos. Zo\'sorg, il Maestro del Conflitto, ha richiesto un incontro con te nell\'Enclave.\n\nHa un forte interesse per l\'arte della guerra, ti consiglio di non farlo aspettare.', '', '', '', '', '', '', 39653),
(64322, 'itIT', 'Veterano dei Silfi della Notte', 'Incontra Zo\'sorg nell\'Enclave a Oribos.', 'Grazie a te, ora Selvarden è più sicura di quanto non lo sia stata da qualche tempo a questa parte.\n\nI tuoi successi non sono passati inosservati, anche oltre i confini di Selvarden.\n\nI racconti delle tue vittorie hanno risuonato nelle sale di Oribos. Zo\'sorg, il Maestro del Conflitto, ha richiesto un incontro con te nell\'Enclave.\n\nHa un forte interesse per l\'arte della guerra, ti consiglio di non farlo aspettare.', '', '', '', '', '', '', 39653),
(64314, 'itIT', 'Congreghe rinnovate', 'Parla con il Primus, quindi prendi i sigilli da ogni Congrega.', 'I nostri sforzi erano concentrati sull\'impedire al Carceriere di distruggere la barriera attorno alla Fauce e invadere il resto delle Terretetre.\n\nInvece, egli ha ampliato la Fauce stessa per avvolgere Oribos e reclamare il sigillo dell\'Arbiter.\n\nNon comprendo appieno quello che abbiamo visto sulla cima di Torgast, ma il Primus sicuramente sì.\n\nÈ tempo di agire con il suo piano di riserva. Le Congreghe arriveranno a breve con i loro sigilli. \n\nInforma il Primus che siamo pronti per iniziare.', '', '', '', '', '', '', 39653),
(64306, 'itIT', 'Criteri di completamento delle missioni', '', '', '', '', '', '', '', '', 39653),
(64304, 'itIT', 'Nuove opportunità ti aspettano', 'Uccidi $1oa giocatori a Korthia.', 'Vai di fretta da qualche parte? Ah, sei tu, Calcafauce... non starai mica andando all\'avventura per esplorare la nuova e misteriosa massa all\'interno della Fauce, vero?\n\nMi chiedo quali segreti nasconda.\n\nForse c\'è qualcosa che possiamo fare per aiutarci a vicenda.\n\nSe ti è d\'interesse, possiamo continuare la nostra discussione, altrimenti vattene. Troverò qualcun altro per questo lavoro.', '', '', '', '', '', '', 39653),
(64292, 'itIT', 'Maelie, la Girovaga', 'Accetta la responsabilità di Maelie.', 'Non potrò mai ringraziarti abbastanza per aver trovato Maelie! Sai, credo che lei sia più dura da gestire di quanto pensassi.\n\nTi spiacerebbe accudirla per me? Credo che tu le piaccia davvero!', '', '', '', '', '', '', 39653),
(64290, 'itIT', 'Raccogliere ricerche', 'Parla con l\'Archivista Roh-Suir per consegnare una qualsiasi Reliquia di Korthia in cambio di Ricerca Catalogata.', 'Hai fatto bene a raccogliere questi frammenti. Ci aiuteranno molto nel ripristino dei nostri Archivi.\n\nPosso usare quello che hai ritrovato per acquisire altre ricerche su quello che è andato perduto di Korthia. \n\nDopodiché, starà a te trovare altri frammenti e reliquie a Korthia per potenziare i nostri Archivi.', '', '', '', '', '', '', 39653),
(64289, 'itIT', '...e i cocci sono suoi', 'Recupera 50 Frammenti di Reliquia dalle creature rare e dai tesori di Korthia.', 'Molto è andato perduto quando Korthia è stata trascinata nella Fauce.\n\nMolte reliquie inestimabili sono andate distrutte. Ho visto delle creature trasportare frammenti di questi oggetti.\n\nDobbiamo recuperarli.\n\nAffronta le forze del Carceriere e cerca i frammenti dei nostri gloriosi archivi tra quello che resta di Korthia.', '', '', '', '', '', '', 39653),
(64288, 'itIT', 'Eccellenza con Ve\'nari', 'Parla con Ve\'nari al Rifugio di Ve\'nari nella Fauce.', 'Vieni, Calcafauce. Incontriamoci al mio rifugio.\n\nAbbiamo un\'ultima questione di cui discutere.\n\nAssicurati di non essere $gseguito:seguita;.', '', '', '', '', '', '', 39653),
(64287, 'itIT', 'Eccellenza con il Codice degli Archivisti', 'Parla con l\'Archivista Roh-Suir nel Reliquiario della Rimembranza a Korthia.', 'Hai fatto di tutto per recuperare ciò che abbiamo di più caro, Calcafauce.\n\nIncontriamoci nella mia sala quando sarai $gpronto:pronta;. Abbiamo un\'ultima questione di cui discutere.', '', '', '', '', '', '', 39653),
(64286, 'itIT', 'Eccellenza con la Marcia della Morte', 'Parla con la Duchessa Mynx al Riposo del Custode presso Korthia.', 'L\'invito ad agire ha ottenuto risposta, ancora una volta. I tuoi sforzi non passeranno inosservati.\n\nVediamo se riusciamo a trovare una ricompensa adeguata per i tuoi sforzi.', '', '', '', '', '', '', 39653),
(64282, 'itIT', 'Sorprese infinite', 'Trova lo Scrigno di Zovaal.', 'Continui a sorprendermi, Calcafauce. La tua presenza qua è inaspettata!\n\nVisto che ci troviamo entrambi qui, credo che dovremmo cooperare.\n\nIl Carceriere nasconde uno scrigno pieno di oggetti preziosi da qualche parte in questa fenditura. Trovalo o portalo qui per essere aperto, così condivideremo i suoi tesori!', '', '', '', '', '', 'Torna da Ve\'nari, con o senza lo Scrigno di Zovaal.', 39653),
(64274, 'itIT', 'Tracking Quest', '', '', '', '', '', '', '', '', 39653),
(64273, 'itIT', 'Contenere gli Helsvorn', '', '', '', '', '', '', '', '', 39653),
(64271, 'itIT', 'Un modo più civile', 'Incontra Nadjia vicino alla strada che conduce a Korthia.', 'Ah, $p.\n\nHo una questione da discutere con te, ma non qui.\n\n<Nadjia osserva con sospetto gli altri abitanti del Riposo del Custode.>\n\nIncontriamoci dove la strada porta a Korthia dalla Fauce e ti spiegherò.', '', '', '', '', '', '', 39653),
(64267, 'itIT', 'I doni misteriosi di Ve\'nari', 'Parla con Ve\'nari al Rifugio di Ve\'nari nella Fauce.', 'Mi colpisce la tua tenacia nel sopravvivere restando comunque utile, Calcafauce. Mi ricordi quando ero più giovane e innocente.\n\nPrendi questo e continua il tuo operato... in un posto che dà meno nell\'occhio.', '', '', '', '', '', '', 39653),
(64266, 'itIT', 'Rifornimenti dal Codice degli Archivisti', 'Parla con l\'Archivista Roh-Suir nel Reliquiario della Rimembranza a Korthia.', 'Non ho parole per esprimere il calore che mi dà sapere che la tua dedizione ha fatto sì che la storia di Korthia resti intatta.\n\nPermettimi di condividere la mia gratitudine.', '', '', '', '', '', '', 39653),
(64255, 'itIT', 'Ora di festeggiare', '', '', '', '', '', '', '', '', 39653),
(64216, 'itIT', 'La conoscenza della torre', 'Posiziona la Scatola dalle Molte Cose a Torgast.', 'Il potere di questa scatola può essere sbloccato solo dandole in pasto l\'orgoglio e i ricordi. Nella sua trama vi sono incantesimi che ho visto usare su altri reami per incanalare o condizionare un\'anima. Questo... abominio... ha usato questi strumenti di redenzione e onore per creare una serratura.\n\nMentre sfidi i piani di Torgast, le tue abilità, velocità ed efficienza contribuiranno alla Conoscenza della Torre, che servirà a dare potere alla scatola.\n\nNutrila per ottenere il potere al suo interno.', '', '', '', '', '', 'Posizione la Scatola dalle Molte Cose a Torgast.', 39653),
(64214, 'itIT', 'Un simbolo di speranza', 'Aiuta a ispezionare la bussola di Anduin.', 'Prima di seguire il Carceriere attraverso il varco, Anduin ha lasciato cadere qualcosa.\n\nNon so di cosa si tratti di preciso, ma l\'ha preso Jaina. Forse è un segno che Anduin sta ancora combattendo contro il Carceriere!\n\nDobbiamo scoprire cos\'è quest\'oggetto e perché il giovane Re lo ha lasciato per noi.', '', '', '', '', '', '', 39653),
(64213, 'itIT', 'Un simbolo di speranza', 'Aiuta Jaina a ispezionare la bussola di Anduin.', 'Prima di seguire il Carceriere attraverso il varco, Anduin ha lasciato cadere qualcosa.\n\nNon credo che questo facesse parte del piano del Carceriere. Dev\'essere un segno che Anduin è ancora in possesso della sua anima!\n\n<Jaina apre la mano per mostrarti una bussola dorata.>\n\nÈ un oggetto molto prezioso per Anduin. Sento ancora la sua presenza su di esso.\n\nDobbiamo scoprire perché l\'ha lasciato indietro per noi.', '', '', '', '', '', '', 39653),
(64212, 'itIT', 'La porta verso il buio', 'Parla con Thrall e assisti alla fine della battaglia a Torgast.', 'Temo che i nostri sforzi per fermare Zovaal siano stati sventati, mortale.\n\nSi è aperta una via verso un regno proibito... e ora l\'Esiliato ha reclamato un potere che gli è stato strappato molto tempo fa.\n\nSento che i tuoi alleati stanno tornando dal Sanctum del Dominio. Devo sapere tutti i dettagli di ciò che è successo.', '', '', '', '', '', '', 39653),
(64211, 'itIT', 'La porta verso il buio', 'Parla con Jaina e assisti alla fine della battaglia a Torgast.', 'Temo che i nostri sforzi per fermare Zovaal siano stati fermati, mortale.\n\nSi è aperta una via verso un regno proibito... e ora l\'Esiliato ha reclamato un potere che gli è stato strappato molto tempo fa.\n\nSento che i tuoi alleati stanno tornando dal Sanctum del Dominio. Devo sapere tutti i dettagli di ciò che è successo.', '', '', '', '', '', '', 39653),
(64210, 'itIT', 'Scatola dalle Molte Cose', 'Porta la Scatola dalle Molte Cose all\'Incisore di Rune.', 'Ah, $gil:la; Calcafauce, naturalmente. Presto sarò cancellato, rivendicato da questo luogo per sempre. Tu però continuerai a camminare nelle sue sale, imperterrito! \n\nLa mia grande aspirazione era prevalere con l\'aiuto di questa scatola. Purtroppo, ho sopravvalutato le mie capacità.\n\nConfido nel non aver sopravvalutato le tue. Prendi la scatola. Ho lavorato a lungo per realizzarla, dimostra di esserne $gdegno:degna;.', '', '', '', '', '', '', 39653),
(64202, 'itIT', 'Ti darò una mano', 'Accetta l\'aiuto di Nilganihmaht.', 'Il tuo potere, Calcafauce... rivaleggia persino col mio prima che Zovaal separasse il mio corpo.\n\nQuesta è solo una parte del mio intero essere, ma sarà più che sufficiente...\n\nPermettimi di aiutarti nei tuoi sforzi contro Zovaal. In questo modo, compirò la mia vendetta.', '', '', '', '', '', '', 39653),
(64194, 'itIT', 'Prototipo da guerra', 'Usa il prototipo di Atleos nel Nido Ventoso per sconfiggere Kraxis.', 'Come Forgialita Supremo, mi impegno sempre per creare qualcosa di meglio!\n\nMa i Centurioni più grandi sono fin troppo grandi per essere portati a Korthia. Quindi, li aggiusto qui. Ti presento Atleos, il prototipo del colosso da campo: l\'avanguardia dei Kyrian! \n\nHa bisogno di test. Molti test. Deve essere perfetto contro un avversario potente.\n\nVai, prendi Atleos e sconfiggi una grande bestia della Fauce! Premi tutti i pulsanti!', '', '', '', '', '', '', 39653),
