(64168, 'itIT', 'Campionessa: Spora di Marasmio', '', '', '', '', '', '', '', '', 39653),
(64166, 'itIT', 'Accesso alla memoria casuale', 'Recupera i Ricordi di Korthia usando le Ali Effimere.', 'Quando il Carceriere intrappolò Korthia e la trascinò nella Fauce, distrusse gran parte di questo posto. Non solo montagne ed edifici, ma anche i suoi abitanti.\n\nQuelle persone avevano vita, speranze e ricordi.\n\nDevo pensare che non possa essere tutto sparito e che potremmo riuscire a salvare qualcosa di loro che persiste ancora.\n\nEcco, prendi parte del mio potere. Vedi se riesci a recuperare quei ricordi. Portameli e li terrò al sicuro.\n\nNessuno dovrebbe essere dimenticato.', '', '', '', '', '', '', 39653),
(64138, 'itIT', 'Tracking Quest', '', '', '', '', '', '', '', '', 39653),
(64131, 'itIT', 'Tracking Quest', '', '', '', '', '', '', '', '', 39653),
(64129, 'itIT', 'Carica della Caccia Selvaggia', 'Cavalca Aldermeigh e uccidi i Giurafauce a Korthia.', 'Da quando ho preso parte alla Caccia Selvaggia ho imparato molto su come combattere e come difendere i regni.\n\nLo ammetto, sto ancora imparando, ma sono felice di imparare assieme a tee al mio amico cervo delle rune, Aldermeigh.\n\nStanno addestrando Aldermeigh a lanciarsi in battaglia col coraggio di un Vorkai, ma ha bisogno di fare pratica. Lo porteresti fuori per fare un giro, facendogli abbattere tutti i Giurafauce che potete?', '', '', '', '', '', '', 39653),
(64106, 'itIT', 'Uno sforzo unito', 'Aiuta le Congreghe ad attaccare le forze del Carceriere nella Fauce.', 'Ti sei $gfatto:fatta; dei potenti alleati all\'interno della tua Congrega e delle altre nelle Terretetre. Questo legame è il motivo per cui hanno deciso di contribuire alla nostra causa.\n\nSono pronti a combattere al nostro fianco mentre iniziamo la nostra avanzata nella Fauce.\n\nOgni Congrega colpirà il Carceriere in una zona diversa. Aiutale a setacciare questa terra pericolosa in cerca di chiunque serva Zovaal, così da porre fine alla sua crescente influenza.', '', '', '', '', '', '', 39653),
(64103, 'itIT', 'Funziona sempre', 'Uccidi Moros, Oizys e Apate, comandanti dei Giurafauce.', '$p. Eccoci di nuovo qui, combattendo fianco a fianco per proteggere le Terretetre.\n\nStiamo combattendo una guerra persa, ma potremmo riuscire a ribaltare la situazione. Ho bisogno che tu vada a caccia di alcuni comandanti ben precisi delle forze dei Giurafauce. In ogni esercito ci sono comandanti bravi e comandanti incapaci. Eliminando quelli bravi, solo gli incapaci avanzano, indebolendo l\'intero esercito.\n\nI nostri Occhi ci hanno fornito i nomi. Ora ho solo bisogno che tu li uccida.', '', '', '', '', '', '', 39653),
(64101, 'itIT', 'Le giuste procedure', 'Recupera $1oa Ricettacoli d\'Animum Perduti.', 'Sono qui per osservare le azioni di chi proviene da Revendreth. Tuttavia, ho ricevuto notizie preoccupanti.\n\n$p, gli Attendenti mi hanno detto che hanno conservato l\'Animum nei contenitori e che la nostra gente lo sta depredando. Non è così che dovrebbe andare.\n\nPosso affidarti il compito di recuperare l\'Animum, in modo che sia riportato al suo legittimo posto?', '', '', '', '', '', '', 39653),
(64092, 'itIT', 'A caccia di Huln', 'Indossa un travestimento, poi cerca Huln Alto Monte nella Fortezza del Dominio evitando le guardie.', 'Huln è da qualche parte in questa zona, ma la Madrepietra non lascia che nessuno entri nel suo territorio a causa di recenti, uh, problemi con i Signori del Terrore. Le guardie non lasceranno entrare nessuno, e stanno sbattendo fuori chiunque sembri un intruso.\n\nFortunatamente per Huln, Mazzafaccia e io abbiamo messo su un piano infallibile!\n\nDobbiamo solo non sembrare degli intrusi e poi potremo fare qualche domanda e trovare Huln. Facile!', '', '', '', '', '', '', 39653),
(64091, 'itIT', 'Mal\'affare', 'Recupera i Sigilli del Vincolo', '<Il Signore del Terrore ti guarda, desideroso di parlare. Getti un\'occhiata ai tuoi compagni. Baccaluna ti incita ad andare avanti con un sorriso furbesco. Ti avvicini fin dove il coraggio te lo concede.>\n\nLiberami da questa prigione, mortale, e otterrai il mio favore. Sono schierato con poteri ben più grandi di quelli di queste patetiche marionette o dei loro padroni. Non hanno idea delle vere forze in gioco.\n\nMi servono solo i Sigilli del Vincolo che mi trattengono, al resto... ci penserò io.\n\nLiberami e otterrai un potere inimmaginabile.', '', '', '', '', '', '', 39653),
(64090, 'itIT', 'La grande stretta', 'Vai dove Mazzafaccia pensa che sia stato portato Huln e intrufolati.', 'Quindi il nostro amico blu si è fatto trascinare nella grande stretta. Fortunatamente, ne so un botto su \'ste robe.\n\nCi intrufoliamo come se lavorassimo lì, prendiamo l\'alce, evitiamo i denti aguzzi e svicoliamo via come dei tipi a posto. Mi segui?', '', '', '', '', '', '', 39653),
(64086, 'itIT', 'Stratega dei Kyrian', 'Incontra Zo\'sorg nell\'Enclave a Oribos.', 'Guardati attorno, $n. Il Forte Elisio è una testimonianza dei passi avanti che abbiamo fatto grazie a te.\n\nZo\'sorg ha richiesto ancora una volta la tua presenza a Oribos, vacci immediatamente.\n\nNon dobbiamo buttare al vento il favore del Cartello Zo: la fiducia del clan di un Alienatore non si guadagna facilmente.\n\nForse hanno altre ricompense da offrirti.', '', '', '', '', '', '', 39653),
(64085, 'itIT', 'Stratega dei Silfi della Notte', 'Incontra Zo\'sorg nell\'Enclave a Oribos.', 'Il tuo coraggio ha permesso a Selvarden di crescere di nuovo. Inoltre, ha attirato l\'attenzione degli Alienatori.\n\nZo\'sorg ha richiesto ancora una volta la tua presenza a Oribos, vacci immediatamente.\n\nNon dobbiamo buttare al vento il favore del Cartello Zo: la fiducia del clan di un Alienatore non si guadagna facilmente.\n\nForse hanno altre ricompense da offrirti.', '', '', '', '', '', '', 39653),
(64084, 'itIT', 'Stratega dei Necrosignori', 'Incontra Zo\'sorg nell\'Enclave a Oribos.', 'Hai portato onore ai Necrosignori. Un tale riconoscimento attira di nuovo l\'attenzione degli altri.\n\nZo\'sorg ha richiesto ancora una volta la tua presenza a Oribos, vacci immediatamente.\n\nNon dobbiamo buttare al vento il favore del Cartello Zo: la fiducia del clan di un Alienatore non si guadagna facilmente.\n\nForse hanno altre ricompense da offrirti.', '', '', '', '', '', '', 39653),
(64083, 'itIT', 'Stratega di Oblio del Peccato', 'Incontra Zo\'sorg nell\'Enclave a Oribos.', 'Oblio del Peccato sta guadagnando un rispetto che neanche Denathrius si sarebbe mai immaginato di ottenere! Ed è tutto grazie ai tuoi sforzi, $n.\n\nZo\'sorg ha richiesto ancora una volta la tua presenza a Oribos, vacci immediatamente.\n\nNon dobbiamo buttare al vento il favore del Cartello Zo: la fiducia del clan di un Alienatore non si guadagna facilmente.\n\nForse hanno altre ricompense da offrirti.', '', '', '', '', '', '', 39653),
(64080, 'itIT', 'Coi piedi per terra', 'Usa il Giavellotto di Korayn per trafiggere $1oa Araldi Giurafauce.', 'Riesco a sentire le ali dei Giurafauce nel cielo, che ci provocano.\n\nMa un uccello può essere schiacciato anche solo con una mano.\n\nPrendi la mia lancia e dimostra la tua mira. Abbattine un po\' e falli a pezzi.\n\nAssicurati di usare la lancia. Non perdere tempo ad avvicinarti di soppiatto tra loro per farti inseguire fino a terra. Non è questo lo scopo.\n\nVoglio proprio vederti trascinarli giù dal cielo.', '', '', '', '', '', '', 39653),
(64070, 'itIT', 'Scarti di Scarty', 'Raccogli $1oa Pezzi di Metallo dai Giurafauce.', 'Il nostro esercito ha sempre bisogno di armi, armature e truppe. Sempre.\n\nStiamo ricevendo rinforzi, ma non posso tenere tutti armati a dovere di questo passo. Specialmente senza una forgia completa e degli assistenti.\n\nDovremo accontentarci della seconda scelta. Voglio che tu vada a prendermi qualunque tipo di metallo che riesci a trovare dai Giurafauce. Mi occuperò io di trasformarlo in armi utilizzabili.', '', '', '', '', '', '', 39653),
(64065, 'itIT', 'Reagenti locali', 'Raccogli $1oa Artigli di Pellescheggia, $2oa Piedi di Gromit e $3oa Spine di Alafina.', 'Korthia è un luogo strano. La fauna locale è diversa, probabilmente a causa di anni di esposizione agli archivi e a tutto quello che contengono.\n\nSei $gpronto:pronta; a provare qualche esperimento? Prima ci servirà una buona scorta di reagenti.\n\nVicino al Quorum del Cercatore dovresti riuscire a trovare i pellescheggia, i gromit e gli alafina. $gAttento:Attenta; ai loro aghi!', '', '', '', '', '', '', 39653),
(64043, 'itIT', 'Ci serve un guaritore. Tu!', 'Cura $1oa Alleati della Congrega Feriti al Quorum del Cercatore.', 'Ci sono troppi feriti sul campo di battaglia!\n\nNon tutti possono \"farsi forza e tirare avanti\". Ci servono più guaritori.\n\nTu! Prendi il mio dispositivo e rimetti in piedi i nostri feriti!', '', '', '', '', '', '', 39653),
(64042, 'itIT', 'Rituali della notte', 'Assisti coi preparativi e col rituale.', 'Per Tyrande il tempo stringe, quindi dobbiamo agire in fretta.\n\n<Ysera si corruccia preoccupata.>\n\nSperavamo di radunare altri Guerrieri della Notte, ma dovremo procedere con chi abbiamo e sperare che sia sufficiente.\n\n<Ysera scuote la testa, poi sembra più risoluta.>\n\nPrima di iniziare, dobbiamo finire i preparativi per il rituale. Porta questi ultimi oggetti con te e incontraci al bosco.', '', '', '', '', '', '', 39653),
(64018, 'itIT', 'Il peso della pietra', 'Aiuta la Legione di Pietra a consegnare rifornimenti e Animum.', 'La campagna continua, $p. La Legione di Pietra è qui per cambiare le sorti della battaglia.\n\nPer prima cosa, dobbiamo consegnare i rifornimenti ai nostri alleati. Siamo gli unici a poter rifornire le nostre truppe, considerando lo stato attuale di Korthia.\n\nSecondo, dobbiamo occuparci dei Giurafauce e dei Divoratori. Ho una strategia molto semplice. Faremo cadere dell\'Animum sui Giurafauce. Questo spingerà i Divoratori ad attaccarli. O i Divoratori uccidono i Giurafauce, o i Giurafauce uccidono i Divoratori. In ogni caso, vinciamo noi.', '', '', '', '', '', '', 39653),
(64016, 'itIT', 'Melme di carattere', 'Aiuta Melm a provare la sua abilità di crescita sulla Pellescheggia alla Terrazza del Mazzuolatore.', 'Apprendista! Ti stavo cercando.\n\nKevin è stato di grande aiuto nei nostri esperimenti, vorrei addestrare le altre mie melme cosicché possano aiutarmi!\n\nPer Melm, vorrei sapere se la sua melma è in grado di consumare materiale organico e aumentare di dimensione.', '', '', '', '', '', '', 39653),
(64014, 'itIT', 'Spiegafauce', 'Chiedi l\'aiuto di Ve\'nari per vincolare l\'Ilskahorn alla Fauce.', 'Resta solo un compito prima della gloriosa battaglia. Il corno dev\'essere ancorato alla Fauce, così che la sua voce possa attraversare le barriere che circondano quel vile reame. \n\nCome può essere fatto, non lo so. Cerca qualcuno che comprende i misteri di quel posto. Potrà certamente guidare la tua mano.\n\nDanica e le sue sorelle ascolteranno la chiamata dell\'Ilskahorn. Risponderanno quando avrai bisogno di loro, $n.', '', '', '', '', '', '', 39653),
(64012, 'itIT', 'Rifornimenti dalla Marcia della Morte', 'Parla con la Duchessa Mynx al Riposo del Custode presso Korthia.', 'Il tuo impegno nel fermare l\'avanzata del Carceriere non è passato inosservato. Se cerchi il potere per portare avanti i tuoi sforzi, credo di poterti aiutare.', '', '', '', '', '', '', 39653),
(64007, 'itIT', 'La carica delle Congreghe', 'Raduna le forze delle Congreghe per entrare nella Fauce.', 'Grazie ai tuoi sforzi e a quelli degli altri eroi di Azeroth, le Congreghe sono diventate più forti, ma non possiamo più permetterci di aspettare che il Carceriere faccia la sua prossima mossa.\n\nLa via per la Fauce è aperta e le nostre forze sono pronte.\n\nLe Congreghe attendono il tuo segnale, $n.', '', '', '', '', '', 'Parla con Bolvar Domadraghi a Korthia.', 39653),
(63994, 'itIT', 'Chi è il Calcafauce?', 'Partecipa alla prova da Calcafauce di Tal-Galan.', 'Le profezie di Korthia preannunciano l\'arrivo di un Calcafauce in grado di salvarci dal disastro. \n\nForse è questo il giorno. Ma forse no. Devo mettere alla prova il tuo Animum per verificare le tue dichiarazioni.\n\nSe dici il vero, allora ho il dovere solenne di potenziare il tuo Animum prima di procedere.', '', '', '', '', '', '', 39653),
(63990, 'itIT', 'La lama nella notte', 'Cerca indizi al Sepolcro della Conoscenza.', 'Nonostante la mia caccia sia stata ardua, ho due tracce promettenti su ulteriori Guerrieri della Notte. La prima è qui a Maldraxxus.\n\nQuesta torre contiene i registri di coloro che sono arrivati a Maldraxxus, inclusa una certa \"Lama nella Notte\". Credo che faccia parte dei Guerrieri della Notte.\n\nHo trovato molte trappole venendo qui e indubbiamente ne troveremo altre all\'interno della torre. Qualcuno sta cercando di fermarci.\n\nNon lo lasceremo vincere.', '', '', '', '', '', '', 39653),
(63989, 'itIT', 'Melme di carattere', 'Aiuta Piaghetto a provare la sua abilità di infezione alla Terrazza del Mazzuolatore.', 'Apprendista! Ti stavo cercando.\n\nKevin è stato di grande aiuto nei nostri esperimenti, vorrei addestrare le altre mie melme cosicché possano aiutarmi!\n\nPuoi portare con te Piaghetto e vedere se è in grado di infettare forme di vita organiche?', '', '', '', '', '', '', 39653),
(63987, 'itIT', 'Il pacchetto perduto di Ve\'lor', '', '', '', '', '', '', '', '', 39653),
(63986, 'itIT', 'Tazavesh: i predatori del manufatto perduto', 'Entra a Tazavesh e sconfiggi So\'leah.', 'Sembra che dovrai dare una dimostrazione di forza ancora una volta, $gamico mio:amica mia;. Oltrepassare la sicurezza di Tazavesh non sarà una passeggiata.\n\nMa So\'leah dev\'essere fermata. Se questo richiede un po\' di... persuasione fisica... allora è un male necessario. \n\nPorta degli amici. Ho la sensazione che la sicurezza qui abbia qualche asso nella manica.', '', '', '', '', '', '', 39653),
(63985, 'itIT', 'Il bazar celato', 'Raggiungi Tazavesh.', 'Fammi indovinare... Ti manda Ta\'oku, vero? \n\n<Ta\'meri guarda la moneta che offri.>\n\nQuindi, stai cercando di raggiungere Tazavesh. Non è qualcosa che solitamente faremmo per uno straniero, ma dato che siamo stati pagati, sarà un piacere aiutarti.\n\nSali a bordo, e ricorda di tenere sempre tutti gli arti all\'interno del vascello. Le correnti dell\'Inframondo possono essere molto instabili.', '', '', '', '', '', '', 39653),
(63984, 'itIT', 'Monete per il traghettatore', 'Parla con Ta\'meri a Oribos.', 'Il tuo lato dell\'accordo è compiuto, Calcafauce. Ora, ti spetta il pagamento.\n\nIl mio cartello gestisce una navetta che viaggia tra Oribos e Tazavesh. Il suo scopo è trasportare merci, ma come in tutte le cose, ci sono... eccezioni.\n\nPorta questa moneta a Ta\'meri e ti fornirà un passaggio sicuro al mercato.\n\nQuello che succede dopo, dipende da te.\n\n<Ta\'oku fa un inchino, con un suono che sembra quasi una risatina.>', '', '', '', '', '', 'Parlato con Ta\'meri a Oribos.', 39653),
(63983, 'itIT', 'Lancio del cadavere', 'Recupera il Prototipo di Aquilon.', 'Ta\'nla ha richiesto qualcosa di molto... specifico... per conto di un cliente.\n\nI Kyrian stanno lavorando a un nuovo tipo di centurione che chiamano Aquilon. Ho inviato alcuni dei nostri specialisti commerciali per recuperare il prototipo in questione, ma non sono ancora tornati. \n\nFinché non lo riceverò, ovviamente non ci sarà modo di recapitarlo a Ta\'nla. Forse possiamo aiutarci a vicenda.\n\nSe riesci a trovare l\'Aquilon e a portarlo qui, ti aiuterò a raggiungere Tazavesh.', '', '', '', '', '', '', 39653),
(63982, 'itIT', 'Sopra la mia stazione', 'Prendi il portale al Mercato Notturno e parla con Ta\'oku.', 'Anche se conosco la posizione del Bazar Celato, temo di poter fare poco per fornirti un modo per arrivarci.\n\nIn cambio del tuo aiuto con un incarico, posso mandarti da qualcuno che può aiutarci entrambi. C\'è un cacciatore di taglie presso la Stazione di Trasferimento Ta, un\'enclave degli Alienatori nel Bastione. Potrà sicuramente aiutarti meglio di me... inoltre, mi deve un carico.\n\nIncontra Ta\'oku e digli che ti manda Ta\'nla.\n\nPer tua comodità, posso offrirti di usare un portale. Dopotutto, siamo soci, vero?', '', '', '', '', '', 'Parla con il Cacciatore di Taglie Ta\'oku alla Stazione di Trasferimento Ta.', 39653),
(63980, 'itIT', 'Cercansi contrabbandieri', 'Parla con Ta\'nla l\'Identificatore al Mercato Notturno.', 'Noi Alienatori abbiamo scoperto che è nel nostro interesse rimanere in movimento. E con discrezione.\n\nMolte delle nostre città e avamposti sono nascosti nell\'Inframondo, con la capacità di spostarsi da un posto all\'altro.\n\nCon mio grande dispiacere, temo di aver perso la traccia di Tazavesh.\n\nCredo che la cosa migliore da fare sia richiederne l\'accesso al Cartello Ta. Si vantano di tenere sempre traccia di questo genere di cose.\n\nVediamo se avremo fortuna con quelli al Mercato Notturno a Revendreth. Potrebbero essere più disponibili dei loro simili a Oribos.', '', '', '', '', '', 'Parla con Ta\'nla l\'Identificatore al Mercato Notturno di Revendreth.', 39653),
(63979, 'itIT', 'Meglio tenere le cose all\'oscuro', 'Trova un manifesto di carico appartenente al Cartello So.', 'Il capo del Cartello So rappresenta un grave pericolo per le Terretetre, Calcafauce.\n\nIl suo nome è So\'leah. Ha intenzione di assemblare un manufatto dei Primi e usare il suo potere per i propri scopi.\n\nSi dice che alcuni pezzi della reliquia siano nascosti sul tuo pianeta natale. Gli Alienatori non hanno mai trovato il modo di arrivarci. Ma se So\'leah dovesse riuscirci, allora anche Azeroth sarà in pericolo.\n\nDobbiamo intercettarla.\n\nC\'è un carico qui vicino con sopra il marchio del Cartello So. Forse il foglio di carico ci darà indizi sulla posizione del loro capo.', '', '', '', '', '', '', 39653),
(63977, 'itIT', 'Scambi interni', 'Parla con i vari Cartelli degli Alienatori a Oribos.', 'Sono il massimo esperto sulla cultura degli Alienatori. Tuttavia, le relazioni tra i cartelli sono complicate e instabili.\n\nIl Cartello So ha una piccola presenza qui a Oribos, il che significa che gli altri Cartelli potrebbero avere delle conoscenze che io non ho. Chiedi in giro: con la tua fama, sicuramente sapranno darti tutte le informazioni che ci mancano.', '', '', '', '', '', '', 39653),
(63976, 'itIT', 'Il gatto randagio di Oribos', 'Incontra il contatto misterioso a Oribos.', 'Ah, Calcafauce. Ho un messaggio.\n\nUn certo individuo ha una proposta specificamente per te. Non conosco i dettagli, so solo che ti ha chiesto di incontrarlo sul retro dell\'Idillia.', '', '', '', '', '', 'Incontra il contatto misterioso a Oribos.', 39653),
(63973, 'itIT', 'Doppio Droman', 'Aiuta il Droman Aliothe a sconfiggere i nemici lungo il suo percorso e uccidi Sire Dretnal.', 'Rilassati, $p. Respira.\n\n<Plasmasogni inspira ed espira lentamente.>\n\nLa situazione si sta facendo tesa da queste parti, ma questo non significa che debba esserlo anche TU.\n\nAndrà tutto bene. Se non mi credi, lascia che siano le potenti gesta del Droman Aliothe e del Droman Tashmur a rassicurarti.\n\nSi sono diretti insieme sulla collina per liberare la strada per noi. Penseranno loro a tutto in men che non si dica.', '', '', '', '', '', 'Incontra Ser Herne sul ponte che sovrasta l\'oscurità crescente.', 39653),
(63971, 'itIT', 'Schiacciare lumache', 'Usa la Bacchetta di Dama Baccaluna per trasformare 15 nemici indeboliti in lumache e poi schiacciali!', 'Attenzione a dove metti i piedi. Non vorresti mica schiacciare un Giurafauce per errore?\n\nCerto che lo vorresti! È così divertente!\n\n<Dama Baccaluna sghignazza e indica le lumache attorno a lei.>\n\nÈ molto più facile schiacciarli dopo che li hai trasformati in lumache puzzolenti.\n\nEcco, prendi la mia bacchetta e provala su quello che vuoi.\n\nForse dovrai indebolirli un po\', ma funzionerà su quasi tutto!', '', '', '', '', '', 'Incontra Ser Herne sul ponte che sovrasta l\'oscurità crescente.', 39653),
(63970, 'itIT', 'Nessuna Anima Verrà Abbandonata', 'Usa la Culla di Salvataggio di Thiernax per recuperare $3oa Spiriti Druidici Perduti e rimandali a Thiernax.', 'Senti le urla delle anime tormentate intrappolate nel Gorgoa?\n\nIl fiume corrotto di anime scorre davanti a noi, pieno di crudeltà e del tormento di anime innocenti.\n\nLa nostra coraggiosa squadra di spiriti druidici ha guidato la carica nel fiume per cercare quelle anime perdute, ma temo che molti si siano invece uniti alla loro sofferenza.\n\nRaccogli il tuo coraggio e porta la mia culla al fiume con te. Carica le anime perdute che trovi sulla culla, poi ordina loro di tornare da me.', '', '', '', '', '', 'Incontra Thiernax sul ponte che sovrasta l\'oscurità crescente.', 39653),
(63969, 'itIT', 'Oscurità incombente', 'Raccogli $1oa Libri Rituali dei Giurafauce, $2oa Frammenti di Missiva dei Giurafauce e $3oa campioni di Midollo Oscuro.', 'La Regina dell\'Inverno ha richiesto una caccia qui a causa di un\'enorme e innaturale oscurità che sta crescendo nelle regioni superiori.\n\nLa Caccia Selvaggia è coraggiosa, ma non sciocca. Dobbiamo scoprire tutto il possibile sull\'oscurità prima di poterla affrontare.\n\nEsamina i corpi dei nostri nemici qua vicino per trovare degli indizi.', '', '', '', '', '', 'Incontra Ser Herne sul ponte che sovrasta l\'oscurità crescente.', 39653),
(63964, 'itIT', 'Ricercato dagli Alienatori: Artiglio Lugubre', 'Recupera un Becco Ossificato Maturo da Artiglio Lugubre.', 'Nuove terre significano nuove opportunità. A chiunque fosse interessato, forniremo una discreta quantità di oggetti preziosi in cambio del becco ossuto della bestia nota come Artiglio Lugubre.\n\nAstenersi perditempo e cacciatori deboli di cuore.\n\nRiportare il campione a Ta\'nasi al Riposo del Custode.', '', '', 'Artiglio Lugubre', '', '', '', 39653),
(63963, 'itIT', 'Ricercato dagli Alienatori: Squartagole', 'Recupera una Pelle Spinosa Pesante da Squartagole.', 'Nuove terre significano nuove opportunità. A chiunque fosse interessato, forniremo una discreta quantità di oggetti preziosi in cambio della pelle particolarmente spinosa della bestia nota come Squartagole.\n\nAstenersi perditempo e cacciatori deboli di cuore.\n\nRiportare il campione a Ta\'nasi al Riposo del Custode.', '', '', 'Squartagole', '', '', '', 39653),
(63962, 'itIT', 'Registri osservazionali', 'Raccogli $1oa Registri Osservazionali dalla Terrazza del Mazzuolatore a Korthia.', 'Salute, Calcafauce, hai un momento?\n\nCome sicuramente saprai, il mio cartello ha sparso dispositivi di osservazione per tutta Korthia. Ma quei dati non ci sono di nessun aiuto se non li recuperiamo. Ed è qui che entri in gioco tu.\n\nI dati della Terrazza del Mazzuolatore dovrebbero essere pronti per la raccolta. Non vedrai i dispositivi, ma i loro dati ti appariranno come una sfera luminosa.\n\nPortami quei dati e ti ricompenserò adeguatamente.', '', '', '', '', '', '', 39653),
(63961, 'itIT', 'Segreti sigillati', 'Recupera $1oa Contenitori Sigillati presso la Terrazza del Mazzuolatore a Korthia.', 'Ah, Korthia. Quali segreti verranno rivelati?\n\nI miei collaboratori hanno lavorato duramente, cercando di scoprire e procurarsi diversi piccoli oggetti di interesse in questa terra devastata. Nulla di importante, te lo assicuro.\n\nHanno messo in sicurezza gli oggetti in alcune casse designate, che sono in attesa di essere raccolte nella Terrazza del Mazzuolatore. Non preoccuparti, sono chiuse con un sigillo impenetrabile per proteggere il contenuto e il trasportatore.\n\nPortami quei contenitori sigillati e ti ricompenserò generosamente.', '', '', '', '', '', '', 39653),
(63960, 'itIT', 'Registri osservazionali', 'Raccogli $1oa Registri Osservazionali dal Nido Ventoso e dall\'Estuario del Risveglio a Korthia.', 'Salute, Calcafauce, hai un momento?\n\nCome sicuramente saprai, il mio cartello ha sparso dispositivi di osservazione per tutta Korthia. Ma quei dati non ci sono di nessun aiuto se non li recuperiamo. Ed è qui che entri in gioco tu.\n\nI dati del Nido Ventoso e dell\'Estuario del Risveglio dovrebbero essere pronti per la raccolta. Non vedrai i dispositivi, ma i loro dati ti appariranno come una sfera luminosa.\n\nE non dimenticare di cercare sottoterra!\n\nPortami quei dati e ti ricompenserò adeguatamente.', '', '', '', '', '', '', 39653),
(63959, 'itIT', 'Registri osservazionali', 'Raccogli $1oa Registri Osservazionali dal Sacrario della Guida a Korthia.', 'Salute, Calcafauce, hai un momento?\n\nCome sicuramente saprai, il mio cartello ha sparso dispositivi di osservazione per tutta Korthia. Ma quei dati non ci sono di nessun aiuto se non li recuperiamo. Ed è qui che entri in gioco tu.\n\nI dati del Sacrario della Guida dovrebbero essere pronti per la raccolta. Non vedrai i dispositivi, ma i loro dati ti appariranno come una sfera luminosa.\n\nPortami quei dati e ti ricompenserò adeguatamente.', '', '', '', '', '', '', 39653),
(63958, 'itIT', 'Registri osservazionali', 'Raccogli $1oa Registri Osservazionali all\'esterno degli Archivi di Korthia.', 'Salute, Calcafauce, hai un momento?\n\nCome sicuramente saprai, il mio cartello ha sparso dispositivi di osservazione per tutta Korthia. Ma quei dati non ci sono di nessun aiuto se non li recuperiamo. Ed è qui che entri in gioco tu.\n\nI dati dell\'esterno degli Archivi dovrebbero essere pronti per la raccolta. Non vedrai i dispositivi, ma i loro dati ti appariranno come una sfera luminosa.\n\nPortami quei dati e ti ricompenserò adeguatamente.', '', '', '', '', '', '', 39653),
(63957, 'itIT', 'Registri osservazionali', 'Raccogli $1oa Registri Osservazionali dal Quorum del Cercatore a Korthia.', 'Salute, Calcafauce, hai un momento?\n\nCome sicuramente saprai, il mio cartello ha sparso dispositivi di osservazione per tutta Korthia. Ma quei dati non ci sono di nessun aiuto se non li recuperiamo. Ed è qui che entri in gioco tu.\n\nI dati del Quorum del Cercatore dovrebbero essere pronti per la raccolta. Non vedrai i dispositivi, ma i loro dati ti appariranno come una sfera luminosa.\n\nPortami quei dati e ti ricompenserò adeguatamente.', '', '', '', '', '', '', 39653),
(63956, 'itIT', 'Segreti sigillati', 'Recupera $1oa Contenitori Sigillati presso il Nido Ventoso a Korthia.', 'Ah, Korthia. Quali segreti verranno rivelati?\n\nI miei collaboratori hanno lavorato duramente, cercando di scoprire e procurarsi diversi piccoli oggetti di interesse in questa terra devastata. Nulla di importante, te lo assicuro.\n\nHanno messo in sicurezza gli oggetti in alcune casse designate, che sono in attesa di essere raccolte nel Nido Ventoso. Non preoccuparti, sono chiuse con un sigillo impenetrabile per proteggere il contenuto e il trasportatore.\n\nPortami quei contenitori sigillati e ti ricompenserò generosamente.', '', '', '', '', '', '', 39653),
(63955, 'itIT', 'Segreti sigillati', 'Recupera $1oa Contenitori Sigillati presso gli archivi a Korthia.', 'Ah, Korthia. Quali segreti verranno rivelati?\n\nI miei collaboratori hanno lavorato duramente, cercando di scoprire e procurarsi diversi piccoli oggetti di interesse in questa terra devastata. Nulla di importante, te lo assicuro.\n\nHanno messo in sicurezza gli oggetti in alcune casse designate, che sono in attesa di essere raccolte fuori dagli archivi. Non preoccuparti, sono chiuse con un sigillo impenetrabile per proteggere il contenuto e il trasportatore.\n\nPortami quei contenitori sigillati e ti ricompenserò generosamente.', '', '', '', '', '', '', 39653),
(63954, 'itIT', 'Segreti sigillati', 'Recupera $1oa Contenitori Sigillati dal Quorum del Cercatore.', 'Ah, Korthia. Quali segreti verranno rivelati?\n\nI miei collaboratori hanno lavorato duramente, cercando di scoprire e procurarsi diversi piccoli oggetti di interesse in questa terra devastata. Nulla di importante, te lo assicuro.\n\nHanno messo in sicurezza gli oggetti in alcune casse designate, che sono in attesa di essere raccolte nel Quorum del Cercatore. Non preoccuparti, sono chiuse con un sigillo impenetrabile per proteggere il contenuto e il trasportatore.\n\nPortami quei contenitori sigillati e ti ricompenserò generosamente.', '', '', '', '', '', '', 39653),
(63951, 'itIT', 'Un posto losco', 'Usa la Pietra dellla Fenditura Sbilanciata per entrare nella fenditura e distruggere le Trappole della Fenditura Velata per liberare $1a Vorkai Vincolati alla Fenditura.', 'L\'esistenza non è semplice, $p. Si tratta di strati sopra infiniti strati di molte realtà.\n\nLe trappole del Carceriere stanno attirando le nostre truppe in un varco nascosto alla vista.\n\nHo ottenuto una Pietra della Fenditura Sbilanciata. Ti renderà possibile entrare nella fenditura e distruggere le trappole che tengono le truppe imprigionate all\'interno, prima che si perdano per sempre.\n\nDopo aver distrutto le Trappole della Fenditura Velata, esci e riporta i soldati intrappolati nella nostra realtà.', '', '', '', '', '', 'Incontra il Margravio Sin\'dane sul ponte che sovrasta l\'oscurità crescente.', 39653),
(63950, 'itIT', 'Artigli di Alafina', 'Raccogli $1oa Artigli di Alafina.', 'I miei cacciatori non conoscono ancora queste terre, ma abbiamo scoperto delle belve formidabili che vivono qui.\n\nTra queste ci sono gli Alafina: predatori feroci con artigli terribili... e il temperamento di un Vorkai.\n\n<Herne sorride con fervore.>\n\nPortami qualche loro artiglio, così da mostrare ai nostri nuovi cacciatori i tipi di belve che affronteranno.', '', '', '', '', '', '', 39653),
(63949, 'itIT', 'Come plasmare il destino', 'Sventa gli sforzi del Carceriere a Korthia e nella Fauce completando gli assalti delle Congreghe, le missioni giornaliere, saccheggiando tesori, uccidendo creature rare e sconfiggendo i Tormentatori di Torgast.', 'Il potere e la malvagità del Carceriere continuano a crescere, e noi dobbiamo farlo con essi.\n\nLotta con i tuoi alleati, $n. Respingete l\'oscurità che ci consumerebbe tutti.\n\nInsieme vinceremo.\n\nChe lo Scopo guidi la tua mano.', '', '', '', '', '', '', 39653),
(63944, 'itIT', 'Korthia attende', 'Fai rapporto a Tal-Galan al Riposo del Custode a Korthia.', 'Preparati, $n. I nostri alleati attendono il tuo arrivo a Korthia.', '', '', '', '', '', '', 39653),
(63936, 'itIT', 'L\'Animum Divorato', 'Recupera $1oa Animum Divorato dai divoratori nell\'Estuario del Risveglio.', 'Sika ha un\'idea!\n\nI divoratori... divorano. Mangiano qualsiasi cosa! Anche l\'Animum.\n\nSe prendiamo l\'Animum da divoratori, quell\'Animum sarà nostro!', '', '', '', '', '', '', 39653),
(63935, 'itIT', 'Radici Preziose', 'Raccogli $1oa Animum Residuo attorno agli archivi di Korthia.', 'Korthia. Una foresta sorella, colpita al cuore.\n\nMa nella sofferenza della distruzione c\'è ancora speranza. \n\nRaccogli l\'Animum e ricostruisci.', '', '', '', '', '', '', 39653),
(63934, 'itIT', 'Posta Scomposta', 'Recupera $1oa Messaggi Rubati nell\'Antro dello Studioso.', 'Salute, mortale!\n\nSono in missione per consegnare dei messaggi ai nostri alleati qui nell\'emozionante Korthia. Tuttavia, non ho potuto portare a termine il mio compito.\n\nI messaggi che sono stato programmato per trasportare sono stati rubati dai Giurafauce, e poi erroneamente riposti dappertutto.\n\nPotresti recuperare quei messaggi e riportarmeli? Così mi assicurerò che arrivino ai veri destinatari.\n\nGrazie!', '', '', '', '', '', '', 39653),
(63924, 'itIT', 'Artiglio Feticcio di Gorak', 'Porta l\'Artiglio Feticcio di Gorak all\'Archivista Roh-Suir nel Reliquiario della Rimembranza.', '<Dalla tua familiarità col Codice degli Archivisti, è evidente che si tratti di una delle reliquie mancanti.\n\nL\'archivista Roh-Suir ha un posto per il feticcio presso il Reliquiario della Rimembranza.>', '', '', '', '', '', '', 39653),
(63923, 'itIT', 'Incisioni nel Legno della Famiglia Lang', 'Porta le Incisioni nel Legno della Famiglia Lang all\'Archivista Roh-Suir nel Reliquiario della Rimembranza.', '<Dalla tua familiarità col Codice degli Archivisti, è evidente che si tratti di una delle reliquie mancanti.\n\nL\'Archivista Roh-Suir ha un posto per queste incisioni nel legno presso il Reliquiario della Rimembranza.>', '', '', '', '', '', '', 39653),
(63922, 'itIT', 'Spada Corta Squarciaombre', 'Porta la Spada Corta Squarciaombre all\'Archivista Roh-Suir nel Reliquiario della Rimembranza.', '<Dalla tua familiarità col Codice degli Archivisti, è evidente che si tratti di una delle reliquie mancanti.\n\nL\'Archivista Roh-Suir ha un posto per questa spada presso il Reliquiario della Rimembranza.>', '', '', '', '', '', '', 39653),
(63921, 'itIT', 'L\'Anello dell\'Introspezione', 'Porta l\'Anello dell\'Introspezione all\'Archivista Roh-Suir nel Reliquiario della Rimembranza.', '<Dalla tua familiarità col Codice degli Archivisti, è evidente che si tratti di una delle reliquie mancanti.\n\nL\'Archivista Roh-Suir ha un posto per questo anello presso il Reliquiario della Rimembranza.>', '', '', '', '', '', '', 39653),
(63920, 'itIT', 'Dispositivo di Decifrazione Enigmatico', 'Porta il Dispositivo di Decifrazione Enigmatico all\'Archivista Roh-Suir nel Reliquiario della Rimembranza.', '<Dalla tua familiarità col Codice degli Archivisti, è evidente che si tratti di una delle reliquie mancanti.\n\nL\'Archivista Roh-Suir ha un posto per questo dispositivo presso il Reliquiario della Rimembranza.>', '', '', '', '', '', '', 39653),
(63919, 'itIT', 'Libro del Vincolo: L\'Occultista Tormentato', 'Raccogli $1oa Pagine Azzurre, poi portale all\'Archivista Roh-Suir nel Reliquiario della Rimembranza.', '<Senti una voce soffocata provenire dall\'interno del libro, intervallata dal rumore di interferenze. Anche se le parole sono per lo più incomprensibili, riesci a capire la richiesta di recuperare delle pagine azzurre.\n\nSfogliando il tomo, noti che molte delle sue pagine sono mancanti. \n\nForse se riuscissi a ritrovare le pagine, il libro potrebbe essere riparato e consegnato all\'Archivista.>', '', '', '', '', '', '', 39653),
(63918, 'itIT', 'Obelisco delle Notizie Oscure', 'Porta l\'Obelisco delle Notizie Oscure all\'Archivista Roh-Suir nel Reliquiario della Rimembranza.', '<Dalla tua familiarità col Codice degli Archivisti, è evidente che si tratti di una delle reliquie mancanti.\n\nL\'archivista Roh-Suir ha un posto per l\'obelisco presso il Reliquiario della Rimembranza.>', '', '', '', '', '', '', 39653),
