(63914, 'itIT', 'Il Codice della Comprensione', 'Porta il Codice della Comprensione all\'Archivista Roh-Suir nel Reliquiario della Rimembranza.', '<Dalla tua familiarità col Codice degli Archivisti, è evidente che si tratti di una delle reliquie mancanti.\n\nL\'Archivista Roh-Suir ha un posto per il codice presso il Reliquiario della Rimembranza.>', '', '', '', '', '', '', 39653),
(63913, 'itIT', 'Globo Esplosivo Instabile', 'Porta il Globo Esplosivo Instabile all\'Archivista Roh-Suir nel Reliquiario della Rimembranza.', '<Dalla tua familiarità col Codice degli Archivisti, è evidente che si tratti di una delle reliquie mancanti.\n\nL\'Archivista Roh-Suir ha un posto per questo dispositivo presso il Reliquiario della Rimembranza.>', '', '', '', '', '', '', 39653),
(63912, 'itIT', 'Mappa Celestiale delle Terretetre', 'Raccogli $1oa Ricerche di Navigazione dell\'Aldilà, poi portale all\'Archivista Roh-Suir nel Reliquiario della Rimembranza.', '<Riconosci questa reliquia dal Codice degli Archivisti.>\n\n< I Giurafauce l\'hanno abbandonata, credendo che fosse inutile.>\n\n<E di fatto lo è, senza i dati a indicare le varie posizioni degli aldilà delle Terretetre. Se recuperassi le ricerche dagli studiosi deceduti, potresti riportare la mappa all\'Archivista, completamente funzionante.>', '', '', '', '', '', '', 39653),
(63911, 'itIT', 'Il Lingotto d\'Acciaio Canterino', 'Sconfiggi gli invasori Giurafauce, quindi porta il Lingotto d\'Acciaio Canterino all\'Archivista Roh-Suir nel Reliquiario della Rimembranza.', '<Il lingotto geme in un vibrato armonioso.>\n\nChe pena! Questi furfanti mi martellano senza alcuna cura, piegando il mio corpo ai loro scopi.\n\nVergogna! Che la vergogna si abbatta su di loro.\n\n<Il lingotto emette un grido di battaglia acuto.>\n\nPrendi a martellate questi Giurafauce!', '', '', '', '', '', '', 39653),
(63910, 'itIT', 'La Stellafatua', 'Ricarica la Stellafatua, quindi portala all\'Archivista Roh-Suir nel Reliquiario della Rimembranza.', '<Riconosci che la reliquia proviene dal Codice degli Archivisti.>\n\n<La fonte di energia è quasi vuota. Comunque, potrebbe essere ripristinata esponendola a dell\'Animum grezzo e non filtrato. Le fessure vicine potrebbero funzionare.>', '', '', '', '', '', '', 39653),
(63909, 'itIT', 'La maschera del Servan', 'Porta la Maschera del Servan all\'Archivista Roh-Suir nel Reliquiario della Rimembranza.', '<Dalla tua familiarità col Codice degli Archivisti, è evidente che si tratti di una delle reliquie mancanti.\n\nL\'Archivista Roh-Suir ha un posto per questa maschera presso il Reliquiario della Rimembranza.>', '', '', '', '', '', '', 39653),
(63908, 'itIT', 'Il Baluardo dell\'Intento Divino', 'Porta il Baluardo dell\'Intento Divino all\'Archivista Roh-Suir nel Reliquiario della Rimembranza.', '<Dalla tua familiarità col Codice degli Archivisti, puoi confermare che si tratti di una delle reliquie mancanti.\n\nL\'Archivista Roh-Suir ha un posto per questo scudo presso il Reliquiario della Rimembranza.>', '', '', '', '', '', '', 39653),
(63904, 'itIT', 'Il Cuore di Selvarden', 'Indaga presso il Cuore della Foresta.', 'Ho nascosto il mio sigillo nel Cuore della Foresta, per tenerlo al sicuro dalle forze della Fauce.\n\nMa il corno ha richiesto aiuto.\n\nAndate, tu e i tuoi alleati, scoprite cos\'ha necessitato la chiamata.', '', '', '', '', '', 'Torna dalla Regina dell\'Inverno fuori dal Cuore della Foresta.', 39653),
(63903, 'itIT', 'Assaltare il Sanctum', 'Sconfiggi Sylvanas Ventolesto nel Sanctum del Dominio.', 'Il Carceriere ha ottenuto i sigilli di tutte e quattro le Congreghe. È chiaro che intende fuggire dalla Fauce e rubare il sigillo dell\'Arbiter a Oribos.\n\nNon possiamo permetterglielo.\n\nIn cima a Torgast si trova il Sanctum del Dominio, il trono stesso del Carceriere. È giunto il momento di entrare in questo oscuro dominio.\n\nSenza dubbio Sylvanas Ventolesto sarà al comando delle forze che tenteranno di ostacolarci. Dobbiamo sconfiggerla... e salvare Anduin Wrynn dalle sue grinfie.\n\nRaduna le tue forze, $n. La Spada d\'Ebano sarà al tuo fianco.', '', 'La Regina Banshee è la chiave dei piani del Carceriere. Trovala... e fermala.', 'Sylvanas Ventolesto', '', '', '', 39653),
(63902, 'itIT', 'Buone notizie, gente!', 'Vola con Danica a Korthia per dare la notizia a Bolvar.', 'Vieni, $gamico:amica;. Liberiamoci di questo luogo malvagio.\n\nSenza dubbio i tuoi compagni saranno ansiosi di sapere della sconfitta dell\'Occhio. Ti porterò da loro.\n\nDimmi quando sei $gpronto:pronta; a partire, $n.', '', '', '', '', '', '', 39653),
(63901, 'itIT', 'Focalizzare l\'Occhio', 'Raggiungi la Piattaforma del Terminale e usa l\'Ilskahorn per evocare l\'Ira di Odyn.', 'La combinazione di dolore e rabbia che hai raccolto è sufficiente per le tue necessità. Probabilmente. \n\nSe proprio vuoi continuare a insistere con questa tua impresa, usa il corno alla Piattaforma del Terminale, dove il Fiume delle Anime scorre verso Torgast. Le energie lì sono molto potenti.\n\nLa presenza dei tuoi alleati dorati dovrebbe attirare l\'Occhio del Carceriere. Spero solo che non tu non faccia una brutta fine. Odio vedere un investimento sprecato.', '', 'L\'Occhio del Carceriere vaga per la Fauce cercando i nemici del Carceriere.', 'Occhio del Carceriere', '', '', '', 39653),
(63899, 'itIT', 'Libro del Vincolo: La Strega Folle', 'Raccogli $1oa Pagine Cremisi, poi portale all\'Archivista Roh-Suir nel Reliquiario della Rimembranza.', '<Senti una voce soffocata provenire dall\'interno del libro, intervallata dal rumore di interferenze. Anche se le parole sono per lo più incomprensibili, riesci a capire la richiesta di recuperare delle pagine cremisi.\n\nSfogliando il tomo, noti che molte delle sue pagine sono mancanti. \n\nForse se riuscissi a ritrovare le pagine, il libro potrebbe essere riparato e consegnato all\'Archivista.>', '', '', '', '', '', '', 39653),
(63896, 'itIT', 'Le lacrime dei dannati', 'Raccogli $1oa Lacrime dei Dannati dal Gorgoa: il Fiume delle Anime.', 'Per ancorare lo strumento alla Fauce e renderlo capace dell\'effetto che cerchi, dev\'essere infuso con la pura agonia delle vittime intrappolate in questa prigione maledetta.\n\nIl dolore è abbondante qui, e quindi semplice da ottenere. Devi solo andare al Gorgoa. Lì i dannati versano lacrime che cadono sotto forma di dolore cristallizzato mentre vengono spazzati via dal Fiume delle Anime.\n\nFai attenzione a non farti travolgere dalla loro tristezza.', '', '', '', '', '', 'Porta le Lacrime dei Dannati alla proiezione di Ve\'nari al confine del Gorgoa.', 39653),
(63895, 'itIT', 'Borsa omaggio', 'Prova il dispositivo di trasporto nella borsa di Ve\'nari.', 'Interessante... Sequenziatori dell\'Aura e un Manto Etereo. Tieniteli stretti, ho il sospetto che ti serviranno.\n\nAh, c\'è anche una cosa speciale per me. Se non mi sbaglio, e io mi sbaglio molto raramente... questo è un dispositivo di proiezione. Molto utile!\n\nE questo cos\'è? Una specie di dispositivo di trasporto. Dovremmo provarlo immediatamente.\n\nE per noi, ovviamente intendo tu.', '', '', '', '', '', '', 39653),
(63892, 'itIT', 'Note Runiche del Divinatore', 'Raccogli $1oa Note Runiche, quindi portale all\'Archivista Roh-Suir nel Reliquiario della Rimembranza.', '<Nel sacchetto c\'è una sola nota runica. Ruota e si gira come l\'avesse afferrata una mano invisibile.\n\nDelle rune che ricordano vagamente la lingua dei Vrykul sono delicatamente incise sulla pietra. Sul retro della nota c\'è l\'indicazione che faccia parte di un set. >', '', '', '', '', '', '', 39653),
(63867, 'itIT', 'Gestione della rabbia', 'Usa il dispositivo risucchiante per aspirare la rabbia dalle Ombre Furiose nel Fiume delle Anime.', 'Non sono una musicista, anche se ho passato molte ore a godermi i divertimenti di Tazavesh.\n\nPer dare voce a questo corno, sarà necessario raccogliere delle emozioni forti.\n\nLa rabbia sfrenata ribolle nei dannati che sono stati consegnati al Fiume delle Anime. Usa questo dispositivo di raccolta per incanalare la rabbia di queste anime furiose nel tuo strumento.\n\nLe urla di furia che raccoglierai dovrebbero permetterti di penetrare la Fauce e raggiungere i tuoi alleati.\n\nHo il sospetto che la melodia non sarà un successo, però.', '', '', '', '', '', 'Trova la Proiezione di Ve\'nari sulla riva del Fiume delle Anime.', 39653),
(63863, 'itIT', 'Uniti nel branco', 'Sconfiggi Malfestus, Domonus e Furis.', 'Nonostante le nostre differenze, io e Nemea lavoriamo come una squadra quando affrontiamo minacce superiori. Il branco e le falinci sono entrambi dei combattenti formidabili.\n\nSaremmo entrambi onorati di assisterti nella battaglia che ci attende.\n\nRecluta Andira o Gatamatos per aiutarti sconfiggere i campioni del Carceriere che minacciano le nostre forze.', '', '', '', '', '', '', 39653),
(63861, 'itIT', 'Iniziare il recupero', 'Recupera il Codice dei Ricordi per l\'Archivista Roh-Suir nel Reliquiario della Rimembranza.', 'Riprendiamo il nostro lavoro recuperando l\'oggetto più importante di qualsiasi studioso... il codice perduto.\n\nCi vorrà del tempo, ma man mano che ci lavoreremo le pagine di quest\'opera continueranno a crescere e prosperare, come ha fatto Korthia stessa per eoni.\n\nPer quanto riguarda la sua posizione, in precedenza risiedeva nelle profondità di Korthia dentro la Caverna della Contemplazione a sud.\n\nPossiamo solo sperare che le forze del Carceriere debbano ancora localizzarlo.', '', '', '', '', '', '', 39653),
(63860, 'itIT', 'Talismano dello Studioso Eterno', 'Porta il Talismano Danneggiato allo Studioso Roh-Suir nel Reliquiario della Rimembranza.', '<Il talismano è scheggiato e sporco di fango. Chiunque l\'abbia messo qui, non l\'ha trattato con cura.\n\nL\'Archivista Roh-Suir ha un posto per questo talismano nel Reliquiario della Rimembranza.>', '', '', '', '', '', '', 39653),
(63859, 'itIT', 'Campane della Salvezza', 'Difendi e suona la Campana dei Rinforzi Occidentale, Orientale e Meridionale.', 'I nostri Factotum stanno preparando le Campane dei Rinforzi per evocare altri Kyrian in nostro aiuto. I Giurafauce li stanno attaccando per fermarli.\n\nAbbiamo bisogno che tu difenda i nostri Factotum mentre completano il loro lavoro, poi dovrai suonare ogni campana per chiamare i rinforzi.', '', '', '', '', '', '', 39653),
(63857, 'itIT', 'Le voci dell\'Eterno', 'Ascolta il piano.', '<Bolvar osserva le grandi figure dinanzi a lui, gli infiniti portali che si estendono verso l\'etere.>\n\nQuesta sala è... davvero meravigliosa.\n\nTuttavia, non c\'è tempo da perdere. L\'Onorevole Voce deve iniziare subito questa riunione.', '', '', '', '', '', 'Torna nell\'Enclave a Oribos.', 39653),
(63856, 'itIT', 'Adunata delle Congreghe', 'Parla con Tal-Inara per accedere alla Sala dell\'Arbiter.', 'Anche se il Carceriere resta confinato nella Fauce, la sua crudeltà si estende ben oltre i confini della sua prigione.\n\nPer fortuna l\'Arconte si sta riprendendo dall\'attacco. Anche se mi è stato detto che la sua ferita sia... considerevole.\n\nGli Eterni e i loro alleati ti attendono assieme al Gran Signore Domadraghi nella sala dell\'Arbiter. Ti farò strada.\n\nLa sua Voce ha parlato.', '', '', '', '', '', '', 39653),
(63855, 'itIT', 'Aprire un passaggio', 'Stabilisci una connessione tra Korthia e il Rifugio di Ve\'nari.', 'Korthia è piena di opportunità. Guarda tutti questi oggetti interessanti.\n\nMi sono preparata in previsione di tutte queste meraviglie. Troviamo un luogo adatto e stabiliamo una connessione più permanente tra questo luogo e il mio rifugio.\n\nIl nostro lavoro non è ancora finito.', '', '', '', '', '', '', 39653),
(63853, 'itIT', 'Spegnere la fiamma', 'Uccidi Infernus l\'Infinito per Teotar.', 'Riesci a vederlo?\n\nAppena fuori dall\'angolo del mio occhio, è sempre lì... e brilla così tanto!\n\nCome dovrebbe fare uno a rilassarsi e godersi una tazza di tè mentre quel ricordo di fuoco e cenere è nei paraggi?\n\nFammi un favore, Calcafauce... eliminalo, così poi potremo goderci una tazza del mio tè preferito!', '', 'Così come le forge del Calderone di Zovaal, le sue fiamme non si estinguono mai.', 'Infernus l\'Infinito', '', '', '', 39653),
(63849, 'itIT', 'Delle orecchie in più', 'Sistema i Sequenziatori dell\'Aura a Desmotaeron per aiutare Ve\'nari a origliare gli abitanti.', 'Che fortuna! Il dispositivo ti ha casualmente trasportato in un luogo per il quale ho un certo... interesse. Posiziona i Sequenziatori dell\'Aura che ti ho dato e cercherò di stabilire una connessione funzionante.\n\nUn luogo così pericoloso richiederà la massima discrezione. Dovrai usare il tuo Manto Etereo per non farti vedere.', '', '', '', '', '', '', 39653),
(63848, 'itIT', 'Dimostrazione di gratitudine', 'Parla con Ve\'nari al Riposo del Custode presso Korthia.', 'La tua presenza qui conferma un\'antica profezia, Calcafauce. Non c\'è dubbio che tu e i tuoi alleati ci salverete.\n\nForse ho giudicato troppo presto la tua amica Alienatrice. Ti ha $gscortato:scortata; a Korthia, dopotutto. \n\nEstendi la nostra gratitudine a Ve\'nari e dille che saremo felici di rispondere alle sue domande.\n\nSembra... averne un bel po\'.', '', '', '', '', '', '', 39653),
(63845, 'itIT', 'Ira di Odyn', 'Assisti al potenziamento delle Val\'kyr prescelte e del vincolo dell\'Ilskahorn.', 'Il corno è stato forgiato e chi ne è degno è stato scelto.\n\nOra, $n, dobbiamo solo vincolare le mie Val\'kyr al corno e infonderle con il mio potere perché possano colpire con la mia furia.\n\nVieni, sii testimone.', '', '', '', '', '', '', 39653),
(63844, 'itIT', 'I pochi prescelti', 'Raggiungi il Circolo della Gloria e combatti contro le Val\'kyr per determinare le più degne.', 'Avrò bisogno di altre Val\'kyr per unirsi a Danica nella battaglia che incombe. $n, a te spetta l\'onore di scegliere le più degne.\n\nLe più forti si presteranno alla sfida al Circolo della Gloria. Combatti bene, $C, e rendi onore alle armi che impugni.', '', '', '', '', '', '', 39653),
(63842, 'itIT', 'Bel trucchetto', 'Riduci 15 nemici e ingrossa $2oa Rattifauce affinché li mangino nel Tremacolo!', 'Questi crudeli tormentatori mi fanno impazzire...\n\nQuei bulli del Carceriere torturano le anime buone inviate qui ingiustamente solo perché nessuno le difende!\n\nBe\', ora ci sono qui io e ho il piano perfetto per fargliela pagare.\n\nChe ne dici? Vuoi aiutarmi a bullizzare questi bulli?', '', '', '', '', '', 'Incontra il Principe Renathal, è nascosto sotto le scale del Tremacolo.', 39653),
(63841, 'itIT', 'Caccia nel cielo', 'Usa la Lancia di Korayn per trascinare $2oa Guardinghi del Cielo Giurafauce a terra e uccidili.', 'Lyn Cantevole e gli altri Dragatori grossi stanno venendo colpiti duramente dagli assalti aerei.\n\nI Dragatori non possono arrivarci, ma la Caccia Selvaggia può raggiungere qualsiasi preda.\n\nPrendi la mia lancia e usala per portare a terra i Giurafauce nel cielo sopra il ponte occidentale.\n\nUna volta atterrati, saranno facili da eliminare.\n\nI miei bracconieri ti aiuteranno a rallentarli.', '', '', '', '', '', 'Incontra il Principe Renathal, è nascosto sotto le scale del Tremacolo.', 39653),
(63839, 'itIT', 'Se anche solo una fosse meritevole', 'Ispeziona Anime Immeritevoli nel Tremacolo finché non ne trovi una davvero meritevole.', 'Ho visto di persona anime degne venire scagliate nella Fauce.\n\nAnche Gresit vi è stato quasi gettato dai servitori del Ciambellano Supremo. Si è dimostrato più che meritevole sotto la mia supervisione.\n\nGuarda tra le anime che la feccia del Carceriere ha ritenuto \"indegne\". Ispezionale per controllare se meritano il loro destino.\n\nAnche esaminando ogni singola anima nel Tremacolo e trovandone solo una meritevole di essere riportata a Revendreth, ne varrà la pena.', '', '', '', '', '', 'Incontra il Principe Renathal, è nascosto sotto le scale del Tremacolo.', 39653),
(63838, 'itIT', 'Sfida del Duellante', 'Chiedi a Lyn Cantevole di lanciarti sui bastioni superiori, poi sfida a duello i campioni dell\'armata dei Giurafauce.', '<Nadjia continua a parare gli attacchi dai nemici Giurafauce mentre si gira verso di te.>\n\nCome puoi vedere, siamo molto occupati qui alla barricata.\n\nIo difenderò questo posto mentre tu affronti i campioni dell\'armata dei Giurafauce.\n\nSconfiggili in bella vista dei loro sottoposti.\n\nNessuna pietà, $p. Abbatti il loro morale.', '', '', '', '', '', 'Incontra il Principe Renathal, è nascosto sotto le scale del Tremacolo.', 39653),
(63837, 'itIT', 'Un tè per ogni occasione', 'Aiuta Tubbins e Gubbins a portare il tè a $2oa alleati del Tremacolo.', '$Caro:Cara; $p! Sapevo che saresti $garrivato:arrivata; appena in tempo per salvarci dalla noia!\n\nStavo giusto dicendo a Niya di quella volta che mi hai salvato dal Distretto delle Braci con le proprietà lenitive del tè!\n\nÈ un po\' scettica. Forse potresti aiutare Tubbins e Gubbins a mostrarle che, con il tè, tutto è possibile!', '', '', '', '', '', 'Incontra il Principe Renathal, è nascosto sotto le scale del Tremacolo.', 39653),
(63836, 'itIT', 'Fan club di Rompidenti', 'Uccidi $1oa nemici di Torgast tirati fuori dal portale da Rompidenti.', 'Rompidenti è il Dragatore più forte che io abbia mai visto! È incredibile!\n\nÈ laggiù, con le mani dentro quel grosso portale di Torgast e strappa via i cattivi direttamente dalla loro casa!\n\nNon sanno neanche cosa sta succedendo, ahah!\n\nIo e Mazzafaccia ci siamo uniti al suo fan club non appena siamo arrivati qui.\n\nVuoi entrare anche tu? Devi guadagnarti la tua iscrizione, come tutti gli altri: vai laggiù e combatti contro qualsiasi cosa tiri fuori dal portale!', '', '', '', '', '', 'Incontra il Principe Renathal, è nascosto sotto le scale del Tremacolo.', 39653),
(63835, 'itIT', 'L\'ira funesta dell\'Alfiere della Festa', 'Aiuta Temel, l\'Alfiere della Festa, a lanciare bombe avvelenate su $2oa nemici nel Tremacolo.', 'Oh, sei $gtornato:tornata; così presto, $p!\n\n...o non ci siamo ancora $gincontrati:incontrate;? È difficile ricordare a volte...\n\nIn ogni caso, confido che tu stia facendo progressi con il piano del Custode della Cripta Kassir per indebolire i nostri avversari.\n\nI dettagli del piano mi sfuggono, ma sono certa che fosse coinvolto Temel. Ho sentito dire che si fa chiamare \"Alfiere della Festa\" adesso...\n\n<La Curatrice guarda dietro di te per un momento.>\n\n\"Alfiere della Festa \"... Devo essere stata via da Revendreth più a lungo di quanto pensassi.', '', '', '', '', '', 'Incontra il Principe Renathal, è nascosto sotto le scale del Tremacolo.', 39653),
(63834, 'itIT', 'Armi del Tremacolo', 'Raccogli $1oa Armi dei Giurafauce, $2oa Corone Spettrali e $3oa Occhi d\'Ombra.', 'I Venthyr di Oblio del Peccato non sprecano anime, e i suoi Litogeni non sprecano armamenti.\n\nRecupera gli strumenti dei nostri nemici, così potremo ricondizionarli per la nostra armata.', '', '', '', '', '', 'Incontra il Principe Renathal, è nascosto sotto le scale del Tremacolo.', 39653),
(63833, 'itIT', 'Terrorizzare il Tremacolo', 'Uccidi $1oa nemici al Tremacolo.', 'Sono certo che i miei compatrioti e generali abbiano compiti più specifici per te.\n\nMa la mia richiesta è semplice. I nostri nemici attualmente ci circondano su tutti i lati.\n\nRicacciali indietro per darci più spazio di manovra.', '', '', '', '', '', 'Incontra il Principe Renathal, è nascosto sotto le scale del Tremacolo.', 39653),
(63831, 'itIT', 'La voce della furia', 'Aiuta il Maestro Fabbro Helgar alla Forgia di Odyn.', 'Risponderò a questo attacco alle mie Val\'kyr con una furia implacabile!\n\n$C, tu avrai un ruolo fondamentale. Dovrai raccogliere tutto il coraggio che hai mostrato oggi per attirare il mio Occhio in battaglia.\n\nMa prima, un compito più semplice... la creazione del corno che evocherà la mia ira. Il Maestro Fabbro Helgar ti guiderà.', '', '', '', '', '', '', 39653),
(63829, 'itIT', 'Nessuno fluttua quaggiù', '$1oa Aspiranti Intrappolati salvati.', 'Ora è la nostra occasione di liberare quelli che avevamo dato per persi!\n\nMolti dei nostri Aspiranti sono stati rapiti dal Carceriere per farne truppe per il suo esercito. Coloro che si sono rifiutati sono rinchiusi nelle gabbie che fluttuano sopra di noi, abbandonati lì finché le loro anime non si spezzano.\n\nDistruggi le Catene del Dominio e libera gli Aspiranti Intrappolati nelle gabbie.', '', '', '', '', '', '', 39653),
(63828, 'itIT', 'Il mio è più grande', 'Usa il Demolitore dei Centurioni per eliminare i costrutti del Carceriere.', 'Il Carceriere ha schierato un gran numero di costrutti appena forgiati per contrastare le nostre forze. Fortunatamente, ero pronto per questa eventualità.\n\nHo preparato il nostro più grande Centurione per rispondere a questa minaccia.\n\nTi prego, Calcafauce, cavalca il nostro Centurione e guidalo in combattimento.', '', '', '', '', '', '', 39653),
(63827, 'itIT', 'Parole Incoraggianti', 'Recita le parole del codice a $1oa Protettori Esausti.', 'Le nostre forze combattono senza sosta da ore. Senza dubbio saranno stanche e scoraggiate.\n\nPrendi questo codice e recita le parole al suo interno alle nostre truppe. Non farti ingannare. Anche se la prosa sembra incomprensibile e senza senso, nasconde un immenso potere.\n\nSentire queste parole rinvigorirà la speranza dei Protettori esausti.', '', '', '', '', '', '', 39653),
(63824, 'itIT', 'Assalto dei Kyrian', 'Completa $1oa Missioni nel Forte della Perdizione e il Volto dell\'Oblio.', 'Le forze del Carceriere sono state colte di sorpresa dal nostro attacco. Invaderemo il Forte della Perdizione e sconfiggeremo i suoi campioni all\'Altare del Dominio!\n\nServe il tuo aiuto, Calcafauce. Aiuta le nostre forze sul campo!', '', '', '', '', '', '', 39653),
(63823, 'itIT', 'Assalto dei Silfi della Notte', 'Completa $1oa Missioni nel Forte della Perdizione e il Volto dell\'Oblio.', 'Le forze del Carceriere sono state colte di sorpresa dal nostro attacco. Invaderemo il Forte della Perdizione e sconfiggeremo i suoi campioni all\'Altare del Dominio!\n\nCi serve il tuo aiuto, Calcafauce. Aiuta le nostre forze sul campo!', '', '', '', '', '', '', 39653),
(63822, 'itIT', 'Assalto dei Venthyr', '', '', '', '', '', '', '', '', 39653),
(63811, 'itIT', 'Un rapporto di odio-odio', 'Accompagna Danica alla Grande Sala dell\'Idromele e informa Odyn delle azioni di Helya.', 'Quando la prima delle mie sorelle scomparve, ci preoccupammo. Coloro che vennero mandati a cercarla non fecero ritorno, e nemmeno i successivi.\n\nQuello che scoprimmo fu un terribile tradimento da parte di qualcuno di cui ci fidavamo.\n\nVieni, dobbiamo dire a Odyn cos\'abbiamo visto nella Fauce.\n\nLa sua furia sarà grande.', '', '', '', '', '', '', 39653),
(63810, 'itIT', 'Fatti della stessa pasta', 'Segui la scia di piume dorate per trovare la creatura che le ha lasciate cadere.', 'Ho visto molte ali d\'ebano nella Fauce, ma mai ali di oro brillante.\n\nOra che i Sequenziatori dell\'Aura stanno trasmettendo in maniera affidabile, dovremmo scoprire l\'origine di queste piume.\n\nSegui le tracce, Calcafauce. Qui c\'è un mistero, e molto probabilmente anche un profitto.\n\nL\'oro ha molto valore da dove vieni, non è così?', '', '', '', '', '', '', 39653),
(63794, 'itIT', 'Ricercato dagli Alienatori: Behemoth Famelico', 'Ottieni una Notevole Quantità di Sangue del Divoratore da un Behemoth Famelico.', 'Nuove terre significano nuove opportunità. Forniremo una discreta quantità di oggetti preziosi a chiunque fosse interessato in cambio di una notevole quantità di sangue dei divoratori, preferibilmente dei mastodonti.\n\nAstenersi perditempo e cacciatori deboli di cuore.\n\nRiportare i campioni a Ta\'nasi al Riposo del Custode.', '', '', 'Behemoth Famelico', '', '', '', 39653),
(63793, 'itIT', 'Ricercato dagli Alienatori: Ensydius il Profanatore', 'Sconfiggi Ensydius il Profanatore.', 'Un Giurafauce alato di nome Ensydius il Profanatore sta intralciando gli sforzi del Cartello a Korthia.\n\nChiunque elimini questo male verrà ricompensato. \n\nFai attenzione. Ensydius è un potente nemico. Potresti aver bisogno di diversi alleati per ucciderlo.', '', '', 'Ensydius il Profanatore', '', '', '', 39653),
(63792, 'itIT', 'Ricercato dagli Alienatori: Nocturnus l\'Annientatore', 'Sconfiggi Nocturnus l\'Annientatore.', 'Un malvagio magus della Fauce di nome Nocturnus l\'Annientatore sta intralciando gli sforzi del Cartello a Korthia.\n\nChiunque elimini questo male verrà ricompensato. \n\nFai attenzione. Nocturnus è un potente nemico. Potresti aver bisogno di diversi alleati per ucciderlo.', '', '', 'Nocturnus l\'Annientatore', '', '', '', 39653),
(63791, 'itIT', 'Ricercato dagli Alienatori: Valdinar il Maledetto', 'Sconfiggi Valdinar il Maledetto.', 'Un Giurafauce corazzato di nome Valdinar il Maledetto sta intralciando gli sforzi del Cartello a Korthia.\n\nChiunque elimini questo male verrà ricompensato. \n\nFai attenzione. Valdinar è un potente nemico. Potresti aver bisogno di diversi alleati per ucciderlo.', '', '', 'Valdinar il Maledetto', '', '', '', 39653),
(63790, 'itIT', 'Ricercato dagli Alienatori: Sire Azzorak', 'Sconfiggi Sire Azzorak.', 'Un potente Signore del Terrore di nome Sire Azzorak sta intralciando gli sforzi del Cartello a Korthia.\n\nChiunque elimini questo male verrà ricompensato. \n\nFai attenzione. Azzorak è un potente nemico. Potresti aver bisogno di diversi alleati per ucciderlo.', '', '', 'Sire Azzorak', '', '', '', 39653),
(63789, 'itIT', 'Sforzi costanti: l\'Antro dello Studioso', 'Libera l\'Antro dello Studioso dai Giurafauce.', 'Non possiamo permettere che i Giurafauce abbiano un avamposto così vicino al nostro accampamento. Gli Attendenti dicono di tenere nascosto questo posto da occhi indiscreti, ma io non riuscirò a riposarmi finché li vedrò.\n\nEntra nell\'Antro dello Studioso e purificalo dalle forze del Carceriere.', '', '', '', '', '', '', 39653),
(63788, 'itIT', 'Sforzi costanti: il Sacrario della Guida', 'Libera il Sacrario della Guida dai divoratori.', 'La casa degli Attendenti di Korthia è stata distrutta dal Carceriere, ma possiamo aiutarli in questo momento difficile.\n\nQui vicino c\'è il Sacrario della Guida. Ne parlano con riverenza e grande tristezza. È un posto dove vanno a pregare e cercare verità. Attualmente è infestato dai divoratori.\n\nElimina i divoratori, così che gli altri possano ancora cercare conforto nei loro rituali e nelle loro preghiere.', '', '', '', '', '', '', 39653),
(63787, 'itIT', 'Sforzi costanti: la Terrazza del Mazzuolatore', 'Elimina i Pellescheggia dalla Terrazza del Mazzuolatore.', 'I miei Occhi mi dicono che l\'osservatorio della Terrazza del Mazzuolatore è vicino alla nuova strada che va dalla Fauce a Korthia. Potrebbe garantirci un vantaggio strategico e tattico.\n\nSfortunatamente, l\'area è piena di Pellescheggia.\n\nSe riusciamo a mettere al sicuro la zona, ci fornirà un percorso chiaro verso ovest, nonché un punto di osservazione per controllare le forze del Carceriere.', '', '', '', '', '', '', 39653),
(63786, 'itIT', 'Ripulire il Nido Ventoso', 'Raggiungi il Nido Ventoso e libera l\'area dalle creature ostili.', 'I cieli sopra Korthia sono un luogo pericoloso.\n\nNon solo i Giurafauce minacciano le nostre forze, ma anche le creature native ci sono ostili. Dobbiamo tenere i cieli al sicuro per le nostre bestie e i nostri alleati alati.\n\nL\'origine delle creature native è il Nido Ventoso. Vai lì e ripuliscilo da quelle creature ostili.\n\nPoi, finalmente otterremo la supremazia aerea.', '', '', '', '', '', '', 39653),
(63785, 'itIT', 'Sforzi costanti: il Quorum del Cercatore', 'Respingi le forze del Carceriere dal Quorum del Cercatore a Korthia.', 'La furia delle forze di Zovaal continua a devastare queste terre.\n\nDobbiamo mandare loro un messaggio. Mostra loro che non ci arrenderemo, $n.\n\nLa potenza di Selvarden è al tuo fianco.', '', '', '', '', '', '', 39653),
(63784, 'itIT', 'L\'oro non è un problema', 'Recupera $1oa Gromit Grigi.', '$p! Come vanno le cose?\n\nAbbiamo sentito che c\'era qualcosa di interessante qua fuori.\n\nAllora, vedi quei saltatori? Difficili da vedere vero? Hanno addosso una pelliccia brillante che farebbe comodo a me e ai miei ragazzi per non dare nell\'occhio. Sai com\'è, sempre meglio evitare i capi e cose così.\n\nHo bisogno che ne catturi un po\'. L\'oro non è un problema, basta solo che mi porti quelle piccole pesti ancora vive.', '', '', '', '', '', '', 39653),
(63783, 'itIT', 'Requisizione dell\'Animum', 'Recupera $1oa Animum Divorato dai divoratori al Sacrario della Guida.', 'I nostri sforzi hanno bisogno di una costante fornitura di truppe, rifornimenti e Animum. L\'ultimo è il più raro, per ovvie ragioni. Ma ho imparato a essere intraprendente.\n\nQua vicino c\'è una fonte di Animum abbondante: i divoratori che attualmente infestano il Sacrario della Guida. Non è facile estrarne da un\'anima, ma è ugualmente efficace, se sei abbastanza forte. Lo sei?', '', '', '', '', '', '', 39653),
(63782, 'itIT', 'Rituali Giurafauce', 'Recupera $1oa Grimori dei Giurafauce.', 'I Giurafauce hanno una miriade di fruitori della magia tra le loro forze. La loro magia ci è sconosciuta e questo la rende letale.\n\nDobbiamo scoprire cosa sono capaci di fare per preparare una difesa apposita. La mia curiosità nei confronti dei loro metodi e rituali è secondaria.\n\nDai la caccia a questi infami incantatori e portami i loro grimori.', '', '', '', '', '', '', 39653),
(63781, 'itIT', 'I piani di battaglia dei Giurafauce', 'Recupera i Piani di Battaglia dei Giurafauce.', 'Cosa causa più danni ai nemici, distruggere un contingente delle loro forze o interrompere le loro comunicazioni?\n\nAncora meglio, e se le comunicazioni ti permettessero di posizionare le tue forze per tendere un\'imboscata ai loro rinforzi?\n\nVedo che capisci. Ci sarà un Luogotenente Giurafauce, Voxiferus, che viaggia dalla Fauce a Korthia, seguendo la strada settentrionale. Trovalo, uccidilo e portami i piani di battaglia.', '', 'L\'imponente generale trasporta piani di battaglia dei Giurafauce tra la Fauce e Korthia.', 'Luogotenente Voxiferus', '', '', '', 39653),
(63780, 'itIT', 'Vediamo se gli piace QUESTO!', 'Raccogli $1oa Emblemi dei Giurafauce.', 'Solo pensare a come le forze del Carceriere abbiano fatto irruzione a Selvarden mi fa impazzire di rabbia!\n\nE quando mi sento così, voglio pareggiare i conti.\n\nO meglio, chiedo a te di aiutarmi a pareggiare i conti! Uccidi quei Giurafauce e riportami i loro emblemi per mostrarmi quanti ne hai uccisi.\n\nNon mi interessa da dove li prendi, purché provengano da quegli idioti della Fauce!', '', '', '', '', '', '', 39653),
(63779, 'itIT', 'Una parvenza di normalità', 'Raccogli $1oa Offerte al Santuario.', '$p, dobbiamo aiutare gli Attendenti di Korthia. Hanno perso così tanto, e così all\'improvviso.\n\nQui nelle vicinanze, nel Sacrario della Guida, erano soliti prendere delle offerte e lasciarle ai templi. Dopo l\'invasione dei Giurafauce, non sono potuti entrare al Sacrario, né recuperare le loro preziose offerte.\n\nSe potessi raccogliere le offerte e riportarle indietro, potrebbe dare agli attendenti una parvenza di normalità.', '', '', '', '', '', '', 39653),
(63778, 'itIT', 'Andiamo Avanti', 'Raccogli $1oa Animum Saccheggiato dall\'Antro dello Studioso.', 'Mi spezza il cuore vedere un\'altra terra così devastata. Posso solo immaginare quanto dev\'essere stata bella Korthia, una volta.\n\nMa non dobbiamo concentrarci su quello che abbiamo perso. Come mi ha insegnato Ara\'lon: non dobbiamo restare con le mani in mano.\n\nPossiamo scegliere di combattere.\n\nPuoi aiutare a recuperare l\'Animum da quei Giurafauce. Ne faremo buon uso, impiegandolo per le nostre forze e difese.', '', '', '', '', '', '', 39653),
(63777, 'itIT', 'Segreti sigillati', 'Recupera $1oa Contenitori Sigillati all\'Antro dello Studioso.', 'Ah, Korthia. Quali segreti verranno rivelati?\n\nI miei collaboratori hanno lavorato duramente, cercando di scoprire e procurarsi diversi piccoli oggetti di interesse in questa terra devastata. Nulla di importante, te lo assicuro.\n\nHanno messo in sicurezza gli oggetti in alcune casse designate, che sono in attesa di essere raccolte nell\'Antro dello Studioso. Non preoccuparti: sono chiuse con un sigillo impenetrabile per proteggere il contenuto e il trasportatore.\n\nPortami quei contenitori sigillati e ti ricompenserò generosamente.', '', '', '', '', '', '', 39653),
(63776, 'itIT', 'Registri osservazionali', 'Raccogli $1oa Registri Osservazionali dall\'Antro dello Studioso.', 'Salute, Calcafauce, hai un momento?\n\nCome sicuramente saprai, il mio cartello ha sparso dispositivi di osservazione per tutta Korthia. Ma quei dati non ci sono di nessun aiuto se non li recuperiamo. Ed è qui che entri in gioco tu.\n\nI dati dell\'Antro dello Studioso dovrebbero essere pronti per la raccolta. Non vedrai i dispositivi, ma i loro dati ti appariranno come una sfera luminosa.\n\nAssicurati di controllare nelle caverne sottoterra!\n\nPortami quei dati e ti ricompenserò adeguatamente.', '', '', '', '', '', '', 39653),
(63775, 'itIT', 'Chiavi e Crittogrammi', 'Recupera $1oa Crittografi Rubati all\'esterno degli archivi e il Quorum del Cercatore.', 'I depositi della conoscenza all\'interno di Korthia hanno diversi strati di sicurezza... per delle buone ragioni.\n\nOgni archivio richiede diversi crittografi per poterne decifrare le barriere. Questi sono, per mancanza di un termine migliore, le chiavi di ogni segreto.\n\nPerlustra l\'esterno degli archivi in cerca dei crittografi rubati dai Giurafauce e riportali da me. Terrò loro, e i segreti che proteggono, al sicuro.', '', '', '', '', '', '', 39653),
(63774, 'itIT', 'Una questione di cadaveri', 'Consegna $1oa Anime Incorporee ai Ricucitori d\'Assalto per dare loro un nuovo corpo.', 'Guardati intorno, $p. Ci sono montagne di cadaveri ammucchiati a perdita d\'occhio. Queste Anime Incorporee bramano di tornare in battaglia.\n\nÈ col loro fervore che porteremo le cose a nostro favore.\n\nRaduna le Anime Incorporee nel campo di battaglia e portale ai miei ricucitori alle pile di cadaveri per costruire loro un nuovo corpo!', '', '', '', '', '', 'Torna dalla Baronessa Draka.', 39653),
(63773, 'itIT', 'Tu e quale armata', 'Seleziona un campione ed elimina $7oa Collerici Vincolati alla Fauce e $8oa Demolitori Vincolati alla Fauce.', 'Il Carceriere ha inviato una forza di truppe élite per colpirci alle spalle. Il loro attacco minaccia il nostro intero assalto!\n\nHo bisogno che tu e un altro soldato eliminiate questi nemici. Un volontario da ognuna delle cinque casate di Maldraxxus ha richiesto di aiutarti, $n.\n\nScegline uno e dagli l\'onore di servire al tuo fianco.', '', '', '', '', '', 'Riferisci la notizia del tuo successo alla Baronessa Draka.', 39653),
(63772, 'itIT', 'Sotto le loro ali', 'Aiuta Artemede e le forze dei Kyrian fuori dall\'ingresso meridionale del Forte della Perdizione.', 'Le forze dei Kyrian sono arrivate per aiutare con l\'assalto. Hanno messo al sicuro i nostri fianchi e assedieranno i cancelli a sud del Forte della Perdizione.\n\nFai rapporto ad Artemede e aiuta i Kyrian in ogni modo possibile!', '', '', '', '', '', '', 39653),
(63764, 'itIT', 'Rivendicare il cielo', 'Vola con Danica alle Sale di Odyn nella Rocca Celeste.', 'Piango la perdita delle mie sorelle e non desidero altro che vendicarle. Tuttavia, so di non poter competere con la magia della strega o con la sua armata di Giurafauce.\n\nDobbiamo lasciare che la saggezza ci guidi e volare via da qui. \n\nAnche se sono indebolita dalla mia prigionia, ho la forza di portarti via da questo luogo.\n\nAndiamo, $gamico:amica;.', '', '', '', '', '', '', 39653),
(63763, 'itIT', 'Potrebbero essere... ovunque', 'Porta la Testa di Azodius a Bolvar Domadraghi al Riposo del Custode.', '<La testa ancora calda del Signore del Terrore Azodius ti fa delle smorfie.\n\nGli attendenti al Riposo del Custode dovrebbero essere informati del rapimento dello Scriba del Destino.\n\nSicuramente il Gran Signore Domadraghi vorrà sapere di questa minaccia inaspettata.>', '', '', '', '', '', 'Porta la testa a Bolvar al Riposo del Custode.', 39653),
(63762, 'itIT', 'Nell\'illusione', 'Usa lo Strumento dello Scriba del Destino per dissolvere l\'illusione.', 'Lo Scriba del Destino ha raccolto gli oggetti necessari per creare un\'illusione in questa stanza. Fortunatamente, possiamo usare il suo stesso strumento per dissolverla e rivelarlo.\n\nSarà molto felice di vedere un volto amico.\n\nDevo ammetterlo, hai dimostrato di essere incredibilmente utile in questo compito. Non ce l\'avrei mai fatta senza di te.', '', '', '', '', '', '', 39653),
(63761, 'itIT', 'Vendetta posticipata', 'Uccidi $1oa Divoratori al Sacrario della Guida.', '<Il Protettore di Korthia è gravemente ferito e fatica a parlare.>\n\nDivoratori... hanno invaso il Sacrario. Eravamo troppo pochi...\n\nIl mio dovere... incompiuto.\n\nLo Scopo... Io...\n\n<La voce del Protettore svanisce.>', '', '', '', '', '', '', 39653),
(63760, 'itIT', 'Echi del destino', 'Fai risuonare lo Strumento dello Scriba del Destino presso i santuari al Sacrario della Guida.', 'I divoratori hanno invaso questo posto, ma dobbiamo concentrarci sul trovare lo Scriba del Destino.\n\nGli attendenti che venivano qui di solito lasciavano un\'offerta di Animum ai santuari.\n\nLo strumento che hai trovato dovrebbe risuonare se lo Scriba del Destino è stato nelle vicinanze. Con un po\' di fortuna, questo dovrebbe darci un indizio su dov\'è andato.', '', '', '', '', '', '', 39653),
(63759, 'itIT', 'Reindirizzare la ricerca', 'Incontra il Sorvegliante Kah-Than all\'entrata del Sacrario della Guida a Korthia.', 'Credo che lo Scriba del Destino si sia diretto al Sacrario della Guida. Un luogo sacro per gli attendenti di Korthia.\n\nFortunatamente, poiché sembra che tu abbia l\'abitudine di raccogliere tutta la spazzatura che trovi, abbiamo lo Strumento dello Scriba del Destino!\n\nDi sicuro si rivelerà utile per trovarlo. Ma prima, al Sacrario.', '', '', '', '', '', 'Incontra il Sorvegliante Kah-Than all\'entrata del Sacrario della Guida a Korthia.', 39653),
(63758, 'itIT', 'L\'ultimo posto dove si guarda', 'Cerca lo Scriba del Destino disperso al Quorum del Cercatore.', 'Sono venuta qui, sperando di trovare lo Scriba del Destino o qualcosa che mi aiutasse a trovarlo.\n\nTutto lascia pensare che sia stato qui e che sia sopravvissuto all\'attacco dei Giurafauce. L\'unico posto che non ho controllato è una camera di meditazione, dal lato opposto delle rovine.\n\nPer me è troppo pericoloso tornare al Quorum del Cercatore. Potresti aiutarmi?\n\nDevo trovare lo Scriba del Destino, è una questione di grande importanza.', '', '', '', '', '', '', 39653),
(63757, 'itIT', 'Rubare ai Ladri', 'Recupera $1oa Manufatti di Korthia dai Giurafauce.', '<I Giurafauce stavano trasportando un manufatto di Korthia.\n\nNon è chiaro ciò che il nemico voglia farne di queste reliquie, ma sospetti che i custodi del Riposo del Custode vogliano riaverle indietro.>', '', '', '', '', '', '', 39653),
(63756, 'itIT', 'Salvati dal Tormento', 'Salva $1oa Attendenti Torturati al Quorum del Cercatore.', 'I Giurafauce non stanno solo uccidendo chiunque trovino al Quorum del Cercatore. Stanno interrogando i superstiti.\n\nDovremmo cercare di salvare coloro che possiamo. È possibile che uno di loro sappia dov\'è lo Scriba del Destino.', '', '', '', '', '', '', 39653),
(63755, 'itIT', 'Una questione di urgenza', 'Cerca lo Scriba del Destino di Korthia.', 'Calcafauce, c\'è una questione urgente di cui non ci siamo ancora occupati.\n\nIl nostro Scriba del Destino è scomparso. Non ha trovato il modo di arrivare qui. Avrebbe dovuto essere al Quorum del Cercatore...\n\n<Lo Scriba del Cammino Roh-Vess si ferma.>\n\nPotresti cercare lo Scriba del Destino? Molti degli attendenti si sono nascosti dai Giurafauce nelle caverne vicino alle rovine.', '', '', '', '', '', '', 39653),
(63754, 'itIT', 'Uccellino in gabbia', 'Ottieni il sigillo forgiato nell\'Hel da Kjellrun e libera Danica dalla prigionia.', 'Resta in silenzio. Non dobbiamo attirare l\'attenzione.\n\nMolte delle mie sorelle sono già andate perdute. Presto sarà il mio turno di morire nel vile rituale di quella strega.\n\nLiberami da questa gabbia in modo che possa portarci entrambi al sicuro. Il Guardiano Odyn dev\'essere avvisato di questo tradimento!\n\nLa Giurafauce che chiamano Kjellrun ha con sé il sigillo che può liberarmi. Potrai trovarla nella sala qui vicino.', '', '', 'Kjellrun la Straziatrice', '', '', '', 39653),
(63753, 'itIT', 'Centurioni, in marcia!', 'Raccogli $1oa Granuli d\'Animum per potenziare e aiutare i Centurioni in combattimento.', 'Tre dei nostri Centurioni hanno sfondato la porta laterale. Hanno bisogno di altro Animum per continuare l\'assalto.\n\nMolti dei miei assistenti hanno cercato di portare Animum ai Centurioni, ma hanno fallito. Ti prego, recupera l\'Animum e aiuta i Centurioni nell\'attacco.', '', '', '', '', '', '', 39653),
(63740, 'itIT', 'Consultare gli esperti', 'Entra in comunione con i ricordi degli Archivisti.', 'Possiamo ripristinare la funzionalità del Bastone Guida, ma servirà la saggezza degli Archivisti.\n\nNon solo la mia, ma quella di tutti gli Archivisti prima di me. Il loro luogo di riposo è qui vicino. Dopo una tale distruzione di Korthia e la possibilità che questa distruzione continui, questa potrebbe essere la nostra ultima possibilità per far visita ai loro memoriali prima che vengano irrevocabilmente rovinati.\n\nVisita i memoriali degli Archivisti. Porta Roh-Suir con te, così che possa prendere nota dei loro messaggi prima che vadano perduti.', '', '', '', '', '', '', 39653);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(63739, 'itIT', 'Ascendere alla speranza', 'Incontra l\'Archivista Roh-Senara e lo Studioso Roh-Suir vicino alla cima dell\'Ascesa della Speranza.', 'C\'è un\'ultima cosa che dobbiamo fare.\n\nIncontriamoci in cima al picco dell\'Ascesa della Speranza.', '', '', '', '', '', '', 39653),
(63738, 'itIT', 'Stabilire l\'archivio', 'Incontra lo Studioso Roh-Suir al Riposo del Custode.', 'Andrò al Riposo del Custode, dove c\'è un piccolo barlume di salvezza.\n\nLà, stabiliremo un nuovo archivio.\n\nIncontrami là appena potrai.\n\nSpero che potremo contare di nuovo su di te. Avremo bisogno del tuo aiuto in futuro.', '', '', '', '', '', '', 39653),
(63737, 'itIT', 'Trovare il proprio vero scopo', 'Partecipa al rituale per sintonizzare il Bastone Guida.', 'I nostri sforzi ci hanno condotto qui.\n\nCon la saggezza combinata degli Archivisti, e un po\' d\'aiuto da $gun:una; grande $R $C, sintonizzeremo il Bastone Guida con le reliquie che cerchiamo.\n\nSe avremo successo, avremo ciò che ci serve per ristabilire l\'Archivio.\n\nIl nostro sacro lavoro potrà continuare.', '', '', '', '', '', '', 39653),
(63736, 'itIT', 'Infusione d\'Animum', 'Infondi il Bastone Guida con l\'Animum.', 'Di solito, infonderemmo il Bastone Guida con l\'energia dalla Stella Fatua, un\'altra reliquia notevole.\n\nPurtroppo, questo non è possibile, ma all\'occorrenza l\'Animum è un sostituto accettabile.\n\nPrendi il Bastone Guida. Brandiscilo vicino ai divoratori uccisi nell\'estuario sotto di noi.\n\nIl bastone dovrebbe assorbire il loro Animum.', '', '', '', '', '', '', 39653),
(63734, 'itIT', 'Il Bastone Spezzato', 'Recupera i tre pezzi del Bastone Guida.', 'Non ho altra scelta che affidarti i segreti del Bastone Guida.\n\nNelle mani giuste come quelle di un Archivista esperto, il bastone può localizzare Reliquie importanti negli aldilà delle Terretetre.\n\nÈ stato diviso in tre pezzi per impedire che cadesse nelle mani sbagliate. Gli invasori hanno trovato i pezzi, ma non sono ancora al corrente del loro significato.\n\nRecupera i pezzi del Bastone. Ogni parte è in possesso di un membro differente dei Giurafauce.', '', '', '', '', '', '', 39653),
(63733, 'itIT', 'Liberare un passaggio', 'Sconfiggi $1oa invasori Giurafauce.', 'Anche se aborro la violenza e preferisco rispondere al conflitto in modo ragionevole, non abbiamo alternative qui.\n\nPer riuscire a mettere al sicuro sia me che Roh-Suir, devi sferrare un colpo decisivo ai Giurafauce che hanno invaso il Quorum del Cercatore.\n\nApri un passaggio così che possiamo fuggire.', '', '', '', '', '', '', 39653),
(63732, 'itIT', 'Interrompere gli interrogatori', 'Salva l\'Archivista Roh-Senara.', 'Shhh... silenzio!\n\nGli invasori mi uccideranno se mi troveranno qui, proprio come hanno fatto con molti altri!\n\n<Roh-Suir punta freneticamente in direzione dei Giurafauce.>\n\nHanno torturato l\'Archivista!\n\nDevi trovare un modo per salvarla. Non possiamo permettere ai Giurafauce di scoprire che cosa sa!', '', 'Quest\'interrogatore è tanto spietato quanto odioso.', 'Interrogatore Tzench', '', '', '', 39653),
(63731, 'itIT', 'Ricerche sulle Reliquie di Korthia', 'Trova lo Studioso Roh-Suir per saperne di più sulle reliquie.', '<Trovi un libro rovinato sulle reliquie che stavano venendo conservate a Korthia.>\n\n<Un nome scritto tra le pagine comincia a brillare: \"Roh-Suir\".>\n\n<Il libro volteggia tra le tue mani e indica una direzione, mentre il nome di Roh-Suir continua a pulsare.>\n\n<Forse questo Roh-Suir potrebbe aiutarti a scoprire di più sulle reliquie che hai trovato.>', '', '', '', '', '', '', 39653),
(63728, 'itIT', 'A caccia tra le Casate', 'Parla con Ysera per saperne di più, quindi raggiungi Huln Alto Monte al Sepolcro della Conoscenza.', 'Ho sognato che Tyrande Soffiabrezza sia vitale per la sopravvivenza di Selvarden.\n\nI Silfi della Notte stanno cercando altri come lei, altri che sono stati Guerrieri della Notte. Abbiamo reclutato un antico alleato di Azeroth, Huln Alto Monte, per cercarli.\n\nIl potere di Elune è troppo grande perché un mortale possa contenerlo, inclusa Tyrande. Non so per quanto ancora potrà resistere.\n\nLascia che ti spieghi meglio la situazione, poi dovrai sbrigarti a incontrare Huln a Maldraxxus.', '', '', '', '', '', '', 39653),
(63727, 'itIT', 'Ritorno del Primus', 'Incontra il Primus al Riposo del Custode per formare un nuovo piano d\'attacco.', 'Il Carceriere ha quattro sigilli su cinque che gli servono per ciò che ha in mente.\n\nÈ stato uno sciocco ad averci permesso di vivere. Il suo desiderio di vederci piegati al suo volere sarà la sua rovina.\n\nNon tutto è perduto, se sei $gdisposto:disposta; a metterti al lavoro. C\'è ancora qualcosa che si può fare.\n\nVieni. Incontrerò il resto delle tue forze e organizzeremo il nostro prossimo attacco.', '', '', '', '', '', 'Parla col Primus a Korthia.', 39653),
(63726, 'itIT', 'Districare il Sigillo', 'Parla con Bolvar per discutere di cosa fare col Sigillo.', 'Il sigillo del Primus è legato dalla magia della memoria. Mi ricorda qualcosa che hai già incontrato prima.\n\nTi sei fatto amico l\'Incisore di Rune, quella povera anima intrappolata nelle viscere di Torgast. Ha preso quei ricordi che hai trovato e ti ha aiutato a farne armi e armature.\n\nForse può separare il sigillo da questa matassa di ricordi.\n\nÈ la nostra occasione migliore di ottenere il sigillo. Ma sarà pericoloso.', '', '', '', '', '', 'Parla col Primus a Torgast.', 39653),
(63725, 'itIT', 'Negli archivi', 'Recupera il Sigillo del Primus negli archivi di Korthia.', 'La distruzione qui è... impressionante.\n\n<Tal-Galan pronuncia una preghiera.>\n\nL\'Animum scorre in ciò che rimane degli archivi. Ora dovremmo riuscire a entrare.\n\nUna volta dentro, mi occuperò di recuperare il Sigillo del Primus.\n\nMostra riverenza quando sarai all\'interno degli archivi. Sono un luogo sacro che pochi possono vedere.\n\nNeanche le profezie avevano mai predetto che addirittura un mortale vivente avrebbe posato gli occhi sui segreti qui dentro.', '', '', '', '', '', 'Porta il Sigillo del Primus a Bolvar Domadraghi presso Korthia.', 39653),
(63722, 'itIT', 'I custodi di Korthia', 'Salva 3 Custodi dei Registri attorno agli Archivi dei Segreti.', 'Abbiamo resistito a malapena contro le forze del Carceriere. Ora che sei qui, possiamo finalmente fare qualche passo avanti.\n\nSo che la tua priorità è accedere agli Archivi, ma anche i nostri Custodi del Sapere che devono essere recuperati.\n\nLoro sono la massima autorità sul contenuto degli Archivi. Non possiamo permettere che il Carceriere apprenda quello che sanno.', '', '', '', '', '', 'Incontra il Secutor Mevix agli Archivi dei Segreti.', 39653),
(63717, 'itIT', 'Difendere gli archivi', 'Aiuta la Protettrice Kah-Rev a sconfiggere i Giurafauce invasori.', 'Per raggiungere gli archivi, dovremo farci strada attraverso i Giurafauce.\n\nLe Congreghe stanno facendo del loro meglio per scacciare queste mostruosità, ma i nostri alleati non resisteranno per sempre. I Giurafauce stanno cercando di raggiungere gli archivi prima di te.\n\nIl tuo aiuto contro le forze del Carceriere ci farebbe comodo, Calcafauce.\n\nChe lo Scopo ci guidi tutti.', '', '', '', '', '', 'Incontra il Secutor Mevix agli Archivi dei Segreti.', 39653),
(63714, 'itIT', 'Verso gli archivi', 'Prendi un Trasportatore Alalacera fino agli Archivi dei Segreti.', 'Grazie alle riparazioni della Forgiaossa, l\'Animum dovrebbe ora fluire negli Archivi. Questo ci darà una possibilità di entrare, ammesso che riusciamo a raggiungerli.\n\nI nostri alleati di Maldraxxus hanno rimediato un trasporto per portarci su e giù per gli Archivi. Suggerisco di fare in fretta.\n\nSe i servitori del Carceriere ottengono il Sigillo del Primus prima di noi, non sarà solo Korthia a soffrirne. Tutte le Terretetre potrebbero essere condannate.\n\nAndiamo, Calcafauce. Le nostre forze ci staranno aspettando.', '', '', '', '', '', 'Parla con la Protettrice Kah-Rev agli Archivi dei Segreti.', 39653),
(63713, 'itIT', 'Basta solo un aggancio', 'Raggiungi l\'isola fluttuante con il rampino, poi ripara il Condotto dell\'Animum.', 'Ho creato dei solidi punti di ancoraggio. Non preoccuparti: se reggono il mio peso, reggeranno anche il tuo!\n\nPossono farci attraversare il crepaccio verso il prossimo Condotto dell\'Animum.\n\nIo vado avanti e ti aspetto. Non possiamo sapere cosa si nasconde laggiù.\n\nPrima sistemiamo quel Condotto dell\'Animum, prima prenderemo il Sigillo del Primus negli archivi.', '', '', '', '', '', '', 39653),
(63712, 'itIT', 'Registri perduti', 'Usa il Segnalatore della Matrice per recuperare $2oa Registri Perduti.', 'Alcuni dei Custodi dei Registri si sono rifugiati su questa montagna quando Korthia è stata trascinata nella Fauce.\n\nNon vedo segni della loro presenza, ma i loro registri potrebbero essere ancora qui.\n\nPrendi questo segnalatore. L\'ho realizzato usando le informazioni dei precedenti Custodi che hai salvato.\n\nTi condurrà verso i documenti intatti presenti su questa montagna.', '', '', '', '', '', '', 39653),
(63711, 'itIT', 'Strumenti d\'ossa', 'Ottieni $1oa Ossa Infuse d\'Animum dalla fauna locale.', 'Quindi il dispositivo che ci serve per aprire questi archivi è incastrato su un\'isola fluttuante, eh?\n\nNon è un problema.\n\nVedo molte creature robuste da queste parti. Come dico sempre, delle ossa non si butta via niente!\n\nPortami un mucchio delle loro ossa. Le userò per creare dei punti di ancoraggio, così potremo lanciarci dall\'altra parte col rampino.', '', '', '', '', '', '', 39653),
(63710, 'itIT', 'Le tracce dell\'Animum', 'Segui le tracce dell\'Animum al prossimo condotto.', 'Quindi il Carceriere cerca il sigillo del Primus. Dobbiamo battere i Giurafauce sul tempo. Per aprire gli Archivi, dobbiamo attivarli con l\'Animum.\n\nHai aiutato la Forgiaossa a riparare il primo condotto. Il flusso di Animum davanti a noi ci porterà al prossimo. \n\nSe riusciamo ad attivarlo, dovrebbe esserci abbastanza Animum a Korthia da permetterci l\'accesso agli Archivi. \n\nVieni, dobbiamo sbrigarci!', '', '', '', '', '', 'Incontra Tal-Galan e la Forgiaossa Heirmir alla fine delle tracce dell\'Animum.', 39653),
(63709, 'itIT', 'Segreti degli archivi', 'Esamina i registri recuperati con Tal-Galan.', 'Che fortuna! Hai salvato i Custodi dei Registri prima che i Giurafauce potessero sottrarre le loro conoscenze sulle reliquie degli Archivi.\n\nMa i loro registri sono frammentati. Incompleti. Prego siano abbastanza per apprendere la verità.\n\nCercherò di condensare la conoscenza che rimane in un messaggio. Se lo Scopo lo vuole, scopriremo cosa brama il Carceriere e a chi apparteneva originariamente quest\'oggetto.\n\nDevo concentrarmi un momento. Fammi sapere quando vuoi iniziare.', '', '', '', '', '', '', 39653),
(63708, 'itIT', 'Fantasmagoria', 'Porta il Fantaplasma Contorto a Ve\'nari al Rifugio di Ve\'nari.', '<Lo strano granulo di energia ultraterrena brilla a ritmo irregolare.>\n\n<Ve\'nari potrebbe trovarlo interessante.>', '', '', '', '', '', '', 39653),
(63706, 'itIT', 'Lascia che l\'Animum scorra', 'Aiuta la Forgiaossa Heirmir a riparare il Condotto dell\'Animum.', 'Tal-Galan mi ha fatto un resoconto della situazione e mi ha spiegato il funzionamento degli archivi. O almeno, me l\'ha spiegato come farebbe uno scienziato.\n\nPer prima cosa, dobbiamo assicurarci che gli archivi ricevano abbastanza energia. Sembra che usino dei condotti sotterranei per trasportare l\'Animum.\n\nL\'Attendente dice che uno di questi condotti è nascosto in una caverna nell\'Antro dello Studioso.\n\nPortami lì e troverò un modo di ripararlo. Pensa giusto a guardarmi le spalle mentre cerco di capire come funzionano questi dispositivi di Korthia.', '', '', '', '', '', '', 39653),
(63705, 'itIT', 'I custodi della conoscenza', 'Salva $1oa Custodi dei Registri nell\'Antro dello Studioso.', 'I nostri Archivi furono costruiti per contenere innumerevoli segreti e manufatti. Anche se riuscissimo a entrare, potremmo non sapere con certezza cosa sta cercando il Carceriere.\n\nAlcuni Attendenti ricevono il titolo di Custode dei Registri. Essi hanno il compito di tenere un registro di tutti gli oggetti conservati negli Archivi, e sono famosi per la loro massima riservatezza.\n\nI Giurafauce hanno fatto prigionieri un gruppo di Custodi dei Registri che stanno torturando in cerca di informazioni.\n\nSalva i Custodi, $n. Possono aiutarci a scoprire cosa sta cercando l\'Esiliato.', '', '', '', '', '', '', 39653),
(63704, 'itIT', 'Vendetta per Korthia', 'Uccidi $1oa Giurafauce all\'Antro dello Studioso.', 'Anche se accedere agli archivi è la nostra priorità, devo chiederti un favore.\n\nQuando Korthia è stata trascinata nella Fauce, la mia gente era terrorizzata. Siamo scappati nella zona che vedi davanti a te, un luogo di pace chiamato Antro dello Studioso.\n\nSubito dopo, i Giurafauce sono discesi su di noi. La maggior parte della mia gente è stata massacrata. Altri sono stati fatti prigionieri.\n\nSe potessi vendicarmi, lo farei. Ma non sono un combattente. Non come te.\n\nFa\' vedere a questi mostri che la loro profanazione di Korthia non sarà tollerata!', '', '', '', '', '', '', 39653),
(63703, 'itIT', 'Archivi dei Segreti', 'Incontra Tal-Galan fuori dall\'Antro dello Studioso.', 'Ci hai aiutati a recuperare una parvenza di ordine, Calcafauce, ma le cose non sembrano andare per il meglio.\n\nLe forze del Carceriere hanno lanciato un assalto contro le rovine dei nostri archivi nelle zone più remote di Korthia. È evidente che l\'Esiliato cerchi qualcosa di valore al loro interno.\n\nLe difese degli archivi si attivano quando la struttura è minacciata, quindi entrare non sarà facile. Tuttavia, dobbiamo recuperare qualsiasi cosa il Carceriere stia cercando prima dei suoi Giurafauce.\n\nHo arruolato l\'aiuto di un Necrosignore che può aiutarci ad aprire gli archivi.', '', '', '', '', '', 'Parla con Tal-Galan fuori dall\'Antro dello Studioso.', 39653),
(63683, 'itIT', 'Sigillo dell\'Inverno', 'Porta la Lacrima delle Sorelle a Ysera nel Cuore della Foresta.', 'Mia sorella... Dopo tutto questo tempo... Non mi ha abbandonato...\n\n<Sul volto della Regina dell\'Inverno appare un leggerissimo sorriso che svanisce in un istante. Si rivolge a te con il peso degli eoni.>\n\nAscoltami, $n. Prendi la lacrima di mia sorella e vieni al Cuore della Foresta.', '', '', '', '', '', '', 39653),
(63682, 'itIT', 'Il potere di Elune', 'Aiuta con il rituale.', 'Abbiamo fatto tutto il possibile con il tempo che avevamo.\n\nOra dobbiamo dare il nostro potere a Thiernax e agli altri, e sperare che Tyrande sopravviva.', '', '', '', '', '', '', 39653),
(63681, 'itIT', 'Ritorno al Cuore', 'Ritorna da Ysera davanti al Cuore della Foresta presso Selvarden.', 'Dovremmo tornare subito a Selvarden!\n\nTu va\' avanti e trova Ysera. Io scorterò la Madrepietra e mi assicurerò che Huln torni indietro.', '', '', '', '', '', 'Ritorna da Ysera davanti al Cuore della Foresta presso Selvarden.', 39653),
(63680, 'itIT', 'Vite al limite', 'Rintraccia Huln Alto Monte.', 'Sembra che Huln sia stato portato altrove, e dalla stessa Madrepietra!\n\nDovremmo cercare tracce del suo passaggio in zona. Con un po\' di fortuna ci condurranno da Huln!', '', '', '', '', '', '', 39653),
(63679, 'itIT', 'Gita magica del mistero!', 'Trova Dama Baccaluna a Revendreth.', '<La voce di Dama Baccaluna esce dalla pergamena.>\n\n$n! Sembra che Huln si sia messo nei guai. E... be\', è complicato. Ci farebbe davvero comodo il tuo aiuto a Revendreth! Raggiungimi subito alla Fortezza del Dominio.\n\nA presto!', '', '', '', '', '', 'Trova Dama Baccaluna a Revendreth.', 39653),
(63678, 'itIT', 'Akarek vendicato', 'Incontra il Margravio Sin\'dane a Exoramas nella Casata dei Rituali.', 'L\'ultimo dei traditori coinvolti nell\'assassinio del Margravio Akarek è morto.\n\nNon ci restituirà il nostro Margravio, ma mi va bene lo stesso.\n\nLa mia Baronessa voleva che informassimo il Margravio Sin\'dane che il lavoro è stato eseguito prima di partire per Selvarden.', '', '', '', '', '', 'Incontra il Margravio Sin\'dane a Exoramas nella Casata dei Rituali.', 39653),
(63677, 'itIT', 'Puoi solo morire', 'Uccidi Fa\'zinge a Exoramas.', 'L\'ultimo nome della mia lista è un Lich di nome Fal\'zinge.\n\nSin\'dane lo ha tenuto d\'occhio per scoprire qual è il prossimo piano di Kel\'Thuzad. Desidera che l\'esecuzione di Fal\'zinge sia brutale.\n\nLo troveremo a Exoramas nella Casata dei Rituali.', '', 'Uccidi Fal\'zinge.', 'Fal\'zinge', '', '', '', 39653),
(63676, 'itIT', 'Non puoi nasconderti', 'Recupera i Pegni del Favore di Kel\'Thuzad e uccidi Drava\'ora.', 'C\'è chi ha tenuto nascosta la sua affiliazione con Kel\'Thuzad, anche dopo che ha fatto la sua mossa. Anche loro sono coinvolti nella caduta del mio Margravio e devono morire.\n\nHo un nome, Drava\'ora, ma ce ne sono altri. Sin\'dane ha rivelato che questi traditori portano con sé pegni di favore. Non sa chi li ha, per cui inizieremo a uccidere finché non li troveremo.\n\nPer i restanti sarà d\'esempio.', '', '', '', '', '', '', 39653),
(63675, 'itIT', 'Non puoi scappare', 'Raccogli indizi e poi uccidi Zelmolt.', 'Zelmolt è stato un elemento chiave nella caduta del mio Margravio.\n\nSin\'dane crede che stia cercando di radunare forze leali a Kel\'Thuzad, per aiutarlo a mettere in atto il suo prossimo piano.\n\nDovremmo cercare indizi sulla sua posizione e ucciderlo.', '', '', '', '', '', '', 39653),
(63674, 'itIT', 'Con permesso', 'Incontra Dama Vashj al Seggio del Primus e chiedi l\'aiuto di Khaliiq.', 'Ho un compito affidatomi dalla mia Baronessa, Dama Vashj. Con il tuo aiuto, la mia vendetta sarebbe rapida. Ma deve approvare che tu mi dia una mano, nonché il mio rilascio perché possa assisterti nei tuoi compiti.\n\nRaggiungi il Seggio del Primus. Parleremo con lei.', '', '', '', '', '', '', 39653),
(63673, 'itIT', 'A caccia tra le Casate', 'Trova Huln Alto Monte a Maldraxxus.', 'Ho buone notizie, $n. Ora che le Congreghe lavorano più unite, la caccia di Huln ha avuto ben più successo. Ha delle buone piste su altri due Guerrieri della Notte, qui nelle Terretetre.\n\nEgli desidera che tu lo raggiunga a Maldraxxus per il primo. Ti attende al Sepolcro della Conoscenza.\n\nPresto, $n. Il potere di Elune sta lacerando l\'essenza di Tyrande. Non so quanto ancora potrà resistere.', '', '', '', '', '', '', 39653),
(63672, 'itIT', 'Un grido dal cuore', 'Incontra Ysera nel Cuore della Foresta.', '<La voce di Ysera echeggia dalla pergamena mentre ne leggi le parole.>\n\n$n,\n\nC\'è una questione di grande importanza che richiede il tuo aiuto. Incontriamoci al Cuore della Foresta non appena possibile.', '', '', '', '', '', '', 39653),
(63669, 'itIT', 'Il pranzo di Kevin', 'Consuma $1oa nemici caduti per far crescere Kevin completamente.', 'La mia famiglia di poltiglie è sempre affamata di Animum. Fortunatamente i corpi degli sconfitti ne sono una buona fonte!\n\nPiù le poltiglie ne consumano, più crescono di dimensioni. Così ciò che rimane dei caduti diventerà parte della nostra splendida famiglia felice.\n\nPrendi Kevin e lasciagli consumare i nemici caduti finché non sarà pieno, poi scatenalo contro i nostri nemici!', '', '', '', '', '', 'Torna dalla Baronessa Draka.', 39653),
(63665, 'itIT', 'Varco per Oribos', 'Attiva la Pietra di Transito e viaggia verso Oribos.', 'Le profezie dicevano che un giorno questa Pietra di Transito dormiente sarebbe stata necessaria per un Calcafauce. Che si sarebbe rivelata un elemento cruciale per il destino delle Terretetre.\n\nSembra che quel giorno sia giunto.\n\nAttingi all\'Animum dentro di te per attivare questa Pietra di Transito. Poi sarà utilizzabile da tutti coloro che supportano la tua causa.\n\nSe, come dici, Tal-Inara ha creato un\'ancora a Oribos, allora quell\'ancora ti riporterà da noi.\n\nVai, $n. Informa i tuoi alleati che la Fauce attende... e che Korthia ha bisogno del loro aiuto.', '', '', '', '', '', 'Parla con Bolvar Domadraghi all\'Anello del Trasferimento.', 39653),
(63664, 'itIT', 'Arriva al punto', 'Difendi la posizione all\'interno del Forte della Perdizione.', 'La nostra posizione vicino al ponte per l\'Altare del Dominio è sotto attacco! Non possiamo permetterci di perdere la balista che abbiamo piazzato lassù.\n\nCalcafauce, ho bisogno che tu difenda quella posizione, finché le nostre truppe non possono avanzare!', '', '', '', '', '', 'Torna dalla Baronessa Draka.', 39653),
(63663, 'itIT', 'Korthia, la Città dei Segreti', 'Fai controllare la zona a Ve\'nari e ispeziona tutto ciò che trovate.', 'Siamo sulla soglia del raggiungimento dei nostri desideri, Calcafauce.\n\nLa tua preziosa Pietra di Transito non dev\'essere lontana. Naturalmente, le mie necessità sono molto più modeste. Un po\' di informazioni utili qua, una reliquia inestimabile là...\n\nPerlustrerò l\'area per vedere se c\'è qualcosa di utile, o pericoloso, nelle vicinanze. Poi potremo procedere.', '', '', '', '', '', 'Parla con Tal-Galan vicino alla Pietra di Transito Inerte.', 39653),
(63662, 'itIT', 'Misteri della Fauce', 'Viaggia con Ve\'nari al sito della nuova massa di terra nella Fauce.', 'La Fauce sta cambiando, mortale. E il cambiamento porta sempre nuove opportunità.\n\nIl Carceriere ha trascinato un regno nascosto dalle profondità delle Terretetre nella Fauce. È un luogo di interesse per me, ma non voglio avvicinarmi da sola.\n\nVedi, i Giurafauce hanno invaso la zona. Dev\'esserci qualcosa di valore per loro.\n\nHo un rifugio sicuro nelle vicinanze. Accompagnami lì e potrei essere in grado di aiutarti a trovare la Pietra di Transito che stai cercando. Abbiamo un accordo?', '', '', '', '', '', 'Parla con Ve\'nari fuori dalla nuova zona.', 39653),
(63661, 'itIT', 'Collegare la Fauce', 'Chiedi informazioni sulla posizione della seconda Pietra di Transito a Ve\'nari.', 'Lo Scriba del Destino è sicuro che sia emersa una seconda Pietra di Transito nella Fauce. Sta a te trovarla. \n\nCreerò un\'ancora qui a Oribos collegandola al tuo Animum. Quando ti sintonizzerai con la Pietra di Transito, quest\'ancora si legherà a essa.\n\nSe avrai successo, le Congreghe potranno inviare le loro forze nella Fauce e richiamarle in sicurezza.\n\nUsa tutte le risorse a tua disposizione nella Fauce per trovare questa Pietra di Transito.\n\nBuona fortuna, mortale. Che lo Scopo ci guidi tutti.', '', '', '', '', '', 'Parla con Ve\'nari al Rifugio di Ve\'nari.', 39653),
(63660, 'itIT', 'Aprire la Fauce', 'Permetti a Tal-Inara di esaminare il tuo Animum.', 'Il Carceriere ha ottenuto un altro sigillo e le sue forze ora attaccano Oribos.\n\nBolvar Domadraghi e Draka di Maldraxxus suggeriscono di portare la battaglia direttamente al Carceriere.\n\nPer farlo, abbiamo bisogno di un modo sicuro per andare e tornare dalla Fauce.\n\nÈ sempre stato considerato impossibile prima del tuo arrivo, ma ora credo che abbiamo una possibilità.\n\nDevo esaminare il tuo Animum per vedere se questo è davvero ciò che vuole lo Scopo.', '', '', '', '', '', 'Parla con Tal-Inara all\'Anello del Trasferimento.', 39653),
(63659, 'itIT', 'Signori del Terrore!', 'Parla col Primus a Korthia.', 'Questo è il quinto Signore del Terrore che ho scovato tra le nostre forze questa settimana. Se non vengono tenuti a bada possono causare danni tremendi al nostro avamposto.\n\nIn vita ho imparato a identificare queste creature grazie a un Cacciatore di Demoni. Per me è più facile localizzarli, ma non posso essere ovunque contemporaneamente.\n\nDobbiamo fare rapporto di queste scoperte al Primus.', '', '', '', '', '', 'Parla col Primus a Korthia.', 39653),
(63656, 'itIT', 'Il significato dell\'ira', 'Fai rapporto al Primus.', 'Radunerò le mie forze e ne invierò immediatamente una parte a Korthia. Mi assicurerò anche che vengano forniti loro gli strumenti evocati dalla Baronessa Vashj e Kael\'thas in modo da poterci difendere ulteriormente dalle incursioni dei Nathrezim.\n\nAltri compiti richiedono la mia attenzione prima di poter discendere su Korthia. Devo rendere la Fortezza del Dominio a prova di infiltratore.\n\nImmagino che il Primus vorrà un aggiornamento. Puoi dirgli che hai avuto successo.', '', '', '', '', '', 'Fai rapporto al Primus.', 39653),
(63655, 'itIT', 'Il Medaglione dell\'Ira', 'Porta il Medaglione dell\'Ira alle pedane di Oblio del Peccato.', 'Calcafauce. Marcerò con i miei Litogeni nelle profondità della Fauce e strapperò la testa a tutti i Nathrezim che troverò.\n\nTuttavia, Revendreth è una zona ancora troppo strategica in questa guerra per perderla per eccessiva presunzione.\n\nPer questo motivo, in quanto Mietitrice dell\'Ira, seconda di questo titolo, ti offro il mio medaglione per conservarlo e utilizzarlo mentre conduco questa guerra.\n\nUsalo per potenziare i Mietitori in modo che impediscano a Denathrius di tornare e riprendere il controllo con uno schiocco di dita.', '', '', '', '', '', 'Porta il Medaglione dell\'Ira alle pedane di Oblio del Peccato.', 39653),
(63654, 'itIT', 'I Nathrezim', 'Recupera il Medaglione dell\'Ira dai Nathrezim.', 'Il Medaglione dell\'Ira è più che un potente artefatto. Nelle mani di un Nathrezim potrebbe essere usato per plasmare questo reame per i loro oscuri scopi. Come se non bastasse, finché è in loro possesso, non potremo forgiare un nuovo sigillo.\n\nHanno già distrutto il Distretto delle Braci con i loro folli piani. Non lascerò che usino il mio medaglione per i loro fini.\n\nVieni, riprendiamocelo.', '', '', '', '', '', 'Parla con il Principe Renathal a Fortechiaro.', 39653),
(63653, 'itIT', 'Il Potere di una Corona', 'Rintraccia il Medaglione dell\'Ira.', 'Siamo pronti.\n\nLa Corte dei Mietitori userà il potere dei medaglioni che abbiamo recuperato per localizzare il Medaglione dell\'Ira. Finché non l\'avranno rimosso dal regno dovremmo essere in grado di divinarne la presenza.\n\nNon è un rituale facile: i Nathrezim sono specializzati nel non farsi individuare. Quando vedrai la via, seguila e sii celere.\n\nE quando li troverai, attendici prima di ingaggiare.', '', '', '', '', '', 'Parla con la Madrepietra a Fortechiaro.', 39653),
(63652, 'itIT', 'Gli ospiti \"indesiderati\"', 'Uccidi $1oa Nathrezim a Oblio del Peccato.', 'Chelra, voglio dire Nal\'ragas, non può aver lavorato da sola. Dobbiamo presumere il peggio, che non tutti i nostri amici e alleati siano chi sembrano essere.\n\nServirà del tempo alla Corte dei Mietitori per organizzare il rituale d\'individuazione. Nel mentre saremo esposti. Ti chiedo di usare le tecniche che hai usato al Cancello del Dominio a Oblio del Peccato per scovare i Nathrezim tra i nostri ranghi.\n\nBuona caccia.', '', '', '', '', '', '', 39653),
(63651, 'itIT', 'Crittogrammi', 'Trascrivi $1oa Crittogrammi Infernali.', 'Se i Nathrezim si sono infiltrati a Oblio del Peccato, staranno sicuramente comunicando, e non solo attraverso gesti o parole. A loro piace usare messaggi scritti magici nascosti da semplici incantesimi, invisibili all\'osservatore medio.\n\nTuttavia, ho sviluppato un incantesimo che dovrebbe permetterti di vedere questi messaggi.\n\nTrova questi crittogrammi e portami il loro contenuto. Posso tradurli se vanno oltre la tua comprensione.', '', '', '', '', '', '', 39653),
(63650, 'itIT', 'Disinfiltrazione', 'Incontra il Principe Renathal a Oblio del Peccato.', 'Mal\'ganis.\n\nÈ passato molto tempo dall\'ultima volta che ho menzionato il suo nome. E ora scopro che dobbiamo dargli la caccia.\n\nSe è in possesso del Medaglione dell\'Ira, non esiste luogo dove possa nascondersi. Possiamo usare gli altri medaglioni che abbiamo recuperato per localizzarlo.\n\nUnisciti a me a Oblio del Peccato e porta il tuo gruppo di caccia per Signori del Terrore. Sospetto che avremo bisogno di loro.', '', '', '', '', '', '', 39653),
(63649, 'itIT', 'Spia contro spia', 'Rintraccia e sconfiggi $1oa Signori del Terrore Infiltrati.', 'Nathrezim. Signori del Terrore. Gli Ospiti Invisibili.\n\nChiamali come vuoi, ma sono una razza che fu creata per diventare il più grande gruppo di spie e infiltratori in tutta la realtà.\n\nLa loro intrusione ha sottovalutato tre cose. Kael\'thas Solealto, la Baronessa Vashj e $n!\n\nHo portato un dispositivo che io e Kael\'thas usavamo per sgominare i Nathrezim quando servivamo Illidan. E io sono la Matrona delle Spie!\n\nAndiamo a caccia di questi intrusi.', '', '', '', '', '', '', 39653),
(63648, 'itIT', 'Nal\'ragas', 'Trova e sconfiggi Nal\'ragas.', 'Il medaglione della Madrepietra non deve restare nelle mani dei Nathrezim. \n\nDa quello che l\'Accusatrice ci ha spiegato della nostra missione, il medaglione è necessario se vogliamo forgiare un nuovo sigillo per i Venthyr. Non ho dubbi che sia quello il motivo dell\'imboscata di Nal\'ragas e i suoi simili.\n\nQuella dei medaglioni non è una magia sottile, ed è facile tenere traccia dei suoi effetti sul reame. Suggerisco di inseguire ed eliminare questa Nal\'ragas prima diventi più forte.', '', 'Un\'abile infiltrata dei Nathrezim.', 'Nal\'ragas', '', '', 'Parla con il Principe Renathal.', 39653),
(63647, 'itIT', 'Gli ospiti invisibili', 'Unisciti alla Madrepietra mentre indaga sull\'emissario.', 'Signori del Terrore.\n\nMa certo, era ovvio che sarebbero tornati proprio adesso. Avevo un mezzo sospetto che fossero tornati durante la siccità.\n\nNon ero del tutto convinta che tu non ne fossi $guno:una;, la prima volta che ti ho $gvisto:vista;. In questi eoni sono diventati più intelligenti da quando sono scappati da Revendreth.\n\nMa non abbastanza... credo.\n\nVieni, Calcafauce. Seguimi e non fare baccano. Tieni l\'arma pronta. L\'emissario che hai portato non è di così buone intenzioni come potresti credere.', '', '', '', '', '', '', 39653),
(63646, 'itIT', 'Convoglio delle Congreghe', 'Raduna gli emissari e raggiungi il Cancello del Dominio.', 'Servirebbero tutti e sette i medaglioni per forgiare un nuovo sigillo per i Venthyr. \n\nIl Primus aveva ragione. Chi ci serve adesso è la Madrepietra. I suoi rancori contro gli invisibili potrebbero riempire una piazza, e possiede anche l\'ultimo medaglione che ci serve. Credo che sia io che te aspettiamo da troppo tempo di convincerla a unirsi alla nostra causa.\n\nMi occuperò io dei preparativi. Stavolta lo faremo in modo opportuno, con doni e diplomazia.\n\nDovresti avvertire Chelra, organizzerà una scorta.', '', '', '', '', '', 'Consegna il messaggio del Primus alla Madrepietra.', 39653),
(63645, 'itIT', 'Il prigioniero di Fortechiaro', 'Scopri il destino di Sire Denathrius dal Principe Renathal.', 'Oh, non hai ancora sentito l\'ultima.\n\nLo abbiamo preso. Sire Denathrius, Maestro di Revendreth, imprigionato nella sua stessa lama.\n\nSiamo riusciti a sopraffarlo durante una delle nostre recenti incursioni al Castello di Nathria.\n\nC\'è voluto un esercito di valore e preparazione senza eguali. C\'è voluta abilità. C\'è voluto un miracolo.\n\nE così il redentore sarà redento. Vuoi saperne di più?', '', '', '', '', '', '', 39653),
(63644, 'itIT', 'Brutti tempi', 'Parla con il Principe Renathal presso Fortechiaro a Revendreth.', 'Non dobbiamo sottovalutare la minaccia dei Nathrezim. Sono astuti, al pari dei migliori veterani della Casata degli Occhi, e non conosciamo bene i loro piani.\n\nTra i Venthyr c\'è qualcuno la cui furia ha spazzato via i Nathrezim dalle Terretetre per diverse migliaia di anni.\n\nTi chiedo di recarti a Oblio del Peccato, cerca il Principe Renathal e consegnagli questa missiva. Invierò una delle mie spie, la Baronessa Vashj, per incontrarti lì. Sfrutta la sua esperienza con i Nathrezim.', '', '', '', '', '', 'Parla con il Principe Renathal presso Fortechiaro.', 39653),
(63639, 'itIT', 'Rapporto a Oribos', 'Torna da Tal-Inara a Oribos.', 'Selvarden ha resistito alle forze inarrestabili della Fauce.\n\nMa non è stato abbastanza.\n\nTorna dai nostri alleati a Oribos. Dobbiamo rispondere a questa sconfitta, dobbiamo agire.', '', '', '', '', '', 'Torna da Tal-Inara a Oribos.', 39653),
(63638, 'itIT', 'Guardarsi sempre le spalle', 'Controlla come sta la Regina dell\'Inverno.', 'Sylvanas e i suoi Giurafauce sono sistemati... per ora.\n\nDobbiamo sbrigarci e assicurarci che la Regina e il suo sigillo siano al sicuro!\n\nLa Regina dell\'Inverno era appena fuori dal Cuore della Foresta, stava proteggendo i Semebrado rubati dalla Fauce.', '', '', '', '', '', '', 39653),
(63625, 'itIT', 'Eccoti un\'ascia, mettiti al lavoro!', 'Elimina $1oa Forze dei Giurafauce e il Comandante Mallamort.', 'Le nostre truppe stanno incontrando resistenza! Calcafauce, prendi un\'arma e combatti!\n\nElimina le forze dei Giurafauce e i loro comandanti che proteggono questi cancelli.', '', '', 'Comandante Mallamort', '', '', 'Riferisci la notizia del tuo successo alla Baronessa Draka.', 39653),
(63624, 'itIT', 'Le strade da percorrere', 'Assisti alla cerimonia di promozione di Draka.', 'Le armate di Maldraxxus sono forti e si riprenderanno dalla ribellione di Vyraz.\n\nLa prima cosa che dobbiamo fare è ricostruire. Calcafauce, assisterai a una nuova era di Maldraxxus!', '', '', '', '', '', '', 39653),
(63623, 'itIT', 'Riempire un trono vuoto', 'Torna al Seggio del Primus.', 'Calcafauce.\n\nDurante la mia lunga assenza, hai fatto molto per riportare ordine e forza alla Congrega dei Necrosignori. Come segno di riconoscenza, ti invito ad assistere a una cerimonia.\n\nTorna con me al mio centro del potere a Maldraxxus. È tempo di ricompensare la persona che è stata più fedele alla nostra causa.', '', '', '', '', '', 'Parla col Primus al Seggio del Primus.', 39653),
(63622, 'itIT', 'Vittoria nel nostro nome', 'Ritorna dal Primus a Korthia.', 'Ora che Helya e Vyraz sono stati sistemati, abbiamo ottenuto una vittoria schiacciante sui Giurafauce. È anche una dimostrazione di cosa riescano a fare le forze combinate delle Terretetre.\n\nDovremmo tornare a Korthia prima che succeda qualcos\'altro.', '', '', '', '', '', '', 39653),
(63621, 'itIT', 'Tirare la catena', 'Elimina il Custode delle Catene.', 'Lo chiamano il Custode delle Catene. Non sottovalutare il suo potere. Ha vincolato le anime nelle vicinanze in attesa di attaccare la nostra posizione.\n\nDevi eliminare questa minaccia, Calcafauce, prima che agisca contro le nostre forze.', '', 'Vincolate alle sue catene, la volontà di ogni anima finisce per spezzarsi.', 'Custode delle Catene', '', '', '', 39653),
(63620, 'itIT', 'La fine di un traditore', 'Uccidi Vyraz.', 'Da quando ci ha traditi, Vyraz è stato una costante spina nel fianco di Maldraxxus. Come Baronessa della Casata dei Prescelti, è mio dovere assicurarmi che questa minaccia venga eliminata... e che l\'omicidio del Margravio Krexus venga vendicato.\n\nCome disse il Primus, dobbiamo staccare la testa a questo serpente.\n\nIl momento di colpire è ora!', '', 'Il tempo del Barone Vyraz, traditore di Maldraxxus, è giunto al termine.', 'Barone Vyraz', '', '', '', 39653),
(63619, 'itIT', 'Indegni e dimenticati', 'Libera $1oa Prigionieri Indegni.', 'Aspetta... io ti conosco! Calcafauce!\n\nI miei fratelli e sorelle sono stati corrotti... deviati. Alcuni hanno accettato volontariamente il potere di Helya, ma altri hanno opposto resistenza. Ora siamo tutti costretti a sottometterci al suo volere.\n\nQuando sono iniziati i combattimenti, non ho potuto che fuggire, ma la maggior parte degli Indegni rimasti stanno diventando vittime di terribili rituali.\n\nTi supplico di liberarli. Poi torneremo al Bastione e ci affideremo al giudizio dell\'Arconte.', '', '', '', '', '', '', 39653),
(63618, 'itIT', 'Ciò che Maldraxxus fa meglio', 'Uccidi $1oa Giurafauce nella parte alta di Desmotaeron.', 'Ogni nemico che sconfiggeremo qui è un nemico di cui la nostra armata non dovrà preoccuparsi. Ci assicureremo che non dimenticheranno presto il vero scopo di Maldraxxus. Mostra loro cosa succede a chi riteniamo una minaccia per le Terretetre.\n\nUccidi tutti i Giurafauce che trovi.', '', '', '', '', '', '', 39653),
(63617, 'itIT', 'Piegare il ferro', 'Uccidi il Custode del Ferro Salryx.', 'Nel caos generale hanno lasciato le porte della fortezza superiore aperte. Se ci intrufoliamo, potrebbero non accorgersi nemmeno di noi finché non sarà troppo tardi.\n\nTra noi e il Forte Helgarde si trova uno dei luogotenenti di Helya. Metti fine alla sua esistenza.', '', 'Questo soggiogatore dei Giurafauce guida le forze a Desmotaeron contro le forze combinate degli aldilà.', 'Custode del Ferro Salryx', '', '', '', 39653),
(63616, 'itIT', 'Un lavoro fatto bene', 'Segnala a Zerekriss e inizia l\'assalto.', 'Dovremmo poter iniziare l\'assalto.\n\nFai segnale a Zerekriss. Mostriamo loro la potenza di una necropoli di Maldraxxus e gli eserciti uniti delle Terretetre!', '', '', '', '', '', '', 39653),
(63615, 'itIT', 'Tarpare le ali', 'Usa le Catene dei Giurafauce per uccidere $1oa Frangianime Helsvorn.', 'I cieli sono oscurati dai seguaci Kyrian di Helya. Se non ne ridurremo le fila, Zerekriss e i nostri alleati aerei potrebbero avere difficoltà ad avanzare.\n\nHo notato che i Giurafauce spesso usano catene magiche. Potremmo usare le loro attrezzature contro di loro e farli cadere dal cielo.', '', '', '', '', '', '', 39653),
(63614, 'itIT', 'Arma alla mano', 'Trova Dra\'gora, l\'ascia di Thrall.', 'Un momento, $n.\n\nHo lanciato la mia ascia Dra\'gora contro Helya durante il nostro primo incontro nella Fauce, e non l\'ho più vista da allora. Se questo è il posto dal quale davvero comanda le sue forze, allora forse si trova qui.\n\nHo creato quell\'arma a Nagrand e mi ricorda molti giorni felici passati con la mia famiglia. Voglio sentire di nuovo il suo peso nelle mie mani.', '', '', '', '', '', '', 39653),
(63613, 'itIT', 'I portali dei dannati', 'Evoca $1oa Portali della Morte.', 'Dobbiamo prepararci all\'assalto prima di fare il segnale alla Zerekriss. Una volta in posizione, i nostri alleati useranno i Portali della Morte per assaltare la zona.\n\nDovremo evocare i Portali della Morte da questa parte. Trova dei luoghi strategici adatti.', '', '', '', '', '', '', 39653),
(63612, 'itIT', 'La catena di comando', 'Incontra Draka a Desmotaeron.', 'Se è imperativo mantenere una posizione così vicina alle terre del Carceriere, dobbiamo conquistarci qualche sicurezza in più.\n\nVyraz e Helya si sono ritirati all\'interno delle mura di Desmotaeron. Si sono impigriti pensando di stare al sicuro, il che ci fornirà un\'opportunità.\n\nLi coglieremo di sorpresa. Colpiamo presto e senza pietà, e forse riusciremo a tagliare la testa a quei serpenti.', '', '', '', '', '', 'Parla con Draka a Desmotaeron.', 39653),
(63593, 'itIT', 'Il nuovo sigillo dei Kyrian', 'Fai rapporto al Primus a Korthia.', 'Con un futuro di fratellanza e devozione assicurato per il Bastione, nasce un nuovo sigillo per rappresentare il nostro cammino.\n\nFai rapporto al Primus su tutto quello che hai fatto. Quando sarà pronto, consegneremo il sigillo direttamente a lui. \n\nSperiamo possa usarlo per fermare il piano del Carceriere e salvare le Terretetre.', '', '', '', '', '', 'Fai rapporto al Primus a Korthia.', 39653),
(63592, 'itIT', 'La nuova Via', 'Parla con Kalisthene per partecipare alla cerimonia presso il Seggio dell\'Arconte.', 'Oggi, consacriamo un nuovo Eletto. E per la prima volta dall\'alba del nostro regno, riconsacriamo un tempio per rappresentare la nostra devozione gli uni agli altri.\n\nUn nuovo Eletto, un nuovo sigillo e una nuova via per tutti i Kyrian.\n\nQuesta cerimonia sarà davvero gloriosa!', '', '', '', '', '', 'Parla con Adrestes, Eletto della Devozione.', 39653),
(63591, 'itIT', 'Il Gran Ricevimento', 'Parla con Kalisthene per partecipare al raduno, poi socializza con i tuoi Vincoli dell\'Anima e gli altri Kyrian.', '$n, hai aiutato i Kyrian nei loro tempi più bui. La tua devozione per la nostra causa ha aiutato a creare un nuovo inizio per tutti noi.\n\nSarebbe un onore se ti unissi a noi per un raduno prima della cerimonia. Molti membri della nostra Congrega desiderano esprimere la loro gratitudine per tutto ciò che hai fatto.\n\nÈ un giorno di grande gioia. Sono così felice che tu sia qui per vederlo!', '', '', '', '', '', 'Parla con Kalisthene alla Fonte della Fedeltà.', 39653),
(63590, 'itIT', 'Il suono del vespro', 'Proteggi il Polemarco Adrestes mentre consacra nuovamente il Tempio della Lealtà.', 'La lealtà non sarà più un fondamento richiesto per la Via, ma una virtù che dev\'essere ottenuta. Una scelta.\n\nDobbiamo mostrare devozione a coloro in difficoltà, che siano anime di recente arrivo o compagni che hanno bisogno del nostro aiuto.\n\nCi vorrà tutto l\'Animum a disposizione per consacrare nuovamente questo tempio. Così facendo, inizierà una nuova era dei Kyrian.\n\nTemo che i Giurafauce tenteranno di ostacolare i nostri piani. Proteggimi durante il rituale, $n. Dobbiamo farcela.', '', '', '', '', '', '', 39653),
(63589, 'itIT', 'Dirigere la dedizione', 'Reindirizza l\'Animum dalla Cittadella della Lealtà al tempio.', 'I cinque templi del Bastione sono rimasti immutati sin dalla sua stessa creazione. L\'idea che uno di essi venga nuovamente consacrato non era mai stata vagliata, e servirà senza dubbio un\'ingente quantità di Animum.\n\nSotto questo tempio ci sono scorte d\'Animum che avevamo razionato per la siccità. Ora che l\'Animum sta tornando, possiamo usare queste riserve per i nostri scopi.\n\nDovrai usare i canalizzatori e i collettori nel terreno per reindirizzare l\'Animum alla cima. Così facendo dovresti darmi il potere di cui ho bisogno.', '', '', '', '', '', '', 39653),
(63588, 'itIT', 'Ricostruire la fede', 'Convinci $1oa Indegni a tornare sulla Via.', 'Gli Indegni sono perduti, $n.\n\nSono come fantasmi, infestano il Tempio della Lealtà. Non sanno dove altro andare. Senza capi, senza scopo... Abbandonati.\n\nDobbiamo mostrare loro il cammino.\n\nLascia che ti accompagni nel tempio. Permettimi di parlarci, così che mi rivolga ai loro sentimenti. Forse possiamo convincerli a dare una possibilità alla nuova Via di Adrestes.', '', '', '', '', '', '', 39653),
(63587, 'itIT', 'Animum recuperabile', 'Raccogli $1oa Nuclei di Centurione Contaminato dai Centurioni Indegni.', 'Mikanikos mi ha spiegato molto sui Centurioni Indegni, $n.\n\nNon posso dire che ho capito tutto, ma sembra che non abbia ancora trovato un modo affidabile per riportarli al loro standard operativo previsto.\n\nIl loro Animum, però, può ancora essere utile!\n\nAdrestes si è concentrato sulla consacrazione del tempio, ma non sulla sua incolumità. Temo che il processo prosciugherà gran parte del suo Animum.\n\nSe riuscissi a recuperare i nuclei dai Centurioni Indegni, potremmo usarli come depositi d\'Animum per Adrestes.', '', '', '', '', '', '', 39653),
(63586, 'itIT', 'Compassione nella devozione', 'Incontra Adrestes al Riposo del Factotum.', 'Il nostro primo compito è di consacrare nuovamente il Tempio della Lealtà.\n\nPelagos si è offerto di restare qui e aiutare a preparare la cerimonia. Ho richiesto che Nikolon ci faccia incontrare i suoi compagni al Riposo del Factotum, per aiutarci a convincere alcuni degli Indegni a seguire la nostra nuova via.\n\nIncontriamoci lì appena ti sarà possibile.', '', '', '', '', '', 'Incontra Adrestes al Riposo del Factotum.', 39653),
(63585, 'itIT', 'Lealtà cieca', 'Raggiungi il Polemarco Adrestes al Forte Elisio per l\'udienza con l\'Arconte.', 'La via dei Kyrian ora mi è chiara.\n\nPrima parleremo con Nikolon. Ti chiedo di rimanere ad ascoltare.\n\nDopodiché dovremo tornare al Forte Elisio.\n\nChiederò un\'udienza con l\'Arconte e ho bisogno che tu sia al mio fianco.', '', '', '', '', '', '', 39653),
(63584, 'itIT', 'Un ritorno in trionfo', 'Incontra Kalisthene al Forte Elisio.\n\nLa Corriera Kyrian può portartici in volo.', 'Questo tempio rappresenta una nuova alba per il Bastione, $n.\n\nIl Tempio della Devozione si ergerà fiero come dimora di fratellanza. Lavoreremo con gli Indegni, nonché con Aspiranti e Kyrian di tutti i gradi e provenienza, per forgiare un futuro di cui essere fieri.\n\nTorniamo al Forte Elisio. Ti invito a unirti a noi per un momento epocale: l\'ascensione di un nuovo Eletto e la creazione di un nuovo sigillo.', '', '', '', '', '', 'Incontra Kalisthene al Forte Elisio.', 39653),
(63583, 'itIT', 'Ho intenzione di vivere in eterno', 'Aiuta Uther a rivivere il suo ultimo ricordo.', 'Ti prego, $n. Non ho ancora finito.\n\nC\'è un altro ricordo che devo ancora vedere. Un altro che va affrontato.\n\nNon... Non sarà facile. Avrò bisogno del supporto di tutti voi.\n\nMa deve essere fatto.', '', '', '', '', '', '', 39653),
(63582, 'itIT', 'Era il mio studente', 'Aiuta Uther a rivivere il suo secondo ricordo.', 'I ricordi che Uther ha di tale Principe Arthas lo tormentano profondamente. È lui il motivo per cui l\'anima di Uther è frammentata, motivo per il quale Devos è caduta in disgrazia.\n\nIl dolore in questi ricordi è palpabile.\n\nDobbiamo scavare più in profondità. Uther deve affrontare la fonte di questa corruzione.\n\nDevo nuovamente chiederti di entrare nel suo passato per proteggere il suo futuro.', '', '', '', '', '', '', 39653),
(63581, 'itIT', 'Entrare nella Luce', 'Usa lo Specchio dell\'Anima per aiutare Uther a rivivere il suo passato.', 'È come temevo.\n\nQuesto frammento dell\'anima di Uther è stato corrotto dalla lama dell\'anima che l\'ha ucciso. I suoi ricordi sono frantumati e distorti.\n\nAffinché Uther superi il suo dolore e la sua sofferenza, deve rivivere il suo passato.\n\nMa non deve farlo da solo.\n\nSfruttando il mio Specchio dell\'Anima, possiamo aiutare Uther ad attraversare questi ricordi. Poi sarà lui a fare in modo di arrivare a compromessi con le emozioni che contengono. Dobbiamo aiutarlo a superare le deformazioni e a comprendere le verità che nascondono.', '', '', '', '', '', '', 39653),
(63580, 'itIT', 'Ricordi feriti', 'Aiuta Uther a creare una connessione al Residuo della Giustizia.', 'L\'arrivo dell\'anima ferita di Uther è stato l\'innesco di molti eventi che ci hanno condotto ai nostri problemi attuali.\n\nLa fiducia spezzata di Devos. Il suo coinvolgimento con Helya. La nascita degli Indegni.\n\nIl Bastione deve cambiare, ma abbiamo difficoltà a trovare una soluzione.\n\nForse questo frammento d\'anima fornirà informazioni preziose.', '', '', '', '', '', '', 39653),
(63579, 'itIT', 'L\'anima di un paladino', 'Rivendica il Residuo della Giustizia dall\'Ossario degli Esiliati a Torgast.', 'Bolvar Domadraghi ha avuto delle visioni su un luogo nascosto nelle profondità di Torgast, dove il Carceriere tiene le anime che ritiene preziose.\n\nUther è stato colpito da una lama dell\'anima. Quando tale arma è brandita con rabbia, può mandare un\'anima in frantumi.\n\nSe il Carceriere possiede una parte dell\'anima di Uther, allora non potrà mai guarire completamente finché non viene recuperato il pezzo mancante.\n\nPorta questa scheggia sintonizzata a Torgast, $p. Dovrebbe condurti alla posizione di quel luogo.\n\nTrova il frammento perduto dell\'anima di Uther, così che possa tornare integro.', '', '', '', '', '', 'Incontra Thenios nel Tempio della Saggezza al Bastione.', 39653),
(63578, 'itIT', 'La Battaglia di Selvarden', 'Proteggi il Sigillo della Regina dell\'Inverno nella Battaglia di Selvarden.', 'Con il tradimento di Sire Denathrius e l\'assenza del Primus di Maldraxxus, dobbiamo presumere che la Regina dell\'Inverno sarà il prossimo bersaglio del Carceriere.\n\nNon permetteremo a nessuno di prendere il suo sigillo!\n\nSelvarden ha sofferto molto, ma è un regno con un grande e misterioso potere. Le cose non sempre sono ciò che sembrano.\n\nSfrutteremo questo a nostro vantaggio, contro chiunque attacchi la Regina!', '', '', '', '', '', '', 39653),
(63576, 'itIT', 'Prima mossa', 'Parla con il Polemarco Adrestes a Oribos.', 'Mentre le congreghe lavorano per difendere le Terretetre, il Carceriere non è rimasto seduto a guardare all\'interno di Torgast. Sembra che intenda mettere in atto la fase successiva del suo piano.\n\nIl Polemarco Adrestes ci ha portato notizie inquietanti dal Forte Elisio. Ti racconterà quello che ha visto quando sarai lì.\n\nSbrigati. Temo che non ci resti molto tempo.', '', '', '', '', '', '', 39653),
(63545, 'itIT', 'Assemblare un piano', 'Consegna $2oa Parti di Centurione e $1oa Bulloni dell\'Automatron a Mikanikos.', 'Mentre Maldraxxus avanza sul cancello principale, noi possiamo prendere la porta laterale con l\'aiuto dei nostri Centurioni.\n\nI resti di molti Centurioni Corrotti presi dal Carceriere sono sparsi nell\'area. Le loro parti potrebbero essere utilizzate per costruirne di nuovi per aiutare nell\'assalto.\n\nVedi se riesci trovare le parti necessarie per costruire un nuovo Centurione.', '', '', '', '', '', '', 39653),
(63543, 'itIT', 'Assalto dei Necrosignori', 'Completa $1oa Missioni nel Forte della Perdizione e il Volto dell\'Oblio.', 'Le forze del Carceriere sono state colte di sorpresa dal nostro attacco. Invaderemo il Forte della Perdizione e sconfiggeremo i suoi campioni all\'Altare del Dominio!\n\nServe il tuo aiuto, Calcafauce. Aiuta le nostre forze sul campo!', '', '', '', '', '', '', 39653),
(63435, 'itIT', 'Rissa al Tempio', 'Sconfiggi Anthea in uno scontro tra mascotte.', 'I miei genitori sono impegnati a difendere il Santuario delle... Otto... Noci di cocco? Non stavo facendo attenzione. Probabilmente è per questo che mi hanno lasciata qui.\n\nMi avevano detto avrei potuto allenarmi con il grande gatto bianco! Diventerò un ninja!\n\n<Anthea calcia l\'aria diverse volte nella tua direzione.>\n\nYa! Kya! Farai meglio a fare attenzione!\n\n...\n\nMi sto annoiando, vuoi fare uno scontro tra mascotte? Ho portato tutte le mie mascotte preferite con me.', '', '', '', '', '', '', 39653),
(63419, 'itIT', 'Spore a iosa', 'Raccogli $1oa roba strana', 'Chuck parla di nuovo di come la giungla sembri viva e strana.\n\nTi chiede di recuperare le spore che si trovano sui fungariani e sulle bestie che hanno infettato.\n\nChuck è preoccupato che qualsiasi cosa stia accadendo non sia naturale.', '', '', '', '', '', '', 39653),
(63418, 'itIT', 'Esploratori espropriati', 'Salva gli amici di Chuck', 'Chuck spiega che qualcosa di strano sta accadendo nella giungla e che il suo gruppo è stato catturato da fungariani selvaggi.\n\nTi chiede di salvare i suoi amici per scoprire cosa sta succedendo nella giungla.', '', '', '', '', '', '', 39653),
(63043, 'itIT', 'Anime lacerate', 'Distruggi $1oa Trappole Laceratrici d\'Anime nel Tremacolo.', 'Le trappole... non ci avevano mai fatto nulla, prima d\'ora. Troppe anime sono fuggite...\n\nLoro... hanno creato nuove trappole... che lacerano le anime in fuga...\n\n...è troppo tardi per me. Distruggile... così che gli altri possano fuggire!', '', '', '', '', '', '', 39653),
(62917, 'itIT', 'Anime condivise', 'Incontra l\'Accusatrice alla Forgia dei Vincoli.', 'Il potere dei Mietitori scorre nel tuo corpo mortale, ma potresti ottenere un potere ancora maggiore legando la tua anima a un\'altra.\n\nNon ci sono controindicazioni note nel farlo, e offre diversi vantaggi a entrambe le parti coinvolte.\n\nL\'Accusatrice vigilerà il processo. Incontrati con lei alla Forgia dei Vincoli quanto sarai $gpronto:pronta;.', '', '', '', '', '', '', 39653),
(62852, 'itIT', 'Rappresentante della Caccia Selvaggia', 'Parla con Aithlyn nel Cuore della Foresta.', '$gBentrovato:Bentrovata;, mortale!\n\nHai dimostrato il tuo valore a tutta Selvarden. Ti concederemo altre ricompense, per il tuo valore e la tua astuzia in nome nostro.\n\nIncontriamoci al Cuore della Foresta.', '', '', '', '', '', '', 39653),
(62851, 'itIT', 'Rappresentante dell\'Armata Imperitura', 'Parla con Nalcorn Talsen al Teatro del Dolore.', 'I tuoi continui progressi negli obiettivi dell\'Armata Imperitura ti hanno fatto guadagnare il rispetto delle nostre forze.\n\nMi hanno autorizzato a offrirti una parte dei recenti bottini di guerra come segno di gratitudine. Unisciti a me al più presto al Seggio del Primus per ottenerli.', '', '', '', '', '', '', 39653),
(62849, 'itIT', 'Rappresentante della Corte dei Mietitori', 'Parla con la Signora Mihaela a Lidoscuro.', 'Calcafauce. \n\nI tuoi sforzi hanno fornito alla Corte dei Mietitori un vantaggio decisivo nella lotta contro gli zeloti e i sicofanti che si aggrappano ancora alla causa persa di Sire Denathrius.\n\nSe ti unirai a me a Lidoscuro potremo esprimerti la nostra gratitudine in un modo più... materiale. \n\nCon tesori, ovviamente.', '', '', '', '', '', '', 39653),
(62563, 'itIT', 'Di nuovo in azione!', 'Sconfiggi Gorgantus la Sbudellatrice', 'Gorgantus non vuole proprio arrendersi!\n\nL\'abbiamo già sconfitta diverse volte, ma i recuperatori ne prendono il corpo, la riparano e poi la rimandano subito qui!\n\nCrede che questa volta ci sconfiggerà... dimostrale che ha torto.', '', 'Un costrutto che è stato sconfitto e ricostruito numerose volte.', 'Gorgantus la Sbudellatrice', '', '', '', 39653),
(62451, 'itIT', 'Assalto al Vestibolo', '', '', '', '', '', '', '', '', 39653),
(62390, 'itIT', 'Trovare il corpo', 'Raccogli $1oa Pezzi di Abominio a Maldraxxus.', 'Conosco alcuni Carnefici che lavorano esternamente alla Casata dei Costrutti. Se riuscissimo a trovare i reagenti, potrebbero aiutare il nostro sforzo bellico con dei costrutti.\n\nLa Casata dei Costrutti ha un sacco di pezzi di ricambio in eccesso. Trovali e riportali qui.', '', '', '', '', '', '', 39653),
(62294, 'itIT', 'La spazzatura di un Lich...', 'Cerca tra i Mucchi di Macerie nella Casata dei Rituali per trovare degli indizi sul suo passato, e recupera un\'Antica Reliquia Curiosa.', 'Si dice che la spazzatura di una persona sia il tesoro di un\'altra. Quando si tratta di reliquie, è particolarmente vero.\n\nLa Casata dei Rituali è notoriamente riservata, il che significa che ogni conoscenza che riusciremo a ottenere da loro sarà preziosa.\n\nCercando tra le loro macerie, di certo troveremmo ogni sorta di tesori.', '', '', '', '', '', '', 39653),
(62263, 'itIT', 'Nell\'ignoto più ignoto', 'Esplora la zona inesplorata.', 'Ah, giusto in tempo. Ho fatto una scoperta interessante.$b$bSono riuscito a stabilire una connessione, persino più profonda di quanto avessi mai fatto.$b$bCome ho fatto, dici? Lavorando sodo, ecco come! Ma lo sapevi già. Lavori sodo quasi quanto me. Ecco perché sei qui!$b$bTi va un\'avventura ancora più entusiasmante?', '', '', '', '', '', 'Torna da Marasmio nell\'Anello.', 39653),
(62256, 'itIT', 'Recupero risorse', 'Raggiungi Selvarden, trova Tabithia e recupera l\'Uovo Ultraterreno.', 'Ehi, $gmio caro amico:mia cara amica; $n! Ascoltami bene. Sto cercando di negoziare un patto con l\'Alienatore Au\'larrynar e gli serve qualcosina, un lavoretto fatto prima che accetti.\n\nL\'accordo è questo, lui aveva un associato che è sparito con un oggetto raro. Ci ha chiesto di... trovare e recuperare... io e te... la proprietà perduta.\n\nL\'associato è stato visto l\'ultima volta a Selvarden. Lo so, un posto strano, troppo luminoso per me. Ma, io... noi... abbiamo davvero bisogno di questo accordo!\n\nAllora, sei $gpronto:pronta; ad andare?', '', '', '', '', '', 'Consegna l\'Uovo Ultraterreno ad Au\'larrynar.', 39653),
(62239, 'itIT', 'Rimozione roditori', 'Prova la Verga del Tormentatore su $1oa Rattifauce Giganti negli Antri delle Bestie.', '<L\'arma ronza con un\'energia oscura e statica. Qualunque cosa stesse provando questo Giurafauce, sembra che abbia avuto un certo successo sui roditori vicini.>\n\n<Ulteriori indagini potrebbero fornire informazioni aggiuntive. >', '', '', '', '', '', 'Riferisci della tua scoperta a Ve\'nari presso il Rifugio di Ve\'nari.', 39653),
(62225, 'itIT', 'Rovinare il momento', 'Manometti $1oa degli esperimenti del Culto dei Dannati a Mord\'rethar.', '<Le parole dell\'alfiere ombroso sono oscure e premonitrici. Qualunque cosa intenda ottenere \"l\'Esiliato\", non deve riuscirci.>\n\n<Qualcosa di strano ribolle nei calderoni nelle vicinanze. A giudicare dalla cura con cui i cultisti se ne stanno occupando, il contenuto deve essere fondamentale per i loro piani.>\n\n<Ci sono diversi barili, che contengono ciò che sembra essere un nuovo tipo di piaga, lasciati incustoditi. Forse potrebbero essere utili per un sabotaggio.>', '', '', '', '', '', 'Torna dalla Crociata Renn al Bastione della Muraglia di Ferro.', 39653),
(62224, 'itIT', 'Un filo di speranza', 'Raccogli $1oa Seta Infusa d\'Animum.', 'La Corte della Notte è simile a un fiore assetato, che consuma velocemente i propri nutrienti. Se ben rifornita, fiorirà, ma se i nutrienti finiranno, appassirà.\n\nLe nostre radici stanno iniziando a seccarsi, abbiamo bisogno di più Animum!\n\nHo inviato dei lavoratori a piazzare dei ricettacoli di seta, lungo le strade e i sentieri che attraversano Selvarden. Quella seta riuscirà a raccogliere un po\' di Animum, ma non abbastanza per i nostri bisogni.\n\nCerca la Seta Infusa d\'Animum e riportacela.', '', '', '', '', '', '', 39653),
(62195, 'itIT', 'L\'ultima parola', 'Aiuta Sabrina a liberare l\'Inquisitrice Oscursion.', 'L\'Inquisitrice Oscursion era un\'aspirante praticante delle arti arcane, prima di essere imprigionata da Denathrius.\n\nHo sentito che condividerà la sua conoscenza con chiunque la libererà dalla prigione.\n\nVoglio imparare tutto ciò che sa! Dobbiamo andare a liberarla!', '', '', '', '', '', '', 39653),
(62188, 'itIT', 'Stelle per aria', 'Recupera $1oa Stellaria Splendenti.', 'Mi serve il tuo aiuto per una... faccenda delicata, $n.\n\nLe Ali di Stellaria sono un ingrediente fondamentale per alcune delle nostre creazioni e la nostra scorta si è esaurita.\nSono creature minuscole, molto fragili, e io non sono in grado di maneggiarle con delicatezza.\n\nPotresti prendere delle Stellaria per me? Devono essere prese vive in modo che le ali non si rovinino, ne abbiamo disperatamente bisogno.\n\nMi assicurerò che tu venga $gricompensato:rincompensata; per il tuo tempo, naturalmente.', '', '', '', '', '', '', 39653),
