(61848, 'itIT', 'Editto di Rovina: Golem di Pietra del Peccato', 'Distruggi $1oa Golem di Pietra del Peccato a Revendreth.', 'Per ordine della vera Corte dei Mietitori, viene emanato un Editto di Rovina per tutti i Golem di Pietra del Peccato che si sono coalizzati in modo pericoloso per il regno.\n\nQueste entità sono la manifestazione dei peccati irrisolti di quelle anime che hanno fallito nel redimersi e sono state condannate alla Fauce. Con la recente siccità di Animum nella regione, questi Golem sono diventati pericolosamente forti.\n\nDevono essere espulsi dall\'esistenza. Verrà fornita una ricompensa a chi ci riuscirà.', '', '', '', '', '', '', 39653),
