(61523, 'itIT', 'La corsa al corpo', 'Riporta la Carcassa d\'Osso a Rathan all\'Isolato dei Macellai.', 'C\'è del lavoro da fare qui. Gnam gnam.\n\nC\'è una grossa carcassa vicino. Voglio recuperare dei pezzi.\n\nForse potresti venire insieme, aiutarmi a trascinarla da Rathan. Gli piacerebbe. Gnam gnam.\n\nPosso anche portarti lì e tornare indietro. Non sembri troppo grande.\n\n$gPronto:Pronta; a partire?', '', '', '', '', '', '', 39653),
