(61157, 'itIT', 'Prese per le corna', 'Ottieni $1oa Corna Elisie dalle bestie cornute.', 'Un tempo le bestie cornute del Bastione venivano usate nell\'addestramento degli Aspiranti, ma ormai sono state sostituite dalle unità d\'allenamento centurione. Nel corso degli ultimi eoni, il loro numero è cresciuto a dismisura e dobbiamo fare qualcosa per tenerle sotto controllo.\n\nLe loro corna sono un componente fondamentale del nostro lavoro, ma spesso si rovinano durante uno scontro, diventando inutilizzabili. Fai molta attenzione quando le recuperi.\n\nAffronta quelle bestie, sconfiggile e portami le loro corna.', '', '', '', '', '', '', 39653),
(61156, 'itIT', 'Dove c\'è una piuma...', 'Ottieni $1oa Penne di Vololuce dalle bestie volanti.', 'In tempi passati, gli Aspiranti si addestravano con la fauna del Bastione. La creazione dei Centurioni ha reso obsoleto tale progresso destrutturato.\n\nI vari abitanti volanti del regno sono conosciuti per la loro piume. Sono solide e leggeri, perfette ai nostri scopi.\n\nRaccogliere quante riesci. Andrà bene qualunque creatura volante.', '', '', '', '', '', '', 39653),
(60869, 'itIT', 'Con la speranza in mano', 'Stabilisci un portale per Orgrimmar ai Campi del Torneo d\'Argento. Porta la notizia a Lor\'themar Theron in cima al Mastio Grommash a Orgrimmar.', 'Devi far sapere cosa abbiamo scoperto a Orgrimmar. Uno dei nostri Maghi può aprirti un portale nei campi del torneo.\n\nQuanto alla Crociata d\'Argento, dobbiamo rimanere un bastione contro il Flagello. Se vuoi continuare ad aiutarci, mi preoccuperò che venga fatto buon uso delle tue abilità.\n\nChe la Luce ti protegga, $n.', '', '', '', '', '', '', 39653),
(60841, 'itIT', 'Ordine di evacuazione', 'Soccorri $1oa alleati nella Valle della Speranza Perduta. Uccidi $2oa membri del Flagello nell\'area.', 'Le nostre forze sono in pericolo e la colpa è mia. Credevo che l\'area circostante fosse sotto controllo, per cui ho mandato una piccola squadra a mettere al sicuro l\'accampamento abbandonato nella valle a sud-ovest.\n\nMa i nostri rapporti erano obsoleti o sbagliati. L\'accampamento è una causa persa, ora dobbiamo concentrarci sul mettere in salvo chi vi ho assegnato.\n\nDirigiti all\'accampamento. Fai ciò che puoi per salvare i nostri alleati.', '', '', '', '', '', '', 39653),
(60786, 'itIT', 'Le difese dello sciame', '', '', '', '', '', '', '', '', 39653),
(60761, 'itIT', 'Ritorno del Flagello', 'Porta il rapporto della Tenente Althera al Comandante Throgg nella Valle della Forza a Orgrimmar.', 'Consegna questi rapporti al Comandante Throgg. Deve essere informato della portata della minaccia che affrontiamo.\n\nSe non riusciremo a tenere testa al Flagello... che la Luce ci aiuti tutti.', '', '', '', '', '', '', 39653),
(60725, 'itIT', 'Rapporti sul campo', 'Raccogli i rapporti dagli ufficiali a Durotar e nelle Savane.', 'Non possiamo anticipare dove e quando colpirà il Flagello.\n\nPer organizzare una difesa, la Crociata d\'Argento ha organizzato degli avamposti in vari punti chiave, ma dobbiamo ancora ricevere loro notizie.\n\nCerca i miei ufficiali sul campo lungo la strada meridionale. Mi aspetto un rapporto completo quando tornerai.', '', '', '', '', '', 'Riferisci ciò che hai scoperto alla Tenente Althera al Crocevia.', 39653),
(60658, 'itIT', 'Un appetito interminabile', '', '', '', '', '', '', '', '', 39653),
(60616, 'itIT', 'Una perla negli abissi', 'Raccogli la Perla Gigante e consegnala all\'Oracolo Brillapinna.', '<L\'Oracolo disegna un cerchio nella sabbia, quindi indica verso il basso, verso le profondità. Sta cercando qualcosa che si trova là sotto, forse una perla o un sasso?>\n\n<L\'Oracolo con un cenno ti chiede di aspettare un momento prima di andartene. Muove le mani in modo convulso, poi le mette sotto la bocca, imitando due grandi zanne.>\n\n<Lo prendi come un avvertimento che potrebbe esserci qualcosa ad aspettarti nell\'oscurità gelida.>', '', '', '', '', '', '', 39653),
(60615, 'itIT', 'La veggente delle onde', 'Porta il grasso all\'Oracolo Brillapinna.', '<Brillaviscere indica la nave. Vuole che porti il grasso a qualcuno.>\n\nMrg m \'grrl.', '', '', '', '', '', '', 39653),
(60614, 'itIT', 'Una focaccia non è una foca cattiva', 'Recupera una Pila di Grasso e consegnala a Brillaviscere nella Baia della S.P.R. Co.', '<Brillaviscere inizia a disegnare nella sabbia.>\n\n<Il Murloc traccia la sagoma di quella che sembra una grossa foca. Indica il disegno, poi in avanti, lasciando intendere che la creatura dev\'essere da qualche parte sulla superficie dell\'acqua.>\n\n<Il Murloc poi scava un piccolo buco profondo nella sabbia, e lo indica diverse volte.>\n\nMrggn! Mrggn! Grml.\n\n<Quindi inclina la testa, in attesa.>', '', '', '', '', '', '', 39653),
(60602, 'itIT', 'Servizi segreti', '', '', '', '', '', '', '', '', 39653),
(60505, 'itIT', 'Tana dei ragni', 'Uccidi $1oa Tessitori Filrasoio e il Manipolatore Zalisar.', 'Quando la nostra casata cadde in rovina, il Manipolatore Zalisar colse l\'opportunità di riformarla sotto la sua guida. Trovò alcuni seguaci e scomparve presto nelle rovine qui vicino.\n\nOra ha iniziato a manipolare i ragni e addestrarli per essere i suoi soldati. Sotto il suo controllo hanno iniziato a predare le nostre forze. Dobbiamo occuparci di questa minaccia prima che peggiori.\n\nDevi eliminare il Manipolatore Zalisar e i suoi ragni.', '', '', 'Manipolatore Zalisar', '', '', '', 39653),
(60482, 'itIT', 'Osserva coi miei occhi', 'Recupera $1oa armi nascoste.', 'Dopo la distruzione della nostra casata, i ragni in quest\'area sono diventati sempre più ostili. Espandono il loro territorio e predano i pochi superstiti che vivono qui.\n\nCi sono delle armi che potremmo usare per proteggerci, ma sono nascoste all\'interno della Fortezza Cieca, avvolta tra le tele dei tessitori che ci abitano.\n\nRaggiungi la fortezza, usa la mia Visione Cieca per vedere le armi e recupera ciò che puoi.', '', '', '', '', '', '', 39653),
(60342, 'itIT', 'Abbattimento totale', 'Uccidi Bracitox nella Foresta Riesumata a Revendreth.', 'Stare con le mani in mano significa perdere delle opportunità. Devo tenere le mie mani occupate, altrimenti queste lame potrebbero sembrare inutili!\n\nHo sentito che c\'è un Divoratore a Revendreth alto come una casa. Mostriamo agli altri costrutti un paio di mosse eliminando quel mostro!', '', '', 'Bracitox', '', '', '', 39653),
(60215, 'itIT', 'La rovina vien di notte con le calze tutte rotte', 'Sconfiggi il Calcarovina a Tanaris.', 'Hai visto quel mostro meccanico gigante camminare tra le dune là fuori? Viene da un luogo fuori da questo tempo, e non è neanche di Azeroth!\n\nI flussi temporali sono proprio svitati in questo periodo dell\'anno.\n\n<Cromie tira fuori un piccolo cronometro e lo maneggia. Sembra essersi dimenticata di te per un momento.>\n\nOh, sei ancora qui! Fantastico. Ti andrebbe di fare fuori quella cosa? Altrimenti la gente potrebbe avere problemi a unirsi alla festa!', '', '', '', '', '', '', 39653),
(60117, 'itIT', 'Il ritorno della Crociata', 'Parla con il Comandante Gregor nel Distretto Commerciale di Roccavento.', 'La fame senza controllo del Flagello è stata scatenata. È solo questione di tempo prima che quei mostri sciamino nelle nostre strade.\n\nAbbiamo bisogno di esperti per affrontare questa minaccia. I Cavalieri della Morte della Spada d\'Ebano si sono fatti avanti per aiutarci, ma non possono farlo da soli.\n\nLa Crociata d\'Argento ha risposto alla chiamata. Devi lavorare con loro per tenere al sicuro la nostra gente, $n.\n\nHo avvertito il loro comandante del tuo arrivo. Ti attende al loro accampamento all\'interno delle porte della città.', '', '', '', '', '', '', 39653),
(60116, 'itIT', 'Causare un diversivo', 'Parla con Genn Mantogrigio al Riposo del Leone a Roccavento.', 'Il cuore stesso dell\'Alleanza è sotto attacco.\n\nIl Flagello dei non morti si sta radunando in numeri mai visti dal ritorno di Arthas Menethil. Tra il caos, è successo qualcosa di... terribile.\n\nCiò che sto per condividere con te non è ancora stato rivelato ai nostri alleati. Saranno avvertiti a tempo debito, ma devo parlare con te direttamente prima che arrivi la notizia.\n\nFammi spiegare.', '', '', '', '', '', '', 39653),
(59598, 'itIT', 'Un bene per l\'anima', 'Parla con Merick.', 'Due anime sono meglio di una! Possiamo realizzare imprese molto più grandi assieme di quante possiamo se siamo da soli.\n\nTuttavia, non siamo solo noi due contro tutte le minacce. Ci sono molti altri che ci aiuteranno nelle prossime battaglie.\n\nParliamo con Merick per saperne di più sull\'argomento. Non essere $gtimido:timida;, posso presentarti!', '', '', '', '', '', '', 39653),
(59259, 'itIT', 'Il Tormentatore Eterno', '', '', '', '', '', '', '', '', 39653),
(58601, 'itIT', 'Tela d\'informazioni', '', '', '', '', '', '', '', '', 39653),
(56470, 'itIT', 'Un osso per un cane', 'Ottieni $1oa pezzi di Carne di Mangiamidollo dai Mangiamidollo Giganti.', 'Louison mi ha prestato Ossoduro per aiutare a scovare alcuni Mangiamidollo, ma ho da fare coi fornelli qui. Saresti così gentile da andare a caccia per me?\n\nOssoduro adora uccidere i Mordicchi più piccoli e fa un sacco di rumore mentre lo fa. Questo spaventerà i Mangiamidollo più grandi, che cercheranno di scappare. È in quel momento che dovrai fare la tua mossa.\n\nUsa quest\'Osso Saporito per attirare Ossoduro vicino ai Mordicchi. Oh, e non dimenticare di raccogliere la Carne dai Mangiamidollo Giganti, dopotutto è il motivo per cui stiamo facendo tutto questo.', '', '', '', '', '', '', 39653),
(56364, 'itIT', 'Requisizioni di Bullonaccio: Aringa Frenetica', 'Porta $1oa pezzi di Minerale di Argento della Tempesta a Skaggit.', '', '', '', '', '', '', '', 39653),
(56363, 'itIT', 'Requisizioni di Bullonaccio: Aringa Frenetica', 'Porta $1oa pezzi di Minerale di Argento della Tempesta a Gila Intrecciacavi.', '', '', '', '', '', '', '', 39653),
