(39129, 'itIT', 'Irritabilità', 'Porta i Piani per il Condizionamento degli Squali al Carpentiere Navale della tua Guarnigione.', '<Togliendo il tappo della custodia di pergamene, scopri che l\'Orda di Ferro ha un piano per utilizzare gli enormi pesci che vivono negli oceani che circondano Draenor al fine di interferire con la potenza navale di Orda e Alleanza. Incredibilmente, il piano sembra già aver funzionato sugli squali più piccoli... ma solo fino a un certo punto.>', '', '', '', '', '', '', 39653),
(32390, 'itIT', 'La chiamata del Lupo', 'Parla con Irathion.', '$C, attraverso i tuoi occhi sono riuscito ad assistere alla battaglia lungo la costa, così come a tutte le altre battaglie nel resto del mondo. Sei $gstato:stata; molto paziente... e molto utile.$b$bHo anche tenuto sotto controllo il tuo re; vuoi sapere cosa ho scoperto?', '', '', '', '', '', '', 39653),
(30122, 'itIT', 'Bottiglia di Filigrana d\'Argento', 'Riempi la bottiglia con una potente mistura alchemica.', 'Hai trovato una splendida bottiglia d\'argento decorata con della filigrana. Con i giusti materiali, e la tua abilità in Alchimia, potrebbe trasformarsi in qualcosa di magico.', '', '', '', '', '', '', 39653),
(14111, 'itIT', 'Relic of the Earthen Ring', 'Bring your four totems to Farseer Eannu in Ironforge.', 'You have progressed far in your training, $n. Now that you have mastered the four basic elements, you must strive to keep all four in balance. There is a practical benefit to this discipline - with practice, you may carry only a single relic instead of all four totems.$B$BSpeak to Farseer Eannu near the Great Forge in Ironforge. He will help you hone your mastery of the elements.', '', '', '', '', '', '', 39653),
(10491, 'itIT', 'Call of Air', 'Speak with Farseer Nobundo at the Crystal Hall inside the Exodar on Azuremyst Isle.', '$n, once again Farseer Nobundo has been asking for you.  It must be time for you to learn the secrets of air, the last of the elements!$B$BI want you to know that I\'m very proud of all that you have accomplished thus far.  I know that you have great things ahead of you.$B$BTake the boat from Auberdine in Darkshore on Kalimdor.  Cross the Veiled Sea and seek out the farseer inside the Crystal Hall of the Exodar on Azuremyst Isle.', '', '', '', '', '', '', 39653),
(9985, 'itIT', 'Ospite della Città Nascosta', 'Porta gli Ordini di Luanga a Kurgatok al Mastio di Spaccapietra, nella Foresta di Terokk.', '<Anche se non puoi leggere la strana scritta sulla pergamena, l\'elaborato sigillo alla fine del documento implica che è stato redatto da un importante Arakkoa. Luanga può aver architettato la cattura e l\'interrogatorio di Dugar, ma a quanto pare prendeva ordini da qualcun altro.>$B$B<Ricordi che Rokag ha detto che Kurgatok ha studiato gli Arakkoa... Forse lui può decifrare il contenuto della pergamena.>', '', '', '', '', '', '', 39653),
(9504, 'itIT', 'Call of Water', 'Fill the Empty Bota Bag and then return to Aqueous in the Hidden Reef at Bloodmyst Isle.', 'It is worse than I feared. The corruption is very potent and if unchecked it could spread to the ocean currents and be carried throughout all of Azeroth!$B$BWe are going to need a sample of the purest water to counter this malignancy. There are ruins on the untainted portion of this island, to the southeast. Go there, where the Wrathscale naga reside, and take from their fountain.$B$BUse this bota bag to gather the sample. Hurry, $n!', '', '', '', '', '', '', 39653),
(4783, 'itIT', 'Components for the Enchanted Gold Bloodrobe', 'Bring 10 Vials of Hatefury Blood and 1 Lesser Infernal Stone to Menara Voidrender in the Barrens.', 'The next components are found in Desolace, far to the west of the Barrens and even the Stonetalon Mountains.$B$BThere, chaos still reigns after the Sundering. Both your strength and cunning will be tested there--you will face creatures of hatred and also of the Burning Legion.$B$BFrom the Hatefury satyr in the northeast, bring me their blood. From the lesser infernals in Mannoroc Coven, bring me a lesser infernal stone.$B$BWe will use both in the construction of your robe.', '', '', '', '', '', '', 39653),
(324, 'itIT', 'The Lost Ingots', 'Gather 5 Lightforge Ingots, then return to Glorin Steelbrow in the Wetlands.', 'Having grabbed the single lightforge ingot from the waterlogged chest, it is clear that murlocs have stolen the rest.  Hunt the murloc raiders near the Flying Osprey wreckage for the lost lightforge iron.', '', '', '', '', '', '', 39653);
